INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES (6,1,'Информация о доставке','&lt;p&gt;\r\n	Информация о доставке&lt;/p&gt;\r\n','','','',''),(6,2,'Delivery Information','&lt;p&gt;Delivery Information&lt;br&gt;&lt;/p&gt;','','','',''),(3,1,'Политика безопасности','&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Администрация Интернет-магазина гарантирует обеспечение полной конфиденциальности информации, полученной от зарегистрированных пользователей.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Вся информация, которую Вы укажите при регистрации, будет храниться в защищенной базе данных. Интернет-магазин гарантирует полную конфиденциальность при исполнении заказа, а также то, что информация о покупателе будет использована только для исполнения поступившего заказа.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Ваши регистрационные данные нам нужны исключительно для того, чтобы наши менеджеры смогли с Вами связаться по телефону, а служба доставки смогла доставить заказанный Вами товар в нужное место в срок.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Кроме того, зарегистрировавшись, Вы сможете получать информацию о всех новостях нашего магазина: новых поступлениях товара, распродажах, специальных программах.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Если у Вас возникнут какие-либо проблемы или вопросы по авторизации или регистрации в магазине - пишите на адрес электронной почты support@alyansss.ru и мы всегда поможем Вам!&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Представители интернет-магазина&amp;nbsp; &amp;nbsp;никогда не попросят у Вас данные пластиковой карты или другие конфиденциальные реквизиты.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;b&gt;Общие положения:&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1. Некоторые объекты, размещенные на сайте, являются интеллектуальной собственностью интернет-магазина. Использование таких объектов установлено действующим законодательством РФ.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2. На сайте интернет-магазина имеются ссылки, позволяющие перейти на другие сайты. Интернет-магазин не несет ответственности за сведения, публикуемые на этих сайтах, и предоставляет ссылки на них только в целях обеспечения удобства для посетителей своего сайта.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;b&gt;Личные сведения и безопасность:&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1. Интернет-магазин гарантирует, что никакая полученная от Вас информация никогда и ни при каких условиях не будет предоставлена третьим лицам, за исключением случаев, предусмотренных действующим законодательством Российской Федерации.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2. В определенных обстоятельствах интернет-магазин может попросить Вас зарегистрироваться и предоставить личные сведения. Предоставленная информация используется исключительно при обработке заказа в Интернет-магазине или для предоставления посетителю доступа к специальной информации.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4. Для того чтобы обеспечить Вас информацией определенного рода, интернет-магазин с Вашего явного согласия может присылать на указанный при регистрации адрес электронный почты информационные сообщения. В любой момент Вы можете отказаться от нее.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5. Как и многие другие сайты, Интернет-магазин использует технологию cookie, с помощью которой он настраивается на работу лично с Вами. В частности, без этой технологии невозможна работа с корзиной.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6. Сведения на данном сайте имеют чисто информативный характер, в них могут быть внесены любые изменения без какого-либо предварительного уведомления.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7. Настоящим Вы выражаете свое согласие для использования&amp;nbsp; Продавцом /или уполномоченным лицом Продавца Ваших персональных данных, в целях определенных Уставом Продавца, различными способами, в том числе путем осуществления автоматизированного анализа персональных данных, а также на их передачу различными способами, без ограничения срока действия. В соответствии с п.&amp;nbsp; 5 ст. 21 ФЗ «О персональных данных» настоящее согласие может быть отозвано только при условии письменного уведомления не менее чем за 5 календарных дней до предполагаемой даты прекращения использования персональных данных. Порядок обработки персональных данных: обработка персональных данных происходит в течение суток после оформления заказа.&lt;/span&gt;&lt;/p&gt;','Политика безопасности | Альянсстройснаб','Администрация Интернет-магазина гарантирует обеспечение полной конфиденциальности информации, полученной от зарегистрированных пользователей.','политика безопасности альянстроснаб, безопасность альянстроснаба','Политика безопасности'),(5,1,'Условия соглашения','&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Условные обозначения&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Интернет-магазин – сайт имеющий адрес в сети Интернет http://alyansss.ru&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Товар – продукция, представленная к продаже в интернет-магазине.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Продавец – менеджер компании АЛЬЯНССТРОЙСНАБ.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Клиент – разместившее Заказ физическое лицо.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Заказ – оформленный должным образом запрос Клиента на покупку Товара.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Служба доставки – Наш сотрудник на машине или третье лицо, оказывающее по договору с Продавцом услуги по доставке Товаров Клиентам.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1. Общие положения&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1.1. Настоящие Условия являются публичной офертой в соответствии с законодательством РФ.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1.2. Заказывая товары через Интернет-магазин, Клиент соглашается с настоящими Условиями. Фактом акцепта оферты является нажатие кнопки «Купить» на последнем этапе оформления Заказа.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1.3. Продавец оставляет за собой право вносить изменения в настоящие Условия, в связи с чем, Клиент обязуется регулярно отслеживать изменения в Условиях.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2. Оформление Заказа&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.1. Для оформления Заказа необходимо в оформлении заказа указать свои контактные данные для связи.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.2. Продавец не несет ответственности за достоверность информации, предоставляемой Клиентом при регистрации.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.3. Клиент обязуется не сообщать третьим лицам логин и пароль, указанные при регистрации. В случае возникновения у Клиента подозрений относительно безопасности его логина и пароля или возможности их несанкционированного использования третьими лицами, Клиент обязуется незамедлительно уведомить об этом Продавца по электронной почте.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.4. Заказ Клиента может быть оформлен следующими способами: принят по телефону или оформлен Клиентом самостоятельно в Интернет-магазине.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.5. После оформления Заказа Клиенту предоставляется информация об ожидаемой дате передачи Товара Клиенту. Указанная дата зависит от наличия заказанных Товаров на складе Продавца и времени, необходимого на обработку Заказа.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.6. Если Клиентом оформлен Заказ на Товар в количестве, превышающем имеющееся в наличии на складе у Продавца, Продавец информирует об этом Клиента посредством направления сообщения по электронной почте или по телефону, указанным Клиентом при регистрации. Клиент вправе согласиться принять Товар в количестве, имеющемся в наличии у Продавца, либо аннулировать данную позицию Товара из Заказа. В случае неполучения ответа Клиента в течение 5 дней после уведомления, Продавец оставляет за собой право аннулировать данный Товар из Заказа.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.7. Все информационные материалы, представленные на Сайте, носят справочный характер и не могут в полной мере передавать достоверную информацию о свойствах и характеристиках Товара, включая цвета, размеры и формы. В случае возникновения у Клиента вопросов, касающихся свойств и характеристик Товара, перед оформлением Заказа, Клиент должен обратиться к Продавцу.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.8. В случае отсутствия заказанных Товаров на складе Продавца, в том числе по причинам, не зависящим от Продавца, Продавец вправе аннулировать указанный Товар из Заказа Клиента и уведомить об этом Клиента путем направления электронного сообщения по адресу, указанному при регистрации.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.9. В случае аннулирования предоплаченного Заказа, сумма предоплаты полностью возвращается Продавцом Клиенту согласованным сторонами способом.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3. Доставка&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3.1. Доставка осуществляется силами Продавца и за счет средств продавца на территории Перми.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3.2. Доставка осуществляется в рабочие дни.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3.3. Продавец приложит все усилия для соблюдения сроков доставки, тем не менее, не исключает задержки в доставке ввиду обстоятельств, не зависящих от Продавца (в том числе, но не только, автомобильные пробки, аварии, поломки).&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3.9. Продавец гарантирует конфиденциальность и защиту персональной информации получателя.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4. Оплата Товара&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.1. Цена Товара указывается в Интернет-магазине.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.2. Цена Товара в Интернет-магазине может быть изменена Продавцом в одностороннем порядке. Цена не меняется если товар оплачен 100% по средствам электронных платежей на счет интернет-магазина.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.3. Клиент может оплатить Товар одним из следующих способов:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• наличными&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• посредством перечисления средств на счет Продавца&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.4. При предоплате Товаров Заказ принимается в обработку только после зачисления денежных средств Клиента на расчетный счет Продавца.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.5. Продавец вправе предоставлять Клиенту скидки на Товар и устанавливать программу бонусов. Виды скидок, бонусов, порядок и условия начисления указаны в Интернет-магазине и могут быть изменены Продавцом в одностороннем порядке.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5. Возврат Товара&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.1. Клиент вправе отказаться от заказанного Товара в любое время до его получения, а после получения Товара – в течение 7 дней, не считая дня покупки. Возврат Товара надлежащего качества возможен в случае, если сохранены его товарный вид, потребительские свойства, упаковка, а также документ, подтверждающий факт и условия покупки указанного Товара.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.2. Клиент не вправе отказаться от Товара надлежащего качества, имеющего индивидуально-определенные свойства, если указанный Товар может быть использован исключительно приобретающим его Клиентом.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.3. При отказе Клиента от Товара согласно п.5.1 Условий Продавец возвращает ему стоимость возвращенного Товара, за исключением расходов продавца на доставку от Клиента возвращенного Товара, не позднее чем через 10 дней с даты получения Продавцом письменного заявления Клиента.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.4. В течение 14 дней с момента получения Товара, не считая дня покупки, Клиент вправе обменять товар надлежащего качества на аналогичный товар, если указанный товар не подошел Клиенту по форме, габаритам, фасону, расцветке, размеру или комплектации. Клиент не вправе обменять Товары надлежащего качества, указанные в Перечне непродовольственных товаров надлежащего качества, не подлежащих возврату или обмену, утвержденному Правительством РФ.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.5. Если на момент обращения Клиента аналогичный товар отсутствует в продаже у Продавца, Клиент вправе отказаться от исполнения договора купли-продажи и потребовать возврата уплаченной за указанный товар денежной суммы. Продавец обязан вернуть уплаченную за возвращенный Товар денежную сумму в течение 3 дней со дня возврата товара.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.6. Клиент может возвратить Товар ненадлежащего качества изготовителю или Продавцу и потребовать возврата уплаченной денежной суммы в течение гарантийного срока, срока годности либо, если такой срок не установлен, в разумный срок, не превышающий два года. Клиент также может потребовать замены Товара ненадлежащего качества либо устранения недостатков.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.7. В случае отказа Клиента от договора и предъявления требования о возврате уплаченной за товар денежной суммы согласно п.5.6 Условий, стоимость Товара подлежит возврату Клиенту в течение 10 дней с момента получения Продавцом письменного заявления Клиента.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.8. В случае если возврат денежных средств осуществляется неодновременно с возвратом товара Клиентом, возврат указанной суммы осуществляется Продавцом с согласия Клиента одним из следующих способов:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• наличными денежными средствами по месту нахождения Продавца;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• почтовым переводом;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• путем перечисления соответствующей суммы на счет, указанный Клиентом.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6. Гарантии и ответственность&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6.1. Продавец не несет ответственности за ущерб, причиненный Клиенту вследствие ненадлежащего использования Товаров, заказанных в Интернет-магазине.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6.2. Продавец вправе переуступать либо каким-либо иным способом передавать свои права и обязанности, вытекающие из его отношений с Клиентом, третьим лицам.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6.3. Клиент обязуется не использовать заказанный Товар в предпринимательских целях.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7. Конфиденциальность и защита персональной информации&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7.1. При регистрации в Интернет-магазине Клиент предоставляет следующую информацию:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• фамилию и имя Клиента&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• адрес электронной почты Клиента&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• адрес доставки Товара (в случае заказа Клиентом доставки Товара)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• контактный телефон&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• пароль и логин&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7.2. Продавец использует информацию, представленную Клиентом, в следующих случаях:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• для регистрации Клиента в Интернет-магазине;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• для выполнения своих обязательств перед Клиентом;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• для анализа работы Интернет-магазина;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• для направления Клиенту сообщений рекламно-информационного характера&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;• для определения победителя в акциях, проводимых Продавцом.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7.3. Продавец обязуется не разглашать полученную от Клиента информацию. Не считается нарушением предоставление Продавцом информации агентам и третьим лицам, действующим на основании договора с Продавцом, для исполнения обязательств перед Клиентом, и только в объеме, необходимом для исполнения ими своих обязательств.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7.4. Не считается нарушением обязательств разглашение информации в соответствии с обоснованными и применимыми требованиями законодательства РФ.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7.5. Продавец вправе использовать технологию “cookies”. “Cookies” не содержат конфиденциальную информацию и не передаются третьим лицам.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7.6. Продавец получает информацию об ip-адресе посетителя Интернет-магазина. Данная информация не используется для установления личности посетителя.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;7.7. Продавец не несет ответственности за конфиденциальность сведений, предоставленных Клиентом в общедоступной форме.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;8. Прочие условия&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;8.1. К отношениям между Клиентом и Продавцом применяется право Российской Федерации.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;8.2. В случае возникновения вопросов и претензий со стороны Клиента он должен обратиться к Продавцу, используя контактную информацию, размещенную в Интернет-магазине. Все возникающее споры стороны будут стараться решить путем переговоров, при недостижении соглашения спор будет передан на рассмотрение в судебный орган в соответствии с действующим законодательством РФ.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;8.3. Признание судом недействительности какого-либо положения настоящих Условий не влечет за собой недействительность остальных положений.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;8.4. Вся текстовая информация и графические изображения, находящиеся в Интернет-магазине, являются собственностью Продавца и/или его контрагентов.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n','Условия соглашения | Альянстройснаб','Условаия соглашение между Продавцом и Покупателем в интернет-магазине АЛЬЯНССТРОЙСНАБ','Условия соглашение альянстройснаба, соглашение альянстройснаб','Условия соглашения'),(4,1,'О нас','&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;center&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;b&gt;Любые стройматериалы вовремя и без переплат!&lt;/b&gt;&lt;/span&gt;&lt;/center&gt;&lt;p&gt;&lt;/p&gt;&lt;br&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Наш интернет-магазин предлагает большой выбор строительных и отделочных материалов, с доставкой по адресу в удобное для Вас время.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Предлагаем особые условия для отделочников и строителей.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Работаем по городу Пермь и Пермскому краю. Для получения стройматериалов просто зайдите на сайт нашего магазина и выбрав необходимые стройматериалы укажите адрес по которому необходимо осуществить доставку.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Наши услуги востребованы всеми кто хочет построить свой дом, кто занимается занимается хозяйственной деятельностью, и кто впервые столкнулся с ремонтом.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n','','','','');
/*!40000 ALTER TABLE `oc_information_description` ENABLE KEYS */;
UNLOCK TABLES;

