INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES (1,1,'ocStore next default','next-default','AWARO','3.0','https://opencartforum.com/user/28051-awaro/','<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n  <name>ocStore next default</name>\r\n  <code>next-default</code>\r\n  <version>3.0</version>\r\n  <author>AWARO</author>\r\n  <link>https://opencartforum.com/user/28051-awaro/</link>\r\n\r\n  <file path=\"catalog/controller/extension/module/{bestseller,featured,latest,special}*.php\">\r\n    <operation>\r\n        <search><![CDATA[public function index($setting) {]]></search>\r\n        <add position=\"after\"><![CDATA[\r\n			static $module = 0;\r\n			$this->document->addStyle(\'catalog/view/javascript/jquery/swiper/css/swiper.min.css\');\r\n			$this->document->addStyle(\'catalog/view/javascript/jquery/swiper/css/opencart.css\');\r\n			$this->document->addScript(\'catalog/view/javascript/jquery/swiper/js/swiper.jquery.js\');\r\n		]]></add>\r\n    </operation>\r\n    <operation>\r\n        <search><![CDATA[if ($data[\'products\']) {]]></search>\r\n        <add position=\"before\"><![CDATA[\r\n			$data[\'module\'] = $module++;\r\n        ]]></add>\r\n     </operation>\r\n  </file>\r\n  <file path=\"catalog/controller/common/header.php\">\r\n    <operation>\r\n        <search><![CDATA[$data[\'cart\'] = $this->load->controller(\'common/cart\');]]></search>\r\n        <add position=\"after\"><![CDATA[\r\n			$data[\'pos_slider\'] = $this->load->controller(\'common/pos_slider\');\r\n        ]]></add>\r\n    </operation>\r\n  </file>\r\n  <file path=\"catalog/controller/common/footer.php\">\r\n    <operation>\r\n        <search><![CDATA[return $this->load->view(\'common/footer\', $data);]]></search>\r\n        <add position=\"before\"><![CDATA[\r\n			$data[\'pos_map\'] = $this->load->controller(\'common/pos_map\');\r\n        ]]></add>\r\n    </operatio