arch ><![CDATA[public function index() {]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n				if($this->config->get(\'config_maintenance\')){\r\n					$this->load->language(\'setting/setting\');\r\n					$data[\'maintenanceheader\'] = \'<div class=\"alert alert-danger\"><i class=\"fa fa-exclamation-circle\"></i> \' . $this->language->get(\'entry_maintenance\') . \'</div>\';\r\n				} else {\r\n					$data[\'maintenanceheader\'] = false;\r\n				}\r\n				]]></add>\r\n        </operation>\r\n    </file>\r\n	\r\n    <file path=\"admin/view/template/common/dashboard.tpl\">\r\n        <operation>\r\n            <search><![CDATA[{% if error_install %}]]></search>\r\n            <add position=\"before\"><![CDATA[{{ maintenanceheader }}]]></add>\r\n        </operation>\r\n    </file>\r\n	\r\n</modification>',1,'2019-11-15 15:43:09'),(11,15,'Export/Import Tool (V3.21) for OpenCart 3.x','Export/Import Tool (V3.21) for OpenCart 3.x','mhccorp.com','3.x-3.21','https://www.mhccorp.com','<modification>\n	<name>Export/Import Tool (V3.21) for OpenCart 3.x</name>\n	<code>Export/Import Tool (V3.21) for OpenCart 3.x</code>\n	<version>3.x-3.21</version>\n	<author>mhccorp.com</author>\n	<link>https://www.mhccorp.com</link>\n	<file path=\"admin/controller/common/column_left.php\">\n		<operation>\n			<search><![CDATA[if ($this->user->hasPermission(\'access\', \'tool/upload\')) {]]></search>\n			<add position=\"before\"><![CDATA[\n			if ($this->user->hasPermission(\'access\', \'extension/export_import\')) {\n				$maintenance[] = array(\n					\'name\'	   => $this->language->get(\'text_export_import\'),\n					\'href\'     => $this->url->link(\'extension/export_import\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n					\'children\' => array()		\n				);\n			}\n			]]></add>\n		</operation>\n	</file>\n	<file path=\"admin/language/*/common/column_left.php\">\n		<operation>\n			<search><![CDATA[$_[\'text_backup\']]]></search>\n			<add position=\"after\"><![CDATA[\n$_[\