INSERT INTO `oc_order_history` (`order_history_id`, `order_id`, `order_status_id`, `notify`, `comment`, `date_added`) VALUES (1,1,2,1,'Инструкции по банковскому переводу\n\nСделайте перевод денег по номеру карты XXXX-XXXX-XXXX-XXXX с номером заказа.\r\n\r\nОбработка платежа может занимать до 24 часов\n\nЗаказ не будет обработан, пока деньги не поступят на наш расчетный счёт.','2019-11-14 02:59:14'),(2,1,2,1,'Инструкции по банковскому переводу\n\nСделайте перевод денег по номеру карты XXXX-XXXX-XXXX-XXXX с номером заказа.\r\n\r\nОбработка платежа может занимать до 24 часов\n\nЗаказ не будет обработан, пока деньги не поступят на наш расчетный счёт.','2019-11-14 02:59:35'),(3,2,1,0,'','2019-11-14 03:03:14'),(4,2,1,0,'','2019-11-14 03:03:21'),(5,2,5,0,'','2019-11-14 03:16:41'),(6,4,1,0,'','2019-11-14 18:18:16'),(7,5,1,0,'','2019-11-14 18:18:40'),(8,6,1,0,'','2019-11-14 18:21:23'),(9,7,1,0,'','2019-11-15 00:52:35'),(10,8,1,0,'','2019-11-15 15:01:56'),(11,9,1,0,'','2019-11-15 15:04:00'),(12,10,1,0,'','2019-11-15 15:05:27'),(13,11,1,0,'','2019-11-15 15:08:32'),(14,12,1,0,'','2019-11-15 15:14:29'),(15,12,2,0,'','2019-11-15 15:14:41'),(16,13,1,0,'','2019-11-15 15:28:02'),(17,13,2,0,'','2019-11-15 15:28:27'),(18,14,1,0,'','2019-11-15 15:32:06'),(19,15,2,1,'Инструкция по оплате:\n\n<p>Если вы - счастливый обладатель карты СБРФ, вы можете осуществить платеж через Сбербанк Онлайн.<br />\r\nВ Сбербанке Онлайн выберите пункт меню \"Платежи и переводы\", далее \"перевод клиенту Сбербанка\".<br />\r\nПереведите сумму в размере 235.00р. на карту: 5469 0000 0000 1111 (Василий Иванович П.).<br />\r\nВ сообщении (комментарии) получателю укажите: \"За заказ №15\"</p><p><br></p><p>Если оплачиваете через банкомат или кассу, после оплаты пришлите квитанцию на почту info@nbmart.ru, для подтверждения.<br style=\"\">Данная инструкция так же отправлена Вам на e-mail<br style=\"\"></p><p style=\"margin-bottom: 10px;\">Если у вас возникнут какие либо вопросы, пожалуйста,&nbsp;<a href=\"https://nb