INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES (51,1,'Кабель UTP 4PR Cat5e Cu indoor (PVC) 305м SuprLan standart','&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;SUPRLAN Premium — LAN-кабель высшего класса, отличающийся полным соответствием требованиям категории 5е по стандартам ISO/IEC11801, EN 50173, TIA/EIA568 и ГОСТ 54429-2011.&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;Данный кабель предназначен для прокладки внутри зданий. Предназначен для следующих задач: построение различных компьютерных информационных сетей, VoIP и IPTV, систем охраны и видеонаблюдения, для центров обработки данных.&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;Кабели изготавливаются в исполнении нг(А)-HF (или LS / LSLTx) по «ГОСТ 31565-2012 Требования пожарной безопасности», что позволяет применять их в зданиях и сооружениях с массовым пребыванием людей, в том числе в многофункциональных высотных зданиях и бизнес-центрах.&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;Согласно ГОСТ 53315-2009 «Кабельные изделия. Требования пожарной безопасности» (в настоящее время&amp;nbsp;заменен на ГОСТ 31565-2012) кабель в оболочке нг(А)-LSLTx предназначена для использования в дошкольных, медицинских учреждениях, в местах большого скопления людей (торговых центрах, жилых комплексах и других учреждениях, где людям необходимо больше времени для эвакуации в силу их возраста или физического здоровья). С введением в действие этого ГОСТ появилась норма токсичности кабелей, применяемых на социальных объектах.&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;В соответствии со ст. 141 Федерального закона от 22.07.2008 № 123-ФЗ &quot;Технический регламент о требованиях пожарной безопасности&quot; показатели пожарной опасности электротехнической продукции должны соответствовать области применения электротехнической продукции. В соответствии со ст. 38 Федерального закона от 21.12.1994 г. № 69-ФЗ «О пожарной безопасности», ответственность за нарушение требований пожарной безопасности в соответствии с действующим законодательством несут: собственники имущества;&amp;nbsp;лица, уполномоченные владеть, пользоваться или распоряжаться имуществом, в том числе руководители организаций; лица, в установленном порядке назначенные ответственными за обеспечение пожарной безопасности;&amp;nbsp;должностные лица в пределах их компетенции. Эти лица за правонарушения в области пожарной безопасности могут быть привлечены к дисциплинарной, административной или уголовной ответственности.&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 10px; font-size: 12px; text-align: justify; color: rgb(32, 32, 32); line-height: 16px; font-family: Arial, Cambria, &amp;quot;Hoefler Text&amp;quot;, &amp;quot;Liberation Serif&amp;quot;, Times, &amp;quot;Times New Roman&amp;quot;, serif; margin-bottom: 2px !important;&quot;&gt;Согласно ГОСТ 31565-2012, при прокладке групп кабелей в дошкольных учреждениях, школах и образовательных учреждениях, больницах и других учреждениях, где людям может потребоваться больше времени на эвакуацию, должны использоваться типы кабельных изделий с оболочкой «нг( )-LSLTx» и выше.&lt;/p&gt;','кабель utp 5e, кабель suprlan','1','','',''),(52,1,'Арматура А-3 Ø6мм 6м','&lt;p style=&quot;margin-bottom: 11px;&quot;&gt;Предназначена для армирования различных бетонных конструкций чтобы повысить их прочность на сжатие, растяжение и изгиб, а также для других видов строительных работ.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 11px;&quot;&gt;Арматура рифленая (периодического профиля) представляет собой круглые профили с двумя продольными ребрами и поперечными выступами, идущими по винтовой линии. Поперечные выступы дают лучшее сцепление с бетоном. Поэтому строительная арматура периодического профиля чаще применяется в массивных конструкциях с толстым бетонным слоем.&lt;/p&gt;','арматура','1','','',''),(53,1,'Кабель LC FTP4 cat5e 305м Cu наружный и двойная изол (черный)','&lt;p style=&quot;padding: 0px 0px 10px; line-height: 16px; margin-bottom: 2px !important;&quot;&gt;Кабель витая пара FTP 4 применяется в системах СКС. В нашем ассортименте представлен кабель FTP4 для внутренних и наружных работ.&lt;br style=&quot;margin: 0px; padding: 0px; outline: none 0px;&quot;&gt;Кабель соответствует стандартам ANSI\\TIA\\EIA-568-B.2&lt;br style=&quot;margin: 0px; padding: 0px; outline: none 0px;&quot;&gt;Огнестойкость: UL VW-1, IEC-332.1&lt;br style=&quot;margin: 0px; padding: 0px; outline: none 0px;&quot;&gt;Монтажная проволока позволяет легко удалять оболочку кабеля на необходимую длину.&lt;br style=&quot;margin: 0px; padding: 0px; outline: none 0px;&quot;&gt;Экран - алюминиевая фольга.&lt;br&gt;&lt;/p&gt;','кабель ftp 5e, кабель lc','1','','',''),(94,1,'Грунт-концентрат по гипсу и гипсовой плитке, для сухих помещений (10 л)','&lt;p&gt;Грунт-концентрат для отделки строительными смесями для сухих помещений идеально подходит для выполнения ремонтных работ большого объема.&lt;/p&gt;&lt;p&gt; Используется перед выравниванием стен и пола для укрепления основания и улучшения адгезии со стройматериалами.\r\nПроизводится в России. Объем тары 10 л. Срок годности концентрата 24 месяца. Допускается транспортировка при минусовых температурах, кратковременное замораживание/размораживание, но не более 5 раз.\r\nОсобенности\r\nПеред использованием грунт разбавляется водой 1 к 10. В готовом виде раствор не имеет запаха. После высыхания становится полностью бесцветным.\r\nНаносить раствор нужно на очищенную от осыпающихся элементов, жира и пыли, хорошо просушенную поверхность (бетон, штукатурку, гипсокартон, кирпич, плитку). Температура в помещении должна быть не ниже +12 °C. Слой высыхает за 2 часа.&lt;/p&gt;','','1','','',''),(55,1,'Штукатурка гипсовая Ротгипс (10 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Штукатурка гипсовая Ротгипс&amp;nbsp;используется для базового выравнивания стен и потолков в сухих помещениях. Не требует шпаклевания. Главный компонент строительной смеси — высококачественный гипс, который представляет собой экологически чистый и легкий материал. Вес упаковки — 25 кг.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Гипсовую штукатурку нельзя задействовать в условиях высокой влажности, в остальном она универсальна и может применяться для разных оснований:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;бетона разной структуры (плотного и ячеистого);&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;цементной штукатурки;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;камня и кирпича;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;пенополистирола и ЦСП.&lt;/li&gt;&lt;/ul&gt;&lt;h3 style=&quot;margin-top: 19px; margin-bottom: 9.5px;&quot;&gt;Преимущества гипсовой штукатурки&lt;/h3&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Материал «дышит», регулирует количество влаги в воздухе, поглощая ее при избытке и отдавая при недостатке. Создает благоприятный микроклимат в помещении.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Смесь пластична и удобна в нанесении, работать с ней легче, чем с другими видами штукатурки.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Покрытие обеспечивает хорошую тепло- и звукоизоляцию.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Расход гипсовой смеси значительно ниже по сравнению с цементной.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(54,1,'Штукатурка гипсовая Knauf Ротбанд (25 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;«Кнауф Ротбанд» — универсальная сухая смесь на основе гипсовой вяжущей с добавками, которые замедляют схватывание и улучшают сцепление состава с поверхностью. Серый цвет обусловлен наличием природных примесей в гипсовом камне. Предназначена для оштукатуривания вручную потолков и стен. Подходит для обычных твердых оснований — бетона, кирпича, цементной штукатурки, а также цементно-стружечной плиты и пенополистирола. Можно купить для внутренних работ в помещениях с нормальной или повышенной влажностью. Особенно рекомендуется для гладких бетонных поверхностей. Расход составляет 8.5 кг на квадратный метр. Цена указана за упаковку 25 кг.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Преимущества:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;экологичность;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;безупречное выравнивание;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;пластичность;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;высокая адгезия;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;экономичный расход.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(56,1,'Гипсокартон Knauf ГСП-А 1500x600x12.5 мм','Качественный гипсокартон «Кнауф» имеет размеры 600 на 1 500 мм. Данный материал используется для облицовки стен и потолка, обеспечивая им идеально ровную поверхность. Он изготавливается из безопасных материалов, поэтому может применяться и в жилых сухих помещениях.\nПреимущества:\n\nроссийское качество, прошедшее строгую проверку;\nвысокий уровень прочности и небольшой вес;\nбыстрый монтаж с использованием стандартных крепежных элементов.\n\nЛисты гипсокартона в нужном количестве вы сможете купить в магазинах «Леруа Мерлен». Они предлагаются по адекватной цене, как и многие другие отделочные материалы из нашего ассортимента.','гипсокартон','30','','',''),(50,1,'Кабель FTP  2PR  24AWG  2х2х0,5 CAT5e  305м Cu Indoor (PVC) Skynet Standart','&lt;p style=&quot;padding: 0px 0px 10px; line-height: 16px; margin-bottom: 2px !important;&quot;&gt;&lt;span style=&quot;text-align: start;&quot;&gt;Кабель для создания локальных сетей внутри помещения из серии Standart выпускается под торговой маркой Skynet в бухтах по 305 метров. Конструкция кабеля серии Standart типа FTP – это 4 проводника с сечением 24 AWG и диаметром 0,5 мм, выполненные из чистой меди, в индивидуальной оболочке. Жилы скручены по две (витая пара) и упакованы в общую оболочку из ПВХ с экраном из ламинированной алюминиевой фольги.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','кабель ftp 5e, кабель Skynet','1','','',''),(57,1,'Изоляция Knauf ТеплоKnauf Крыша 150 мм 5 м²','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Минеральная вата ТеплоKnauf «Крыша»&amp;nbsp;используется для утепления скатных кровель. От возможных протечек крыши защищен специальной водоотталкивающей пропиткой Aquastatik. Упругий материал хорошо заполняет пространство под кровлей. Изготавливается без применения смол.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Минеральная вата изготовлена из безопасного природного материала — волокон расплавленного базальта, скрепленных клеящим веществом. Плиты не горят, не выделяют опасных веществ, не восприимчивы к воздействию влаги и микроорганизмов. Производятся в России.&lt;/p&gt;&lt;h3 style=&quot;margin-top: 19px; margin-bottom: 9.5px;&quot;&gt;Особенности&lt;/h3&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Теплоизоляция в рулоне позволяет удобно раскатывать материал, отмерять и отрезать по размеру, сводя к минимуму количество обрезков.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Толщина материала составляет 150 мм — этого вполне достаточно для утепления в один слой.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Срок эксплуатации материала превышает 20 лет.&lt;/li&gt;&lt;/ul&gt;','теплоизоляция knauf','1','','',''),(58,1,'Шпаклёвка полимерная финишная Weber Vetonit LR Plus (20 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Белая финишная шпаклевка марки Weber Vetonit LR+ предназначена для выравнивания поверхностей в сухих помещениях перед оклейкой обоями, покраской, отделкой декоративной штукатуркой или керамической плиткой. Бренд очень популярен среди строителей благодаря отменным свойствам шпаклевки и удобству работы с ней. Ее сверхпластичность позволяет быстро, экономно, качественно выравнивать стены и потолки. Слои сводятся между собой идеально. Покрытие через 12 часов готово к шлифовке. С течением времени не дает усадки.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Преимущества:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;высокое качество;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;экономный расход;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;легкая шлифовка;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;доступная цена.&lt;/li&gt;&lt;/ul&gt;','шпаклевка финишная','1','','',''),(59,1,'Шпаклёвка полимерная Axton (25 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Шпаклевка полимерная Axton используется для проведения завершающего этапа выравнивания поверхности стены перед покраской или оклеиванием обоями. Раствор быстро и качественно устраняет мелкие неровности и небольшие перепады. Материал легко наносится тонким слоем и сохнет за считанные часы. Шпаклевка полимерная обладает высокой прочностью и стойкостью к перепадам температур и влажности воздуха.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Преимущества:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;надежность;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;равномерное высыхание;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;отсутствие трещин;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;легко наносится;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;доступная цена.&lt;/li&gt;&lt;/ul&gt;','шпаклевка','1','','',''),(60,1,'Шпаклёвка финишная Knauf Ротбанд Паста Профи (18 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;«Ротбанд Паста Профи» от компании Knauf — шпаклевка на виниловой основе для финального этапа выравнивания стен и их подготовки к покраске или приклеиванию обоев. Обладает отличной адгезией, повышенной белизной и устойчивостью к трещинам. Крайне легко наносится и разглаживается благодаря своей эластичной структуре. Совместима практически с любым видом поверхности. Невосприимчива к температурным перепадам. Knauf является всемирно известной компанией по производству разнообразной продукции для строительства и ремонта.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Преимущества:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;мировой бренд;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;доступная цена;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;легкое нанесение;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;прочность;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;надежность;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;долговечность.&lt;/li&gt;&lt;/ul&gt;','шпаклевка финишная','1','','',''),(61,1,'Шпаклёвка гипсовая Knauf Фуген (25 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Штукатурка гипсовая Ротгипс&amp;nbsp;используется для базового выравнивания стен и потолков в сухих помещениях. Не требует шпаклевания. Главный компонент строительной смеси — высококачественный гипс, который представляет собой экологически чистый и легкий материал. Вес упаковки — 25 кг.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Гипсовую штукатурку нельзя задействовать в условиях высокой влажности, в остальном она универсальна и может применяться для разных оснований:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;бетона разной структуры (плотного и ячеистого);&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;цементной штукатурки;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;камня и кирпича;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;пенополистирола и ЦСП.&lt;/li&gt;&lt;/ul&gt;&lt;h3 style=&quot;margin-top: 19px; margin-bottom: 9.5px;&quot;&gt;Преимущества гипсовой штукатурки&lt;/h3&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Материал «дышит», регулирует количество влаги в воздухе, поглощая ее при избытке и отдавая при недостатке. Создает благоприятный микроклимат в помещении.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Смесь пластична и удобна в нанесении, работать с ней легче, чем с другими видами штукатурки.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Покрытие обеспечивает хорошую тепло- и звукоизоляцию.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Расход гипсовой смеси значительно ниже по сравнению с цементной.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(62,1,'Штукатурка цементная Axton (25 кг)','&lt;p&gt;Цементная штукатурка Axton в упаковке на 25 кг – базовый материал для проведения отделочных работ. Используется для оштукатуривания фасадов, обеспечивая создание прочных монолитных поверхностей, готовых для чистовой отделки.&lt;/p&gt;&lt;p&gt;Цемент в качестве вяжущего гарантирует долговечность полученного материала.&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Привлекательная цена;&lt;/li&gt;&lt;li&gt;Простота нанесения на любые поверхности;&lt;/li&gt;&lt;li&gt;Универсальность применения;&lt;/li&gt;&lt;li&gt;Устойчивость к механическим нагрузкам;&lt;/li&gt;&lt;li&gt;Качественная цементная основа;&lt;/li&gt;&lt;li&gt;Высокая трещиностойкость и надежная защита от атмосферных воздействий;&lt;/li&gt;&lt;li&gt;Высокая паропроницаемость и низкое водопоглащение;&lt;/li&gt;&lt;li&gt;Долговечность на протяжении всего срока эксплуатации.&lt;/li&gt;&lt;/ul&gt;','штукатурка цементная','1','','',''),(64,1,'Штукатурка декоративная Ceresit СТ 64 Andalusia 1 (эффект короед 25 кг)','&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(255, 0, 0);&quot;&gt;Внимание: нельзя наносить штукатурку при сильном ветре и при прямом попадании на поверхность солнечных лучей.&lt;/span&gt;&lt;br&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Штукатурка акриловая «короед» Andalusia СТ 64/25 — полимерный отделочный материал для финишного оформления фасадных и внутренних стен. Представляет собой водную дисперсию сополимеров акрилатов с камушками и пигментами. Наносится тонким слоем на бетонные и оштукатуренные основания, гипсокартонные плиты и ДСП.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Вес стройматериала в упаковке 25 кг. Срок годности — 24 месяца. Товар производится в России.&lt;/p&gt;&lt;p&gt;Преимущества и особенности&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Сочетание декоративных и защитных функций, презентабельный внешний вид отделанных стен (оригинальная бороздчатая фактура).&lt;/li&gt;&lt;li&gt;Воплощение нестандартных дизайнерских идей: акриловая штукатурка колеруется.&lt;/li&gt;&lt;li&gt;Стойкость к осадкам, морозам, деформации.&lt;/li&gt;&lt;li&gt;Прочность, эластичность, паропроницаемость.&lt;/li&gt;&lt;li&gt;Экологичность и долговечность.&lt;/li&gt;&lt;/ul&gt;','штукатурка декоративная','1','','',''),(63,1,'Штукатурка гипсовая (30 кг)','&lt;p&gt;Штукатурка гипсовая расфасована в паки по 30 килограмм. Применяется в ремонтных и строительных работах, накладывается на основания из кирпича, бетона, цемента. Гипсовая штукатурка имеет серый цвет, используется для внутренних работ, не применяется для внешней отделки фасадов. При добавлении в нее клея ПВА для заделки швов и дырок показывает особую прочность. Удобная фасовка позволяет экономно расходовать гипсовую штукатурку.&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;низкая цена;&lt;/li&gt;&lt;li&gt;прочность;&lt;br&gt;&lt;/li&gt;&lt;li&gt;пластичность;&lt;br&gt;&lt;/li&gt;&lt;li&gt;хорошее сцепление с поверхностью.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(65,1,'Штукатурка Knauf ХП Старт (25 кг)','&lt;p&gt;Штукатурка «Кнауф ХП Старт» – это сухая смесь, выполненная на основе гипса с полимерными добавками и наполнителем. Предназначена для использования внутри помещений с оптимальной влажностью с целью оштукатуривания вручную. Может применяться в жилых помещениях, больницах, гостиницах. Служит для выравнивания поверхностей, а также для того, чтобы потом можно было наносить декоративные покрытия. Имеет повышенную водоудерживающую способность, регулирует в помещении влажностный режим, не содержит веществ, которые могут нанести вред здоровью человека.&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;долговечность;&lt;/li&gt;&lt;li&gt;низкая цена;&lt;/li&gt;&lt;li&gt;хорошее качество;&lt;/li&gt;&lt;li&gt;простота применения.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(93,1,'Грунтовочный состав для обеспыливания (10 л)','&lt;p&gt;Грунтовочный состав для обеспыливания в канистре 10 л – незаменимый расходный материал, используемый для подготовки стен. Обработанная поверхность намного меньше впитывает клей при фиксации обоев, плитки и лакокрасочные материалы. Мы рекомендуем купить этот товар, если вы желаете сделать качественный ремонт без разводов, пятен на стенах и отклеивания отделочных материалов.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nБыстрое высыхание даже в помещениях с повышенной влажностью воздуха.\r\n&lt;/li&gt;&lt;li&gt;Доступная цена.\r\n&lt;/li&gt;&lt;li&gt;Высокое качество.\r\n&lt;/li&gt;&lt;li&gt;Отличная адгезия.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(67,1,'Штукатурка гипсовая Axton (30 кг)','&lt;p&gt;Штукатурка Axton — смесь из гипса, легких наполнителей, снижающих расход материала, и добавок, повышающих сцепление смеси с поверхностью. Состав используется для выравнивания стен, потолков, оконных откосов в бытовых и общественных помещениях с нормальной и умеренной влажностью. Профессионалы отдают предпочтение гипсовым штукатуркам, так как они удобны в работе и быстро сохнут.&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;можно наносить толстым слоем;&lt;/li&gt;&lt;li&gt;невысокая цена (собственный бренд Leroy Merlin);&lt;/li&gt;&lt;li&gt;экологически чистый продукт, не выделяет вредных для здоровья веществ.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(69,1,'Штукатурка гипсовая Ротгипс (25 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Штукатурка гипсовая Ротгипс&amp;nbsp;используется для базового выравнивания стен и потолков в сухих помещениях. Не требует шпаклевания. Главный компонент строительной смеси — высококачественный гипс, который представляет собой экологически чистый и легкий материал. Вес упаковки — 25 кг.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Гипсовую штукатурку нельзя задействовать в условиях высокой влажности, в остальном она универсальна и может применяться для разных оснований:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;бетона разной структуры (плотного и ячеистого);&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;цементной штукатурки;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;камня и кирпича;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;пенополистирола и ЦСП.&lt;/li&gt;&lt;/ul&gt;&lt;h3 style=&quot;margin-top: 19px; margin-bottom: 9.5px;&quot;&gt;Преимущества гипсовой штукатурки&lt;/h3&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Материал «дышит», регулирует количество влаги в воздухе, поглощая ее при избытке и отдавая при недостатке. Создает благоприятный микроклимат в помещении.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Смесь пластична и удобна в нанесении, работать с ней легче, чем с другими видами штукатурки.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Покрытие обеспечивает хорошую тепло- и звукоизоляцию.&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;Расход гипсовой смеси значительно ниже по сравнению с цементной.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(92,1,'Грунт концентрат Ceresit CT17 (10 л)','Грунт-концентрат Ceresit CT17 представляет собой бесцветный состав глубокого проникновения, который может использоваться снаружи и внутри помещений. Подходит для обработки непрочных поверхностей и оснований из впитывающих материалов — бетона, камня, кирпича любой разновидности, ДСП, гипсокартона, штукатурки разных типов (на основе извести, цемента, гипса). Благодаря отсутствию органических растворителей грунтовка не имеет неприятного запаха и не выделяет вредных испарений.\r\nГрунт-концентрат позволяет качественно подготовить поверхность к отделке штукатуркой, напольной смесью, мастикой, покрытию слоем теплоизоляции или плиточного клея. Состав обладает следующими свойствами:\r\n\r\nобеспечивает отличное сцепление покрытия с основанием;\r\nснижает способность поверхности к впитыванию;\r\nукрепляет основание;\r\nсвязывает пылевые частицы;\r\nулучшает растекаемость самовыравнивающихся смесей для пола, предотвращает появление пузырьков.\r\n\r\nМатериал полностью высыхает за 4 часа. Объем емкости — 10 л.','','1','','',''),(70,1,'Штукатурка гипсовая Knauf Ротбанд (10 кг)','&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;«Кнауф Ротбанд» — универсальная сухая смесь на основе гипсовой вяжущей с добавками, которые замедляют схватывание и улучшают сцепление состава с поверхностью. Серый цвет обусловлен наличием природных примесей в гипсовом камне. Предназначена для оштукатуривания вручную потолков и стен. Подходит для обычных твердых оснований — бетона, кирпича, цементной штукатурки, а также цементно-стружечной плиты и пенополистирола. Можно купить для внутренних работ в помещениях с нормальной или повышенной влажностью. Особенно рекомендуется для гладких бетонных поверхностей. Расход составляет 8.5 кг на квадратный метр. Цена указана за упаковку 25 кг.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 9.5px;&quot;&gt;Преимущества:&lt;/p&gt;&lt;ul style=&quot;margin-bottom: 9.5px;&quot;&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;экологичность;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;безупречное выравнивание;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;пластичность;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;высокая адгезия;&lt;/li&gt;&lt;li style=&quot;transition: width 1s ease-out 0s;&quot;&gt;экономичный расход.&lt;/li&gt;&lt;/ul&gt;','штукатурка гипсовая','1','','',''),(72,1,'Штукатурка цементная Bergauf Bau Putz Zement (25 кг)','&lt;p&gt;Цементную штукатурку Bergauf Bau Putz Zement следует купить и использовать при внутренних и наружных фасадных работах. Ее наносят на кирпичную кладку и любые виды бетона при нормальной и повышенной влажности. Штукатурка состоит из цемента, нескольких фракций песка, полимерных модифицирующих добавок, минеральных наполнителей. Поверхности штукатурят под керамическую плитку, текстурные обои, декоративную штукатурку, финишную шпатлевку вручную или специальной машиной. Основание подготавливается по СНиП 3.04.01-87.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;универсальность;&lt;/li&gt;&lt;li&gt;влагостойкость;&lt;/li&gt;&lt;li&gt;быстрое затвердевание.&lt;/li&gt;&lt;/ul&gt;','штукатурка цементная','1','','',''),(73,1,'Штукатурка гипсовая Bergauf трещиностойкая (30 кг)','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','штукатурка гипсовая','1','','',''),(76,1,'Штукатурка гипсовая Bergauf Aqua Putz Gips (25 кг)','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','штукатурка гипсовая','1','','',''),(77,1,'Штукатурка декоративная Ceresit СТ 60 Andalusia 1 (эффект камешки 25 кг)','&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(255, 0, 0);&quot;&gt;Внимание: приготовленная штукатурка быстро затвердевает, поэтому наносится в течение максимум 60-ти минут.&lt;/span&gt;&lt;br&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Штукатурка акриловая камешковая Andalusia СТ 60/25 — финишный отделочный материал на основе водной дисперсии сополимеров акрилатов с минеральными наполнителями и пигментами. Используется для защитно-декоративного оформления внутренних стен и обычных либо утепленных фасадов зданий. Поверхности для отделки: штукатурные покрытия, подготовленные кирпичные и бетонные основания, гипсокартон, ДСП.&lt;/p&gt;&lt;p&gt;Особенности&lt;/p&gt;&lt;p&gt;Эффектный внешний вид зернистого финишного покрытия позволяет воплощать оригинальные дизайнерские решения. Рекомендованная толщина слоя соответствует диаметру зерен — 1,5 мм.&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;экономичный расход;&lt;/li&gt;&lt;li&gt;устойчивость к осадкам, температурным перепадам, механическим воздействиям;&lt;/li&gt;&lt;li&gt;эластичность, прочность, возможность «дышать»;&lt;/li&gt;&lt;li&gt;экологическая безопасность и долговечность.&lt;/li&gt;&lt;/ul&gt;','штукатурка декоративная','1','','',''),(78,1,'Стяжка пола Bergauf Base (25 кг)','&lt;p&gt;Bergauf Base — сухая смесь на основе песка и цемента с минеральными наполнителями и полимерными добавками. Из нее изготавливают строительный раствор для предварительного ручного выравнивания полов. С помощью ровнителя устраняются серьезные дефекты, например, глубокие сколы и выбоины. В результате использования Bergauf Base получается гладкая, ровная безусадочная поверхность, стойкая к возникновению трещин. Подходит для оснований из монолитного бетона, наливных полов, черновой стяжки и железобетонных плит перекрытия. Можно купить для работы в помещениях с нормальной и повышенной влажностью. Цена указана за упаковку массой 25 кг.&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;быстрое сцепление;&lt;/li&gt;&lt;li&gt;простота использования;&lt;/li&gt;&lt;li&gt;отсутствие усадки;&lt;/li&gt;&lt;li&gt;устойчивость к появлению трещин.&lt;/li&gt;&lt;/ul&gt;','стяжка пола','1','','',''),(79,1,'Блок газобетонный D500 600x100x300 мм','','блок газобетонный','1','','',''),(80,1,'Блок газобетонный D500 600x200x300 мм','','блок газобетонный','1','','',''),(81,1,'Плита гипсовая пазогребневая полнотелая 667x500x80 мм','&lt;p&gt;Плита гипсовая пазогребневая полнотелая — это отделочный материал который не горит и нетоксичен, изготовленный на основе настоящего природного гипса. Изделие выполнено в форме прямоугольника с пазами или гребнями на стыковочных сторонах для прочного соединения между собой. Плита предназначена для установки межкомнатных и межквартирных перегородок, внутренней облицовки стен, огнезащиты конструкций, изготовления тепло- и звукоизоляционных систем. Используется при внутренней отделке помещений в жилых зданиях, административных учреждениях, в том числе детских и медицинских.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особенности материала&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Наличие пазов и гребней исключает смещение плит.&lt;/li&gt;&lt;li&gt;Полнотелые плиты уступают по тепло- и звукоизоляционным качествам пустотелым, но имеют более высокую механическую прочность. Тепловое сопротивление — R0,35.&lt;/li&gt;&lt;li&gt;Негорючесть материала позволяет установку в непосредственной близости плит и отопительных приборов.&lt;/li&gt;&lt;li&gt;Ширина изделия — 50 см, толщина — 8 см, длина — 66,7 см.&lt;/li&gt;&lt;li&gt;На 1 м^2^ потребуется 3 плиты.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(82,1,'Плита гипсовая пазогребневая полнотелая влагостойкая 667x500x80 мм','&lt;p&gt;Плита гипсовая пазогребневая полнотелая&amp;nbsp;влагостойкая — это отделочный материал который не горит и нетоксичен, изготовленный на основе настоящего природного гипса. Изделие выполнено в форме прямоугольника с пазами или гребнями на стыковочных сторонах для прочного соединения между собой. Плита предназначена для установки межкомнатных и межквартирных перегородок, внутренней облицовки стен, огнезащиты конструкций, изготовления тепло- и звукоизоляционных систем. Используется при внутренней отделке помещений в жилых зданиях, административных учреждениях, в том числе детских и медицинских.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особенности материала&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Наличие пазов и гребней исключает смещение плит.&lt;/li&gt;&lt;li&gt;Полнотелые плиты уступают по тепло- и звукоизоляционным качествам пустотелым, но имеют более высокую механическую прочность. Тепловое сопротивление — R0,35.&lt;/li&gt;&lt;li&gt;Негорючесть материала позволяет установку в непосредственной близости плит и отопительных приборов.&lt;/li&gt;&lt;li&gt;Ширина изделия — 50 см, толщина — 8 см, длина — 66,7 см.&lt;/li&gt;&lt;li&gt;На 1 м^2^ потребуется 3 плиты.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(83,1,'Кирпич полнотелый одинарный М200','&lt;p&gt;Кирпич керамический рядовой используется в строительных или ремонтных работах. Кладочный материал изготовлен из керамики, обладает высокой прочностью: М200 по российским стандартам — подходит для стен строений любо этажности, цоколей и фундамента. Одинарный полнотелый морозостойкий кирпич имеет следующие особенности:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;не боится воздействия атмосферных осадков и перепадов температуры;&lt;/li&gt;&lt;li&gt;обладает хорошими теплоизоляционными и звукоподавляющими свойствами;&lt;/li&gt;&lt;li&gt;за счет единого размера элементов обеспечивает удобство при проведении кладочных работ.&lt;/li&gt;&lt;/ul&gt;','кирпич керамический','1','','',''),(84,1,'Кирпич керамический одинарный пустотелый М125 (красный)','&lt;p&gt;Кирпич керамический облицовочный применяется для кладки в строительных или ремонтных работах. Универсален, походит для внешнего и внутреннего использования, используется как для облицовки, так и для возведения несущих конструкций и перегородок. Кирпич окрашен в красный цвет.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особенности&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Керамический кирпич обладает высокой прочностью — М125 по российскому стандарту.&lt;/li&gt;&lt;li&gt;Строительный материал не боится воздействия атмосферных факторов, надежен и долговечен.&lt;/li&gt;&lt;li&gt;Обладает хорошими теплоизолирующими и шумоподавляющими свойствами.&lt;/li&gt;&lt;/ul&gt;','кирпич керамический','1','','',''),(85,1,'Кирпич керамический лицевой одинарный Ревда М150','&lt;p&gt;Кирпич керамический лицевой «Ревда» применяется для кладки в строительных или ремонтных работах. Универсален, походит для внешнего и внутреннего использования, используется как для облицовки, так и для возведения несущих конструкций и перегородок. Кирпич окрашен в цвет «сахар».&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особенности&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Керамический одинарный кирпич обладает высокой прочностью — M150 по российскому стандарту.&lt;/li&gt;&lt;li&gt;Морозостойкий строительный материал не боится перепадов температур, воздействия атмосферных факторов, надежен и долговечен.&lt;/li&gt;&lt;li&gt;Обладает хорошими теплоизолирующими и шумоподавляющими свойствами.&lt;/li&gt;&lt;/ul&gt;','кирпич керамический','1','','',''),(86,1,'Кирпич керамический лицевой одинарный Ревда М150 (цвет шоколадный)','&lt;p&gt;Кирпич керамический лицевой «Ревда» применяется для кладки в строительных или ремонтных работах. Универсален, походит для внешнего и внутреннего использования, используется как для облицовки, так и для возведения несущих конструкций и перегородок. Кирпич окрашен в «шоколадный» цвет.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особенности&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Керамический одинарный кирпич обладает высокой прочностью — M150 по российскому стандарту.&lt;/li&gt;&lt;li&gt;Морозостойкий строительный материал не боится перепадов температур, воздействия атмосферных факторов, надежен и долговечен.&lt;/li&gt;&lt;li&gt;Обладает хорошими теплоизолирующими и шумоподавляющими свойствами.&lt;/li&gt;&lt;/ul&gt;','кирпич керамический','1','','',''),(87,1,'Кирпич огнеупорный ШБ-5','&lt;p&gt;Кирпич огнеупорный ШБ-5 – строительный материал песочно-желтого цвета с зернистым основанием.&lt;/p&gt;&lt;p&gt;Его используют в тепловых конструкциях, благодаря выдающимся огнеупорным свойствам подходит для обустройства печей, каминов, барбекю и т.д.&lt;/p&gt;&lt;p&gt;Преимущества&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Прочность&lt;br&gt;&lt;/li&gt;&lt;li&gt;Доступная цена&lt;/li&gt;&lt;li&gt;Устойчивость к воздействию окружающей среды, кислот и щелочей&lt;/li&gt;&lt;li&gt;Идеальная форма&lt;/li&gt;&lt;li&gt;Внутренняя структура изделия позволяет передавать тепло практически без потерь. Кирпич огнеупорный ШБ-5 – настоящая находка для экономически грамотного потребителя!&lt;/li&gt;&lt;/ul&gt;','кирпич керамический','1','','',''),(88,1,'Изоляция Knauf ТеплоKnauf Стена 100 мм, 3 м²','&lt;p&gt;&lt;strong&gt;Изоляция Knauf «ТеплоKnauf Стена»&lt;/strong&gt; — упругий и жесткий минераловатный утеплитель. Используется для заполнения наружных стен каркасных строений, а также для межкомнатных перегородок в качестве звукоизоляции. Выпускается в рулонах толщиной 100 мм, упакованных в спайку из плотного полиэтилена. Страна производства товара — Россия.&lt;/p&gt;\r\n&lt;h3&gt;Особенности материала&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Отлично держит форму, заполняя конструкции без зазоров и щелей.&lt;/li&gt;\r\n&lt;li&gt;Не содержит фенол-формальдегидных и акриловых смол.&lt;/li&gt;\r\n&lt;li&gt;Негорючий.&lt;/li&gt;\r\n&lt;li&gt;Хорошо режется.&lt;/li&gt;\r\n&lt;li&gt;Водоотталкивающая пропитка Aquastatik защищает от намокания.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание! При работе с материалом рекомендуется использовать средства индивидуальной защиты: перчатки, респиратор, защитные очки.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;','','40','','',''),(75,1,'Штукатурка декоративная Ceresit СТ 64 Colorado 1 (эффект короед 25 кг)','&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание: нельзя наносить штукатурку при сильном ветре и при прямом попадании на поверхность солнечных лучей.&lt;/font&gt;&lt;/span&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Штукатурка акриловая камешковая Colorado СТ 60/25 — финишный отделочный материал на основе водной дисперсии сополимеров акрилатов с минеральными наполнителями и пигментами. Используется для защитно-декоративного оформления внутренних стен и обычных либо утепленных фасадов зданий. Поверхности для отделки: штукатурные покрытия, подготовленные кирпичные и бетонные основания, гипсокартон, ДСП.&lt;/p&gt;&lt;p&gt;Вес материала в упаковке 25 кг. Срок годности — 24 месяца. Страна производства — Россия.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особенности&lt;/p&gt;&lt;p&gt;Эффектный внешний вид зернистого финишного покрытия позволяет воплощать оригинальные дизайнерские решения. Рекомендованная толщина слоя соответствует диаметру зерен — 1,5 мм.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;экономичный расход;&lt;/li&gt;&lt;li&gt;устойчивость к осадкам, температурным перепадам, механическим воздействиям;&lt;/li&gt;&lt;li&gt;эластичность, прочность, возможность «дышать»;&lt;/li&gt;&lt;li&gt;экологическая безопасность и долговечность.&lt;/li&gt;&lt;/ul&gt;','штукатурка декоративная','1','','',''),(74,1,'Штукатурка декоративная Ceresit СТ 60 Colorado 1 (эффект камешки 25 кг)','&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание: приготовленная штукатурка быстро затвердевает, поэтому наносится в течение максимум 60-ти минут.&lt;/font&gt;&lt;/span&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Штукатурка акриловая камешковая Colorado СТ 60/25 — финишный отделочный материал на основе водной дисперсии сополимеров акрилатов с минеральными наполнителями и пигментами. Используется для защитно-декоративного оформления внутренних стен и обычных либо утепленных фасадов зданий. Поверхности для отделки: штукатурные покрытия, подготовленные кирпичные и бетонные основания, гипсокартон, ДСП.&lt;/p&gt;&lt;p&gt;Вес материала в упаковке 25 кг. Срок годности — 24 месяца. Страна производства — Россия.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Особенности&lt;/p&gt;&lt;p&gt;Эффектный внешний вид зернистого финишного покрытия позволяет воплощать оригинальные дизайнерские решения. Рекомендованная толщина слоя соответствует диаметру зерен — 1,5 мм.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;экономичный расход;&lt;/li&gt;&lt;li&gt;устойчивость к осадкам, температурным перепадам, механическим воздействиям;&lt;/li&gt;&lt;li&gt;эластичность, прочность, возможность «дышать»;&lt;/li&gt;&lt;li&gt;экологическая безопасность и долговечность.&lt;/li&gt;&lt;/ul&gt;','штукатурка декоративная','1','','',''),(66,1,'Штукатурка декоративная CT175 Colorado 1 (эффект короед 25 кг)','&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание: нельзя наносить штукатурку при сильном ветре и при прямом попадании на поверхность солнечных лучей.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Штукатурка акриловая камешковая Colorado СТ 175 — финишный отделочный материал на основе водной дисперсии сополимеров акрилатов с минеральными наполнителями и пигментами. Используется для защитно-декоративного оформления внутренних стен и обычных либо утепленных фасадов зданий. Поверхности для отделки: штукатурные покрытия, подготовленные кирпичные и бетонные основания, гипсокартон, ДСП.&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;экономичный расход;&lt;/li&gt;&lt;li&gt;устойчивость к осадкам, температурным перепадам, механическим воздействиям;&lt;/li&gt;&lt;li&gt;эластичность, прочность, возможность «дышать»;&lt;/li&gt;&lt;li&gt;экологическая безопасность и долговечность.&lt;/li&gt;&lt;/ul&gt;','штукатурка декоративная','1','','',''),(68,1,'Штукатурка декоративная CT175 Andalusia1 (эффект короед 25 кг)','&lt;p&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(255, 0, 0);&quot;&gt;Внимание: нельзя наносить штукатурку при сильном ветре и при прямом попадании на поверхность солнечных лучей.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Штукатурка акриловая «короед» Andalusia СТ 175 — полимерный отделочный материал для финишного оформления фасадных и внутренних стен. Представляет собой водную дисперсию сополимеров акрилатов с камушками и пигментами. Наносится тонким слоем на бетонные и оштукатуренные основания, гипсокартонные плиты и ДСП.&lt;/p&gt;&lt;p&gt;Преимущества и особенности&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Сочетание декоративных и защитных функций, презентабельный внешний вид отделанных стен (оригинальная бороздчатая фактура).&lt;/li&gt;&lt;li&gt;Воплощение нестандартных дизайнерских идей: акриловая штукатурка колеруется.&lt;/li&gt;&lt;li&gt;Стойкость к осадкам, морозам, деформации.&lt;/li&gt;&lt;li&gt;Прочность, эластичность, паропроницаемость.&lt;/li&gt;&lt;li&gt;Экологичность и долговечность.&lt;/li&gt;&lt;/ul&gt;','штукатурка декоративная','1','','',''),(89,1,'Изоляция для стен 6 плит 1200х600х100 мм','&lt;p&gt;&lt;strong&gt;Изоляция для стен&lt;/strong&gt; — надежный и долговечный материал с отличными эксплуатационными свойствами. Предназначается для утепления стен и перегородок внутри помещений. Изоляция представляет собой прямоугольные плиты из каменной ваты. Обязательно защищается от внешних воздействий финишной отделкой. Комплект содержит 6 плит толщиной 100 мм и размером 1200x600 мм. Производится в России.&lt;/p&gt;\n&lt;h3&gt;Преимущества изоляции&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Обладает отличными теплоизоляционными свойствами.&lt;/li&gt;\n&lt;li&gt;Не боится влаги, грызунов и микроорганизмов.&lt;/li&gt;\n&lt;li&gt;Благодаря удобному формату жестких плит просто и быстро монтируется на стену.&lt;/li&gt;\n&lt;li&gt;Имеет хорошую паропроницаемость, позволяет стенам «дышать».&lt;/li&gt;\n&lt;li&gt;Не горит и не выделяет вредных веществ при нагревании.&lt;/li&gt;\n&lt;li&gt;За счет пористой структуры гасит звуковые колебания и увеличивает шумоизоляцию помещения.&lt;/li&gt;\n&lt;li&gt;Долго служит — 20 лет и более.&lt;/li&gt;\n&lt;/ul&gt;','','30','','',''),(91,1,'Пропитка Боларс Антиплесень (5 кг)','&lt;p&gt;Пропитка антиплесень «Боларс» эффективно борется с любыми видами грибковых поражений, уничтожает водоросли. Пропитка не токсичная, не имеет выраженного запаха. Подходит для обработки любых оснований (минеральных, деревянных) внутри и снаружи зданий, в том числе в помещениях с повышенной влажностью. Срок годности материала 12 месяцев. Вес канистры — 5 кг.\r\n&lt;/p&gt;&lt;p&gt;Применение\r\n&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Пропитка наносится в 1-2 слоя на очищенную от старых покрытий и пыли, сухую поверхность. &lt;/li&gt;&lt;li&gt;Время сушки покрытия перед повторным нанесением — 1 час. &lt;/li&gt;&lt;li&gt;Расход — 50-100 г/1 м^2^. &lt;/li&gt;&lt;li&gt;Работы рекомендуется проводить при температуре от +5 до +35 °С.&lt;/li&gt;&lt;/ol&gt;','','1','','',''),(95,1,'Грунт Бетонконтакт Ceresit CT19 (5 кг)','&lt;p&gt;Грунтовка «Бетонконтакт» торговой марки Ceresit предназначается для отделки гладких вертикальных поверхностей перед нанесением плиточного клея и цементно-песчаной штукатурки. Экологически безопасна для здоровья человека и обладает водостойкими свойствами. Создает шероховатую поверхность. Удобна в применении: наносится валиком, кистью либо щеткой. При оптимальных условиях высыхает за 3 часа после окончания ремонтных работ. Имеет экономный расход и невысокую цену.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;p&gt;\r\nувеличивает адгезию покрытия к основанию;\r\n&lt;/p&gt;&lt;p&gt;обеспечивает комфортную работу;&lt;/p&gt;&lt;p&gt;\r\nнетоксичная и влагостойкая.&lt;/p&gt;','','1','','',''),(96,1,'Грунт Knauf Тифенгрунд (5 кг)','&lt;p&gt;Грунтовка «Тифенгрунд» — проникающая бесцветная полимерная эмульсия, предназначенная для отделки основания. Применяется в процессе работ внутри и снаружи помещения (укладка плитки, шпаклевка, покраска, клейка обоев). Улучшает качество соединения покрытия с основанием.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nготовая эмульсия по привлекательной цене;\r\n&lt;/li&gt;&lt;li&gt;обладает отличной проникающей способностью;&lt;/li&gt;&lt;li&gt;\r\nбыстро сохнет;&lt;/li&gt;&lt;li&gt;\r\nулучшает адгезию;&lt;/li&gt;&lt;li&gt;\r\nукрепляет поверхность слабых гигроскопичных оснований;\r\n&lt;/li&gt;&lt;li&gt;безопасность для здоровья;\r\n&lt;/li&gt;&lt;li&gt;не изолирует водяные пары внутри помещения.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(97,1,'Грунт под тонкую штукатурку CT 16/10 (10 л | цвет белый)','&lt;p&gt;Грунт под тонкую штукатурку CT 16/10 подходит для внутренних и наружных подготовительных работ, в том числе для влажных помещений. Состав паропроницаемый, имеет водную основу. Емкости объемом 10 л хватит для подготовки 30 м^2^ поверхности.&lt;/p&gt;&lt;p&gt;\r\nДостоинства грунта&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nКолеруется в цвет финишной штукатурки для предотвращения просвечивания основания.\r\n&lt;/li&gt;&lt;li&gt;Упрощает нанесение декоративных растворов, улучшает адгезию.\r\n&lt;/li&gt;&lt;li&gt;Уменьшает впитываемость поверхности.\r\n&lt;/li&gt;&lt;li&gt;Не имеет запаха.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(98,1,'Грунт для впитывающих оснований Ceresit CT17 (10 кг)','&lt;p&gt;Грунтовка для впитывающих оснований Ceresit CT 17 в упаковках по 10 кг необходима для подготовки к нанесению финишного декоративного покрытия бетона, цементной стяжки, пористых гипсовых или известковых штукатурок и т. д. при проведении внутренних отделочных работ. Также ее можно купить для обработки поверхностей из ячеистого бетона и газосиликата. Благодаря грунтовке Ceresit CT 17 краска лучше ляжет на поверхность.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nГотова к нанесению.&lt;/li&gt;&lt;li&gt;\r\nГлубоко проникает в пористые материалы.\r\n&lt;/li&gt;&lt;li&gt;Снижает расход краски.\r\n&lt;/li&gt;&lt;li&gt;Может использоваться при отделке полов и стен.\r\n&lt;/li&gt;&lt;li&gt;Повышает адгезию финишного покрытия.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(99,1,'Бетонконтакт Axton (6 кг)','&lt;p&gt;Бетонконтакт Axton — сухая смесь высокого качества. Подходит для работ с грунтовкой в закрытом помещении. Используется при строительстве и ремонте зданий. В состав этого продукта входят следующие вещества: песок, акрил, полимерные добавки, мраморная крошка.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;p&gt;\r\nподходит для любого типа поверхности (включая неочищенную и нешлифованную);\r\n&lt;/p&gt;&lt;p&gt;удобная упаковка (6 кг);&lt;/p&gt;&lt;p&gt;\r\nэкономичный расход;&lt;/p&gt;&lt;p&gt;\r\nбыстро застывает (всего за 2 часа);\r\n&lt;/p&gt;&lt;p&gt;соответствует международным стандартам.&lt;/p&gt;','','1','','',''),(143,1,'Клей для газоблоков Axton 25 кг','&lt;p&gt;Монтажный клей изготовлен на основе высококачественного цемента, фракционированного песка и комплекса модифицирующих добавок.\r\nПредназначен для тонкослойной кладки стен и перегородок из пазовых и беспазовых блоков и плит на основе ячеистых бетонов: пено- и газобетона, а также пено- и газосиликата.\r\nИспользуется для кладки точных по размеру блоков, а т.ж для ремонта блоков и плит из газо- и пенобетона.\r\n&lt;/p&gt;&lt;p&gt;Преимущества\r\n&lt;/p&gt;&lt;p&gt;\r\nКладка без мостиков холода;\r\n&lt;/p&gt;&lt;p&gt;Обладает высокой адгезией и высокой прочностью соединения с основанием;\r\n&lt;/p&gt;&lt;p&gt;Пластичный, трещиностойкий, безусадочный, виброустойчив;\r\n&lt;/p&gt;&lt;p&gt;Создание безопасного и комфортного микроклимата  внутри помещений;\r\n&lt;/p&gt;&lt;p&gt;Долговечность на протяжении всего срока эксплуатации.&lt;/p&gt;','','30','','',''),(144,1,'Ремонтный состав термостойкий Axton 5 кг','&lt;p&gt;Ремонтный состав термостойкий Axton — многофункциональная сухая смесь для восстановления и ремонта. В состав смеси добавлены специальные наполнители, обеспечивающие надежную адгезию в условиях высоких температур.\r\n&lt;/p&gt;&lt;p&gt;Области применения:\r\n&lt;/p&gt;&lt;p&gt;\r\nремонт сколов и трещин кладки каминов и печей;\r\n&lt;/p&gt;&lt;p&gt;облицовка каминов и дымоходов штучными материалами;\r\n&lt;/p&gt;&lt;p&gt;в качестве кладочного раствора при возведении наружных стен печей и каминов.\r\n\r\nСмесь поставляется в многослойных бумажных мешках по 5 кг. &lt;/p&gt;&lt;p&gt;Произведена в России.&lt;/p&gt;','','30','','',''),(101,1,'Грунт для впитывающих оснований Ceresit CT17 (5 кг)','&lt;p&gt;Грунт Ceresit CT17 для впитывающих оснований предназначен для подготовки поверхности перед нанесением штукатурки, напольных смесей и плиточного клея. Благодаря сравнительно невысокой цене данный грунт пользуется популярностью у строителей и домашних мастеров, обеспечивая высокую адгезию для последующих покрытий.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;p&gt;\r\nукрепление обработанной поверхности;\r\n&lt;/p&gt;&lt;p&gt;связывание пыли;\r\nснижение впитывающей способности основания;&lt;/p&gt;&lt;p&gt;\r\nвысокая проникающая способность;&lt;/p&gt;&lt;p&gt;\r\nпаропроницаемость основания не снижается;&lt;/p&gt;&lt;p&gt;\r\nвозможно применение на стяжках с подогревом;\r\n&lt;/p&gt;&lt;p&gt;подходит для внутренних и наружных работ;&lt;/p&gt;&lt;p&gt;\r\nэкологическая безопасность;\r\n&lt;/p&gt;&lt;p&gt;загрунтованная поверхность отличается от незагрунтованной по желтой окраске.&lt;/p&gt;','','1','','',''),(102,1,'Грунт по гипсу и гипсовой плитке, для влажных помещений (1 л)','&lt;p&gt;Грунт для отделки строительными смесями для влажных помещений помогает укрепить минеральное основание и подготовить к выравниванию. Состав повышает сцепление смеси с поверхностью, препятствует образованию плесени и грибка, способствует равномерному нанесению и высыханию верхнего слоя. Не имеет запаха, после высыхания становится полностью бесцветным. Поставляется в упаковках объемом 1 л. Срок годности состава 24 месяца.\r\n&lt;/p&gt;&lt;p&gt;Особенности применения&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nГрунт идеально подходит для обработки цементных, бетонных, кирпичных, гипсокартонных и оштукатуренных оснований. &lt;/li&gt;&lt;li&gt;Наносится валиком или кистью на чистую, сухую, обезжиренную поверхность при температуре от 12 до 35 °C. &lt;/li&gt;&lt;li&gt;Высыхает за 2 часа.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(103,1,'Грунт для отделки строительными смесями, для сухих помещений (5 л)','&lt;p&gt;Грунт для отделки строительными смесями для сухих помещений позволяет укрепить основание и улучшить адгезию при шпаклевке и оштукатуривании стен и потолка, выравнивании пола. Не имеет запаха, не токсичен. Полностью готов к применению. Расфасован в емкости объемом 5 л. Срок годности состава 24 месяца.\r\n&lt;/p&gt;&lt;p&gt;Особенности применения&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nГрунт наносится в один слой валиком или кистью на предварительно выровненное, очищенное и обезжиренное основание (бетон, цемент, штукатурку, кирпич, гипсокартон). &lt;/li&gt;&lt;li&gt;Использовать состав можно при температуре не менее 12 °C. &lt;/li&gt;&lt;li&gt;Поверхность полностью высыхает за 2 часа. &lt;/li&gt;&lt;li&gt;После работы рекомендуется промыть инструменты водой с мылом и проветрить помещение.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(104,1,'Грунт Knauf Тифенгрунд (10 л)','&lt;p&gt;Грунтовка Тифенгрунд Knauf применяется с целью повышения сцепления основания с различными отделочными материалами, например, кафельной плиткой, шпаклевкой или обоями. Данный продукт готов к применению и не требует дополнительного разведения. Грунтовку Тифенгрунд стоит купить, если в доме планируется ремонт. Перед применением поверхность следует тщательно очистить.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nподходит для очень гигроскопичных оснований, в том числе Кнауф-листов;&lt;/li&gt;&lt;li&gt;\r\nможет применяться как внутри, так и снаружи помещений;\r\n&lt;/li&gt;&lt;li&gt;быстрое высыхание (около 3 часов);\r\n&lt;/li&gt;&lt;li&gt;данный материал безопасен для здоровья.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(105,1,'Грунт Бетонконтакт Ceresit CT19 (15 кг)','&lt;p&gt;Грунтовка «Бетонконтакт CT19» предназначена для строительно-ремонтных работ в помещениях. Она прекрасно повышает прочность сцепления вертикальных бетонных поверхностей с цементно-песчаной штукатуркой, плиточным клеем и другими отделочными материалами. Свое название «Бетонконтакт» грунтовка получила именно благодаря высокой степени адгезии. Она не ухудшает способность поверхностей пропускать водяные пары, что обеспечивает их долговечность. Совершенно безвредна для здоровья человека.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nочень высокая адгезия;&lt;/li&gt;&lt;li&gt;\r\nэкономность расхода;&lt;/li&gt;&lt;li&gt;\r\nбыстрота высыхания;\r\n&lt;/li&gt;&lt;li&gt;приемлемая цена.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(106,1,'Грунт по гипсу и гипсовой плитке, для сухих помещений (1 л)','&lt;p&gt;Грунт для отделки строительными смесями для сухих помещений позволяет укрепить основание и улучшить адгезию при шпаклевке и оштукатуривании стен и потолка, выравнивании пола. Не имеет запаха, не токсичен. Полностью готов к применению. Расфасован в емкости объемом 1 л. Срок годности состава 24 месяца.&lt;/p&gt;&lt;p&gt;\r\nОсобенности применения\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Грунт наносится в один слой валиком или кистью на предварительно выровненное, очищенное и обезжиренное основание (бетон, цемент, штукатурку, кирпич, гипсокартон). &lt;/li&gt;&lt;li&gt;Использовать состав можно при температуре не менее 12 °C.&lt;/li&gt;&lt;li&gt; Поверхность полностью высыхает за 2 часа. &lt;/li&gt;&lt;li&gt;После работы рекомендуется промыть инструменты водой с мылом и проветрить помещение.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(107,1,'Грунт для отделки строительными смесями, для влажных помещений (5 л)','&lt;p&gt;Грунт для отделки строительными смесями для влажных помещений помогает укрепить минеральное основание и подготовить к выравниванию. Состав повышает сцепление смеси с поверхностью, препятствует образованию плесени и грибка, способствует равномерному нанесению и высыханию верхнего слоя. Не имеет запаха, после высыхания становится полностью бесцветным. Поставляется в упаковках объемом 5 л. Срок годности состава 24 месяца.\r\n&lt;/p&gt;&lt;p&gt;Особенности применения\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Грунт идеально подходит для обработки цементных, бетонных, кирпичных, гипсокартонных и оштукатуренных оснований. &lt;/li&gt;&lt;li&gt;Наносится валиком или кистью на чистую, сухую, обезжиренную поверхность при температуре от 12 до 35 °C. &lt;/li&gt;&lt;li&gt;Высыхает за 2 часа.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(108,1,'Грунт-концентрат по гипсу и гипсовой плитке, для сухих помещений (5 л)','&lt;p&gt;Грунт-концентрат для отделки строительными смесями для сухих помещений идеально подходит для выполнения ремонтных работ большого объема. Используется перед выравниванием стен и пола для укрепления основания и улучшения адгезии со стройматериалами.\r\nПроизводится в России. Объем тары 5 л. Срок годности концентрата 24 месяца. Допускается транспортировка при минусовых температурах, кратковременное замораживание/размораживание, но не более 5 раз.&lt;/p&gt;&lt;p&gt;\r\nОсобенности&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nПеред использованием грунт разбавляется водой 1 к 10. &lt;/li&gt;&lt;li&gt;В готовом виде раствор не имеет запаха.&lt;/li&gt;&lt;li&gt; После высыхания становится полностью бесцветным.\r\n&lt;/li&gt;&lt;li&gt;Наносить раствор нужно на очищенную от осыпающихся элементов, жира и пыли, хорошо просушенную поверхность (бетон, штукатурку, гипсокартон, кирпич, плитку). &lt;/li&gt;&lt;li&gt;Температура в помещении должна быть не ниже +12 °C. &lt;/li&gt;&lt;li&gt;Слой высыхает за 2 часа.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(110,1,'Грунт для отделки строительными смесями, для влажных помещений (10 л)','&lt;p&gt;Грунт для отделки строительными смесями для влажных помещений помогает укрепить минеральное основание и подготовить к выравниванию. Состав повышает сцепление смеси с поверхностью, препятствует образованию плесени и грибка, способствует равномерному нанесению и высыханию верхнего слоя. Не имеет запаха, после высыхания становится полностью бесцветным. Поставляется в упаковках объемом 10 л. Срок годности состава 24 месяца.&lt;/p&gt;&lt;p&gt;\r\nОсобенности применения\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Грунт идеально подходит для обработки цементных, бетонных, кирпичных, гипсокартонных и оштукатуренных оснований. &lt;/li&gt;&lt;li&gt;Наносится валиком или кистью на чистую, сухую, обезжиренную поверхность при температуре от 12 до 35 °C. &lt;/li&gt;&lt;li&gt;Высыхает за 2 часа.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(111,1,'Грунт Glims DeepPrimeГрунт (10 л)','&lt;p&gt;Грунтовка GLIMS-DeepPrimeГрунт в упаковке 10 л предназначена для улучшения сцепления основания (бетонного, кирпичного, гипсокартонного и т. д.) с краской, клеем и штукатуркой. Позволяет сократить расход колеров и шпаклевки при проведении чистовых отделочных работ. Проникает глубоко в основу, защищает ее от развития грибков благодаря входящему в состав антисептику. Купить ее можно для внутренних и наружных работ.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nГлубоко проникает в стены из бетона, кирпича, пенобетона.\r\n&lt;/li&gt;&lt;li&gt;Содержит антисептик.\r\n&lt;/li&gt;&lt;li&gt;Доступная по цене.\r\n&lt;/li&gt;&lt;li&gt;Готова к использованию.&lt;/li&gt;&lt;li&gt;\r\nМожет использоваться для наружных и внутренних работ.\r\n&lt;/li&gt;&lt;li&gt;Производится на отечественном заводе на основе немецких компонентов.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(112,1,'Грунт Glims DeepPrimeГрунт (5 л)','&lt;p&gt;Грунтовка GLIMS используется для подготовки поверхностей под последующую отделку, в том числе наливные полы. Она применяется по всем видам поверхностей – от дерева до бетона. Полимерная основа грунтовки позволяет использовать ее при температуре от +4°C. В состав входят добавки, обеспечивающие противогрибковую защиту поверхностей и отделочных материалов. Предлагаем купить грунтовку GLIMS в канистре емкостью 5 л, которой хватит на обработку примерно 20 м2 поверхности.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nУниверсальная формула.\r\n&lt;/li&gt;&lt;li&gt;Умеренный расход.&lt;/li&gt;&lt;li&gt;\r\nЭкологическая безопасность и приемлемая цена.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(113,1,'Грунт адгезивный Glims БетоContact (4 кг)','&lt;p&gt;Адгезивный грунт GLIMS БетоContact следует купить при необходимости улучшения сцепляющих свойств гладких внутренних поверхностей. Его наносят на слабовпитывающие основания, чтобы обеспечить надежное сцепление поверхности со штукатуркой, плиточным и монтажным клеем. Грунт подходит как для оснований из бетона и железобетона, так и для глазурованной плитки.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nпоставляется готовым к употреблению;&lt;/li&gt;&lt;li&gt;\r\nобладает хорошими адгезионными свойствами;\r\n&lt;/li&gt;&lt;li&gt;экологически безопасен;&lt;/li&gt;&lt;li&gt;\r\nможет использоваться при повышенных и пониженных температурах.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;\r\n\r\nАдгезивный грунт GLIMS БетоContact позволит создать все условия для отличного сцепления основания со штукатуркой, шпатлевкой или плиточным клеем.&lt;/p&gt;','','1','','',''),(114,1,'Грунт адгезивный Glims БетоContact (12 кг)','&lt;p&gt;Адгезивный грунт GLIMS БетоContact (12 кг) – это строительная смесь, которая наносится на поверхность перед отделочными работами. Использование этой грунтовки позволяет улучшить сцепку отделочного материала со стеной, полом или потолком. Адгезивный грунт GLIMS БетоContact предназначен для внутренних и внешних работ.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nподходит практически для всех типов поверхностей и отделочных материалов;\r\n&lt;/li&gt;&lt;li&gt;быстро высыхает;\r\n&lt;/li&gt;&lt;li&gt;экономно расходуется – на 1 м2 поверхности в среднем нужно от 250 до 400 г грунта.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(115,1,'Пропитка водоотталкивающая Cemmix CemAquaStop (5 л)','&lt;p&gt;Водоотталкивающая пропитка CemAquaStop используется для обработки кирпича, шифера и других пористых материалов как снаружи здания, так и внутри. Средство обеспечивает повышенную водостойкость обработанных поверхностей, необходимую в условиях повышенной влажности.\r\n&lt;/p&gt;&lt;p&gt;Особенности:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nупаковка на 5 литров;&lt;/li&gt;&lt;li&gt;\r\nзащищает от влажности;&lt;/li&gt;&lt;li&gt;\r\nнадолго сохраняет влагостойкие свойства;\r\n&lt;/li&gt;&lt;li&gt;широкая сфера применения в строительстве.&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(109,1,'Бетонконтакт Axton (18 кг)','&lt;p&gt;Бетоноконтакт Axton является инновационной грунтовкой, способствующей надежному соединению противоположных по свойствам материалов. Создает прочную поверхность, идеально подготовленную к нанесению стройматериалов. Любую гладкую поверхность бетоноконтакт превращает в шероховатую, что обеспечивает надежное сцепление. &lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nуниверсальность;\r\n&lt;/li&gt;&lt;li&gt;надежность;\r\n&lt;/li&gt;&lt;li&gt;влагоустойчивость;\r\n&lt;/li&gt;&lt;li&gt;быстрое время высыхания;\r\n&lt;/li&gt;&lt;li&gt;долговечность;&lt;/li&gt;&lt;li&gt;\r\nневысокая цена.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(117,1,'Смесь цементно-песчаная М150 (25 кг)','&lt;p&gt;Цементно-песчаная смесь М-150 — универсальный стройматериал в виде сухой смеси внутреннего и наружного использования. Предназначен для кладки печи, стяжки пола, ремонта трещин, сколов, швов, отверстий штукатурного слоя или других ЖБИ. Сухая смесь может применяться в качестве штукатурного раствора для черновой отделки.&lt;/p&gt;&lt;p&gt;\r\nВ основе состава — цемент с добавлением песка. &lt;/p&gt;&lt;p&gt;Для работы разводится водой и перемешивается до получения однородной массы. &lt;/p&gt;&lt;p&gt;Состав может модифицироваться пластификаторами и другими добавками для улучшения свойств смеси. &lt;/p&gt;&lt;p&gt;Вес упаковки — 25 кг. &lt;/p&gt;&lt;p&gt;Страна производства — Россия.&lt;/p&gt;','','1','','',''),(118,1,'Пескобетон М300 (25 кг)','&lt;p&gt;Пескобетон М-300 — строительный материал в виде сухой смеси для внутреннего и наружного использования.\r\nВ основе состава — 33% цемента и 67% песка.\r\nМожет использоваться при кладке печи.\r\nДля применения смесь разводится водой, при этом образуется густая однородная масса.&lt;/p&gt;&lt;p&gt; Допускается добавление различных присадок для улучшения характеристик.&lt;/p&gt;&lt;p&gt;\r\nВ упаковке — 25 кг.&lt;/p&gt;&lt;p&gt; Страна производства — Россия.&lt;/p&gt;','','1','','',''),(119,1,'Смесь штукатурно-кладочная М-200 (25 кг)','&lt;p&gt;Штукатурно-кладочная смесь М-200 — строительно-отделочный материал в виде сухой смеси. Предназначена для внутреннего использования. Применяется при черновой отделке поверхности: замазки выбоин, заделки швов, трещин, выравнивания неровностей, кладке кирпичных или бетонных стен, пола. Содержит в составе цемент с добавлением песка и минерального порошка.\r\nСмесь разводится водой (средние пропорции — 1,7-1,9 л на 10 кг смеси) и размешивается до получения однородной массы. Наносится на очищенную от грязи, пыли, старых отделочных материалов и слегка влажную поверхность. &lt;/p&gt;&lt;p&gt;Готовый раствор обладает высокой эластичностью, позволяет наносить материал тонким слоем (актуально при отделке потолка и при работе с небольшими дефектами поверхности). &lt;/p&gt;&lt;p&gt;Сухая смесь произведена в России.\r\n&lt;/p&gt;&lt;p&gt;Особенности&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nРабочая температура воздуха для применения готовой смеси — от +5&amp;nbsp;°C до +35&amp;nbsp;°C.\r\n&lt;/li&gt;&lt;li&gt;Раствор активен в течение 2 часов, затем становится непригоден к использованию.\r\n&lt;/li&gt;&lt;li&gt;Вес упаковки — 25 кг.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(120,1,'Пескобетон М300 Axton (5 кг)','&lt;p&gt;&lt;font color=&quot;#ffffff&quot; style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;Внимание! Во время работы используйте респиратор.&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Пескобетон М-300 Axton — строительный материал в виде сухой смеси для внутреннего и наружного использования. Предназначен для проведения общестроительных работ: устройство стяжек, отмосток, дорожек, кладки кирпича и блоков. Может использоваться как монтажный раствор при возведении фундаментов из блоков, применяться при кладке стен и пола. Пескобетон может накладываться на бетонные основания, раствор совместим с ячеистым бетоном. В основе состава — 33% цемента и 67% песка.\r\n&lt;/p&gt;&lt;p&gt;Для применения смесь разводится водой, при этом образуется густая однородная масса серого цвета. &lt;/p&gt;&lt;p&gt;Готовый состав нетоксичен. &lt;/p&gt;&lt;p&gt;Допускается добавление различных присадок для улучшения характеристик. &lt;/p&gt;&lt;p&gt;Эксплуатационная прочность достигается через 1 день. &lt;/p&gt;&lt;p&gt;В упаковке — 5 кг. &lt;/p&gt;&lt;p&gt;Страна производства — Россия.\r\n&lt;/p&gt;&lt;p&gt;Особенности\r\n\r\nРабочая способность раствора — 2 ч, затем он густеет и становится непригоден к использованию.&lt;/p&gt;&lt;p&gt;\r\nМинимальное время схватывания раствора — 24 ч, максимальное — 24 ч.\r\n&lt;/p&gt;&lt;p&gt;Хранение в сухом виде — 12 месяцев.&amp;nbsp;&lt;/p&gt;','','1','','',''),(116,1,'Пескобетон М300 Axton (30 кг)','&lt;p&gt;Пескобетон Axton — готовая сухая смесь для создания бетонного раствора. Добавление воды и тщательное перемешивание придаёт раствору рабочую пластичность. В зависимости от способа использования необходимо соизмерять удельное количество добавляемой воды. Пескобетон Axton применяется для выполнения кладки из различных материалов с пористой/плотной структурой. Данную сухую смесь можно купить, чтобы сэкономить время и усилия при осуществлении монолитной заливки стяжек, железобетонных конструкций.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nстандарт упаковки - 30 кг — облегчает ручную переноску;\r\n&lt;/li&gt;&lt;li&gt;использование кварцевого песка после застывания повышает структурную прочность;\r\n&lt;/li&gt;&lt;li&gt;низкая усадка, хорошая пластичность.&lt;/li&gt;&lt;/ul&gt;','','1','','',''),(100,1,'Бетонконтакт Axton (12 кг)','&lt;p&gt;Бетонконтакт от Axton, собственной ТМ «Леруа Мерлен» – это сухая смесь на полимерной основе, используемая для грунтовки поверхностей из любых материалов под последующую отделку. Мы предлагаем купить ее в удобной и практичной упаковке – пластиковом ведре на 12 кг смеси. Расход составляет не более 0,3 кг/м2. С учетом этого параметра цена продукта обеспечивает минимум затрат.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;p&gt;\r\nУдобство в работе.\r\n&lt;/p&gt;&lt;p&gt;Кардинальное улучшение адгезивных свойств поверхности.\r\n&lt;/p&gt;&lt;p&gt;Нетребовательность к состоянию обрабатываемых площадей.\r\n&lt;/p&gt;&lt;p&gt;Высокая скорость полного высыхания – до двух часов при комнатной температуре.&lt;/p&gt;','','1','','',''),(137,1,'Смесь огнеупорная 20 кг','&lt;p&gt;Смесь огнеупорная (20 кг) предназначена для кладки, ремонта, облицовки печей, каминов из керамического и огнеупорного кирпича. Представляет собой сухую смесь на основе шамотного порошка и каолина с термостойкостью до 1600°С. Упакована в мешки по 20 кг. Может быть использована для кладки и ремонта сушильных печей, топочных камер зерносушилок, хлебопекарских печей и т.п.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nпроста и удобна в работе;&lt;/li&gt;&lt;li&gt;\r\nобладает высокой термостойкостью;\r\n&lt;/li&gt;&lt;li&gt;гарантированный срок хранения в сухом месте в упаковке до 3-х лет.\r\n\r\nЕсли вы собрались построить баню, сауну или выложить камин, то следует воспользоваться этой огнеупорной смесью.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(138,1,'Клей гипсовый Перлгипс Монтажный 30 кг','Клей гипсовый «Перлгипс» — это состав, который характеризуется оптимальной адгезией (качеством сцепления с поверхностью) и относительно быстрым затвердеванием. Клей используется при выполнении строительных и отделочных работ без использования каркаса. Подходит для крепления гипсокартонных листов, пазогребневых плит, изоляционных материалов, декоративных гипсовых деталей.\r\nВодоудерживающие компоненты обеспечивают длительную жизнеспособность готовой смеси. Состав наносится тонким слоем и экономно расходуется. Клей не подходит для отделки помещений с повышенной влажностью.\r\nОсобенности клея\r\n\r\nПредназначен для применения внутри помещения.\r\nНе провоцирует аллергические реакции.&amp;nbsp;','','30','','',''),(139,1,'Затирка White Hills цвет серый','&lt;p&gt;Затирка White Hills применяется при финишной отделке поверхности, облицованной декоративной плиткой под кирпич или искусственным камнем внутри или снаружи здания. Высококачественная сухая смесь используется для заполнения швов шириной от 1 до 3 см. Расфасована в тару по 15 кг. Раствор легко готовится и наносится при температуре от +5&amp;nbsp;°C до +35&amp;nbsp;°C.&lt;/p&gt;&lt;p&gt;\r\nПреимущества\r\n&lt;/p&gt;&lt;p&gt;\r\nПолученный из сухой смеси раствор обладает высокой адгезией и жизнеспособен в течение часа.\r\n&lt;/p&gt;&lt;p&gt;При высыхании затирка образует шов серого цвета, характерный для каменной или кирпичной кладки.\r\n&lt;/p&gt;&lt;p&gt;Материал создает прочное морозостойкое покрытие с диапазоном температур эксплуатации от -40&amp;nbsp;°C до +80&amp;nbsp;°C.&lt;/p&gt;&lt;p&gt;\r\nЗатирка отличается экономичным расходом.&lt;/p&gt;','','30','','',''),(140,1,'Глина шамотная 20 кг','&lt;p&gt;Глина шамотная представляет собой сухую смесь, предназначающуюся для выполнения кладочных работ. Этот материал, характеризующийся огнеупорными свойствами, производится в России. «Глина шамотная», расфасованная в 20-килограммовые пакеты, пригодится при кладке дымоходов и печей, каминов и садовых грилей-барбекю. Сухая смесь рассчитана на температуру эксплуатации, не превышающую 1600 °C. Упаковки материала хватает для кладки 20-30 кирпичей.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;p&gt;\r\nвремя жизни раствора составляет не менее 60 минут;\r\n&lt;/p&gt;&lt;p&gt;выгодная цена;\r\n&lt;/p&gt;&lt;p&gt;низкий расход материала при кладке.&lt;/p&gt;','','30','','',''),(141,1,'Клей для кладки Tytan Professional 870 мл','&lt;p&gt;Клей для кладки Tytan Professional используется при тонкошовной кладке несущих стен и перегородок. Заменяет цементный раствор при скреплении газобетонных, силикатных или калиброванных керамических блоков. Образует влагостойкий шов, устойчивый к атмосферным и биологическим воздействиям. Предотвращает проникновение холода в помещение через швы в кладке. Коэффициент теплопроводности — 0,036 Вт/м*К.&lt;/p&gt;&lt;p&gt;\r\nОсобенности клея&lt;/p&gt;&lt;p&gt;\r\n\r\nОбеспечивает долговечное соединение, превосходящее по прочности традиционные клеевые или цементные растворы.&lt;/p&gt;&lt;p&gt;\r\nМожет использоваться для монтажа при отрицательных температурах — до -10&amp;nbsp;°C.&lt;/p&gt;&lt;p&gt;\r\nБаллона клея объемом 870 мл хватает для обработки 12 м^2^ поверхности.\r\n&lt;/p&gt;&lt;p&gt;Первичное схватывание раствора наступает через 2 часа, полное застывание — через 24 часа.&lt;/p&gt;','','30','','',''),(142,1,'Ремонтный состав Axton 5 кг','Ремонтный состав Axton на основе цемента предназначен для восстановления целостности бетонных конструкций. Смесь разводится водой из расчета 1 кг на 0,14-0,18 л, наносится на предварительно подготовленное основание. После затвердения поверхность шлифуется.\r\nСостав поставляется в удобной фасовке по 5 кг. Производится в России.\r\nОсобенности\r\n\r\nПрименяется для ремонта выбоин, сколов и трещин глубиной до 40 мм.\r\nМожет использоваться для наружных и внутренних работ.\r\nПодходит для обустройства или ремонта пола в помещениях с высокой нагрузкой (в гаражах, в производственных цехах, на участках с интенсивным движением).','','30','','',''),(145,1,'Knauf-Суперлист (ПК) влагостойкий 10x2500x1200 мм','&lt;p&gt;Гипсоволокно с прямой кромкой Кнауф-Суперлист представляет собой высококачественный, экологически чистый влагостойкий отделочный материал для сухого строительства в помещениях с повышенной влажностью, тепло- и звукоизоляции.\r\nИмеет прямоугольную форму и обладает размерами 1200x2500x10 мм.\r\nПредназначен для применения в жилых, административных, общественных и производственных зданиях.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nобеспечивается не только экологическая чистота, но и благоприятный для человека микроклимат в помещении;\r\n&lt;/li&gt;&lt;li&gt;обладает способностью дышать, то есть, поглощать избыточную влагу и выделять ее в окружающую среду при недостатке;\r\n&lt;/li&gt;&lt;li&gt;материал не содержит токсичных компонентов и имеет кислотность, аналогичную кислотности человеческой кожи.&lt;/li&gt;&lt;/ul&gt;','','50','','',''),(146,1,'Knauf-Суперпол влагостойкий 20x600x1200 мм','&lt;p&gt;«Кнауф-Суперпол» — экологически чистый, морозоустойчивый материал с высокими свойствами термо- и звукоизоляции. Представляет собой плиту толщиной 20 мм в виде склеенных влагостойких гипсоволокнистых листов; по периметру изделия образованы фальцы шириной 50 мм. &lt;/p&gt;&lt;p&gt;Применяется для быстрого и удобного монтажа качественного, не требующего тщательной подготовки поверхности сборного основания пола.\r\nПреимущества:\r\n\r\nэкологичный материал;\r\nне требует тщательной подготовки поверхности;\r\nобеспечивает удобный и быстрый монтаж основания пола;\r\nдоступная цена.&lt;/p&gt;','','50','','',''),(147,1,'Кнауф-Суперлист ГВЛВ-ПК 10x600x1200 мм','&lt;p&gt;Кнауф-суперлист ГВЛВ-ПК — влагостойкая гипсоволокнистая прямоугольная плита, которая используется для звукоизоляции и противопожарной защиты помещений. Устанавливается на стены, потолки, перекрытия и перегородки. Подходит для зданий любого назначения: жилых, общественных, производственных.\r\nРазмеры листа 1,2х0,6 м (площадь 0,72 м^2^), толщина — 10 мм. Кромка прямая.&lt;/p&gt;&lt;p&gt;\r\nПреимущества и особенности\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nЭкологическая чистота: материал изготавливается из гипса и волокон переработанной макулатуры методом прессования.\r\n&lt;/li&gt;&lt;li&gt;Хорошая звукоизоляция.\r\n&lt;/li&gt;&lt;li&gt;Повышенная прочность, влаго- и огнестойкость.\r\n&lt;/li&gt;&lt;li&gt;Способность «дышать».\r\n&lt;/li&gt;&lt;li&gt;Легкость обработки и монтажа.&lt;/li&gt;&lt;/ul&gt;','','50','','',''),(160,1,'Гипсокартон влагостойкий GYPROC Эрго 2000x900x12.5 мм','&lt;p&gt;Влагостойкий гипсокартон «Gyproc Эрго» предназначен для отделки помещений с повышенным уровнем влажности. Таким гипсокартоном обшивают стены и потолки в ванной и туалете, делают каркасы для простенков в санузле или помещении с бассейном. Чаще всего влагостойкий гипсокартон применяется для отделки помещений с последующей облицовкой керамической плиткой.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nразмер листа 900x2000x12,5 мм;\r\n&lt;/li&gt;&lt;li&gt;подходит для отделки стен, потолков и изготовления разных конструкций;\r\n&lt;/li&gt;&lt;li&gt;хорошо выдерживает перепады влажности и температуры в помещении;\r\n&lt;/li&gt;&lt;li&gt;легко раскраивается для изготовления сложных конструкций.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(161,1,'Гипсокартон Knauf ГСП-А 2500x1200х12.5 мм','&lt;p&gt;Гипсокартон «Кнауф» - строительный материал, состоящий из двух картонных слоев и твердой прослойки упрочненного гипса между ними. Используется при создании межкомнатных перегородок, облицовке стен и монтаже подвесных потолков. Крайне легко обрабатывается, что позволяет создавать из него конструкции повышенной сложности. Гипсокартон «Кнауф» произведен с применением особого влагоустойчивого картона и с добавлением в гипс антигрибковых веществ.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nпростота монтажа;\r\n&lt;/li&gt;&lt;li&gt;экологичность;\r\nнадежность;\r\n&lt;/li&gt;&lt;li&gt;устойчивость к негативным факторам;&lt;/li&gt;&lt;li&gt;\r\nдоступная цена.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(163,1,'Гипсокартон 2500x1200x9.5 мм','&lt;p&gt;Гипсокартон толщиной 9,5 мм широко применяется для возведения стеновых перегородок, выравнивания несущих стен, быстрого создания полых архитектурных форм. Монтаж производиться с помощью саморезов для гипсокартона. Гипсовая плита покрыта бумагой, к которой хорошо пристают штукатурные и шпатлевочные составы. Купив данный гипсокартон, можно сэкономить при работах внутри помещения. Гипсокартон легко режется канцелярским или строительным ножом.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nгипоаллергенный материал;\r\n&lt;/li&gt;&lt;li&gt;высокая адгезия к шпатлевке;\r\n&lt;/li&gt;&lt;li&gt;простота монтажа;\r\n&lt;/li&gt;&lt;li&gt;высокая прочность.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(165,1,'Гипсокартон влагостойкий Knauf ГСП-Н 1500x600х12.5 мм','&lt;p&gt;Гипсокартон «Кнауф» (ГКЛВ) — строительный материал, не пропускающий влагу. Применяется в помещениях с высоким уровнем влажности. Предназначен для отделки стен, создания навесных потолков, постройки перегородок и др. ГКЛВ представляет собой прямоугольник, состоящий из двухслойного облицовочного картона и гипсового наполнителя. Картон используется в качестве основы для нанесения отделочного материала.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nвлагостойкость и прочность;\r\n&lt;/li&gt;&lt;li&gt;материал высокого качества по разумной цене;\r\n&lt;/li&gt;&lt;li&gt;обладает отличными гигиеническими свойствами;\r\n&lt;/li&gt;&lt;li&gt;нетоксичен и безопасен для использования;\r\n&lt;/li&gt;&lt;li&gt;создает благоприятный климат в помещении;\r\n&lt;/li&gt;&lt;li&gt;обладает «дышащей» способностью;\r\n&lt;/li&gt;&lt;li&gt;качество соответствует жестким мировым стандартам.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(166,1,'Плита цементная DIY Аквапанель 800x1200x8 мм','&lt;p&gt;Плита цементная DIY «Аквапанель» — универсальный долговечный стройматериал на основе цемента, подходящий для использования не только внутри, но и снаружи помещений. Применяется для создания оснований при финишной отделке потолков и стен, откосов, перегородок и арок, для обшивки фасадов, каминов, дымоходов. Плиты не боятся высокой влажности, подходят для «мокрых зон» ванной (под плитку).\r\nПанель прямоугольной формы размером 120×80 см имеет сердечник из портландцемента с минеральным заполнителем. Поверхности усилены армировкой в виде стеклосетки.&amp;nbsp; Можно обрезать плиту по высоте и ширине. &lt;/p&gt;&lt;p&gt;Преимущества цементных плит\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nДолговечный, экологически чистый, полностью влагостойкий материал.\r\n&lt;/li&gt;&lt;li&gt;Плиту можно изгибать в сухом виде (минимальный радиус кривизны — 1 м), что позволяет создавать оригинальные элементы интерьера.\r\n&lt;/li&gt;&lt;li&gt;Под воздействием влаги материал не разбухает и не крошится.\r\n&lt;/li&gt;&lt;li&gt;Плиты устойчивы к развитию плесени и грибка.\r\n&lt;/li&gt;&lt;li&gt;Поверхность не нуждается в дополнительной герметизации.\r\n&lt;/li&gt;&lt;li&gt;Отделка обладает звукоизоляционными свойствами.\r\n&lt;/li&gt;&lt;li&gt;Материал негорючий, еврокласс огнеупорной изоляции — А1 (наивысший).\r\n&lt;/li&gt;&lt;li&gt;Монтаж выполняется просто, не требуется специализированный инструмент. Поверхность отделки не требует трудоемкой обработки.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(167,1,'Гипсокартон влагостойкий 2500x1200х9.5 мм','&lt;p&gt;Гипсокартон влагостойкий «ВОЛМА» применяется для отделки стен и потолков, а также для устройства межкомнатных перегородок в помещениях с нормальной или повышенной влажностью. Купив данный материал, можно воплотить в жизнь любой, даже самый причудливый архитектурный замысел. Гиспокартон монтируется либо с помощью специальных металлических профилей, либо с использованием гипсового клея.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nвозможность отделки криволинейных поверхностей;&lt;/li&gt;&lt;li&gt;\r\nгипс регулирует влажностный режим в помещении;\r\n&lt;/li&gt;&lt;li&gt;материал содержит водоотталкивающие и фунгицидные добавки;\r\n&lt;/li&gt;&lt;li&gt;утоненная кромка позволяет незаметно заделывать шпаклевкой стыки листов.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(168,1,'Гипсокартон Knauf-Лист ГСП-А 2000х1200х12.5 мм','Гипсокартон Knauf-Лист ГСП-А — стройматериал в виде плит, предназначенный для внутренней отделки. За счет толщины 12,5 мм подходит для обшивки стен и потолков, возведения перегородок, создания интерьерных конструкций. Плита изготовлена из прессованного гипса, заключенного с обеих сторон в слой прочного картона. Поверхности из гипсокартона можно красить, облицовывать кафелем, оклеивать обоями и прочими декоративными материалами. Плита имеет длину 200 см и ширину 120 см, весит 21 кг. Изготавливается в России.\r\nПреимущества гипсокартона\r\n\r\nБезопасный экологический чистый материал, регулирует влажность, «дышит», создает благоприятный микроклимат, подходит для жилых помещений.\r\nХорошие тепло- и звукоизоляционные свойства.\r\nБыстрый и простой монтаж, бесхлопотный способ выравнивания поверхностей.\r\nМалый вес и хорошая гибкость позволяют монтировать элементы разной конфигурации.\r\nРаскрой проводится при помощи острого ножа. Нет необходимости применять дополнительные инструменты.','','30','','',''),(169,1,'Гипсокартон 2500x1200х12.5 мм','&lt;p&gt;Гипсокартон предназначен для внутренней отделки и декорирования отапливаемых помещений с сухим и нормальным влажностными режимами. Материал используется для облицовки стен, потолка и возведения перегородок в сухих помещениях, так же гипсокартон используют для создания декоративный элементов  - встроенные ниши с полками,  арки в помещениях. Это  экологичный и безопасный для здоровья материал, к преимуществам гипсокартона относится так же легкость возведения конструкции. Для крепления тяжёлых элементов на стену из гипсокартона следует использовать дополнительные армирующие элементы – профиль и дюбель для гипсокартона.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nустойчив к воздействию влаги и пара;\r\n&lt;/li&gt;&lt;li&gt;лёгкость и простота в обработке;\r\n&lt;/li&gt;&lt;li&gt;обладает оптимальными звуко- и теплоизоляционными характеристиками;\r\n&lt;/li&gt;&lt;li&gt;пропускает воздух, поддерживая в помещении здоровый микроклимат;&lt;/li&gt;&lt;li&gt;имеет идеально ровную поверхность, на которую можно наносить практически любые декоративные материалы;\r\n&lt;/li&gt;&lt;li&gt;доступная цена.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(170,1,'Гипсокартон Knauf ГСП-А 2500x1200x9.5 мм','&lt;p&gt;Гипсокартон Кнауф представляет собой строительную плиту из двух слоёв плотного картона, между которыми проложен гипсовый слой. Благодаря высококачественным армирующим и клеевым добавкам гипсокартон обладает хорошими прочностными характеристиками. Боковые края имеют слегка закруглённый вид и защищены картоном. На поверхность хорошо ложатся отделочные смеси: штукатурка, шпаклевка, а также краски и лаки. Купить плиту можно для покрытия стен, потолков, монтажа перегородок, а также любых других конструкций. &lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nармирующие и клеевые добавки;\r\n&lt;/li&gt;&lt;li&gt;высокая прочность при небольшой толщине;&lt;/li&gt;&lt;li&gt;\r\nсовместимость с отделочными материалами;\r\n&lt;/li&gt;&lt;li&gt;доступная цена.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(171,1,'Гипсокартон влагостойкий Knauf ГСП-Н2 2500x1200х12.5 мм','&lt;p&gt;Влагостойкий гипсокартон (гипрок, ГКЛВ) марки Knauf отечественного производства используют как строительный и отделочный материал для помещений с повышенной влажностью. Из него делают подвесные потолки и перегородки между кухней и санузлом. Гипрок этой марки покупают для изготовления коробов, закрывающих сантехнические коммуникации, и используют как основу под керамическую плитку в ванных и туалетных комнатах. Также этим материалом пользуются для отделки стен и потолков в мансардных помещениях.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nэкологически чистый материал;\r\n&lt;/li&gt;&lt;li&gt;обшить стены гипсокартоном проще и быстрее, чем нанести на них слой штукатурки.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(162,1,'Гипсокартон влагостойкий Knauf ГСП-Н2 2500x1200х9.5 мм','&lt;p&gt;Влагостойкий гипсокартон «КНАУФ» от немецкого производителя – строительно-отделочный материал, используемый для выполнения работ, связанных с внутренней отделкой в помещениях и с повышенным уровнем влажности. Гипсокартонные листы толщиной 9,5 мм предназначены для ремонта и обшивки старых поверхностей, возведение потолка на металлическом каркасе, а так же для бескаркасной облицовки стен на клею. Этот современный стройматериал легко обрабатывается и не сложен в монтаже, способен поддерживать комфортный уровень влажности помещения.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nэкологичный материал;\r\n&lt;/li&gt;&lt;li&gt;поддерживает комфортный уровень влажности;\r\n&lt;/li&gt;&lt;li&gt;разумное соотношение цены и качества.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(164,1,'Гипсокартон влагостойкий 2500x1200х12.5 мм','&lt;p&gt;Влагостойкий гипсокартон «ВОЛМА» - это современный материал, предназначенный для отделки потолков и стен в помещениях с повышенной влажностью. Идеально подходит для ванных комнат, санузлов, предбанников бань и саун, слабоотапливаемых хозяйственных построек, чердаков и мансард. Благодаря тонкой кромке материал позволяет получить практически незаметный стык при шпаклевании.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nне деформируется и не теряет своих свойств в условиях высокой влажности;\r\n&lt;/li&gt;&lt;li&gt;создаёт дополнительную шумо- и теплоизоляцию;&lt;/li&gt;&lt;li&gt;\r\nлегко поддаётся обработке, благодаря чем монтаж панелей занимает минимум времени;\r\n&lt;/li&gt;&lt;li&gt;возможность нанесения любых декоративно-отделочных материалов на поверхность ГКВЛ;\r\n&lt;/li&gt;&lt;li&gt;способствует поддержанию оптимального микроклимата;&lt;/li&gt;&lt;li&gt;\r\nвыгодная цена.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(172,1,'Виброизолирующий подвес «Ультракустик»','&lt;p&gt;Виброфлекс-коннект ПС – виброизолирующий подвес для создания дополнительной шумоизоляции в металлических каркасных конструкций из плит гипсокартона и гипсоволокна. Каркасная конструкция с применением подвеса снижает шум на 25%.&lt;/p&gt;\n&lt;p&gt;Применяется в качестве виброизолирующего крепления для профилей в конструкциях облицовок стен и потолка. Виброподвес снижает передачу звуковых вибраций на листы обшивки, повышая уровень звукоизоляции всей конструкции. Представляет собой прямой подвес из оцинкованной стали толщиной 0,9 мм с обратной выштамповкой для обеспечения эффекта «гровер-шайбы» при монтаже. Рабочий элемент – комбинация двух марок эластомеров толщиной 6 и 12 мм. Рассчитанные нагрузки на один подвес – до 15 кг. Крепление монтируется непосредственно к стене/потолку через два отверстия с помощью металлических анкер-гвоздей 6 мм или пластмассовых дюбелей 6 мм с металлическими шурупами.&lt;/p&gt;','','60','','',''),(173,1,'Профиль направляющий (ПН-2) Эконом 50x40x3000 мм','&lt;p&gt;Профиль направляющий (ПН-2) ECO 50x40x3000 мм предназначен для монтажа различных гипсокартонных конструкций, межкомнатных перегородок и облицовки стен. Элемент применяется в качестве направляющего для стоечных профилей того же размера. Основание профиля оснащено двумя ребрами жесткости, которые придают прочность. Строительный материал изготовлен из оцинкованной стали.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nдоступная цена;\r\n&lt;/li&gt;&lt;li&gt;универсальность;\r\n&lt;/li&gt;&lt;li&gt;стойкость к коррозии.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(174,1,'Соединитель потолочных профилей 60х27 мм одноуровневый (краб), Премиум','&lt;p&gt;Соединитель первого уровня для ПП60х27 – аксессуар, используемый для монтажа перегородок. Служит для надежного крестообразного соединения металлических профилей.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nпрочность и долговечность;\r\n&lt;/li&gt;&lt;li&gt;устойчивость к механическим повреждениям;\r\n&lt;/li&gt;&lt;li&gt;доступная стоимость;&lt;/li&gt;&lt;li&gt;\r\nудобство в использовании.&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(175,1,'Соединитель 1-уровневой Standers 60х27 мм','&lt;p&gt;Соединитель одноуровневый Standers («краб») применяется при изготовлении каркаса подвесного потолка. Удобен для монтажа поперечных перемычек. Элемент выполнен из закаленной оцинкованной стали. Предназначен для фиксации профилей размером 60х27 мм — они устанавливаются на одном уровне с четырех сторон. Соединитель формирует узел навесной конструкции и основу для обшивки гипсокартоном. Допустимая нагрузка на элемент — 20 кг.\r\n&lt;/p&gt;&lt;p&gt;Особенности установки&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nСоединитель крепится с тыльной стороны направляющих.\r\n&lt;/li&gt;&lt;li&gt;Выступы загибаются и фиксируются по обе стороны каждого профиля.&lt;/li&gt;&lt;li&gt;\r\nЧерез отверстия вкручиваются саморезы.&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(176,1,'Профиль потолочный (ПП) Эконом 60x27x3000 мм','&lt;p&gt;Профиль потолочный (ПП/i) ECO — длинномерная стальная конструкция С-образной формы. Используется для устройства стен из гипсокартона и каркасов подвесных потолочных систем. Профиль изготовлен из качественной оцинкованной стали по технологии холодной прокатки. Для придания необходимой жесткости на стенках детали предусмотрены продольные гофры, а для быстроты монтажа — отверстия для установки дюбелей.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;p&gt;\r\nвысокая прочность и жесткость;\r\n&lt;/p&gt;&lt;p&gt;устойчивость к деформации и коррозии;\r\n&lt;/p&gt;&lt;p&gt;небольшой коэффициент термического расширения;\r\n&lt;/p&gt;&lt;p&gt;устойчивость к влажности и негативному воздействию температур;\r\n&lt;/p&gt;&lt;p&gt;простота монтажа и малый вес.&lt;/p&gt;','','30','','',''),(177,1,'Виброподвес Виброфлекс-коннект ПС','&lt;p&gt;Виброфлекс-коннект ПС – виброизолирующий подвес для создания дополнительной шумоизоляции в металлических каркасных конструкций из плит гипсокартона и гипсоволокна.&lt;br&gt;\nКаркасная конструкция с применением подвеса снижает шум на 35%.&lt;/p&gt;\n&lt;p&gt;Применяется в качестве виброизолирующего крепления для профилей в конструкциях облицовок стен и потолка. Виброподвес снижает передачу звуковых вибраций на листы обшивки, повышая уровень звукоизоляции всей конструкции. Представляет собой прямой подвес из оцинкованной стали толщиной 0,9 мм с обратной выштамповкой для обеспечения эффекта «гровер-шайбы» при монтаже. Рабочий элемент – комбинация двух марок эластомеров толщиной 6 и 12 мм. Рассчитанные нагрузки на один подвес – до 15 кг. Крепление монтируется непосредственно к стене/потолку через два отверстия с помощью металлических анкер-гвоздей 6 мм или пластмассовых дюбелей 6 мм с металлическими шурупами.&lt;/p&gt;','','100','','',''),(178,1,'Профиль потолочный (ПП) «Удобный» 60х27х1500 мм 0,6 мм','&lt;p&gt;Профиль потолочный ПП «Удобный» — несущий элемент металлического каркаса, который необходим при создании конструкций из гипсокартона. В первую очередь предназначен для монтажа подвесных потолков, но может использоваться также при обшивке стен, обустройстве ниш, коробов, фальшстен, полок. Крепится с помощью П-образных подвесов, фиксируемых на поверхности чернового потолка или стен. Именно к этому профилю прикручиваются гипсокартонные листы.\r\nТолщина изделия составляет 0,6 мм, поэтому профиль легко выдерживает нагрузку всей конструкции. В качестве материала изготовления используется оцинкованная сталь с необработанным покрытием.\r\n&lt;/p&gt;&lt;p&gt;Преимущества профиля из оцинкованной стали\r\n\r\nУвеличенный срок службы.\r\n&lt;/p&gt;&lt;p&gt;Устойчивость к деформации и негативному воздействию окружающей среды.\r\n&lt;/p&gt;&lt;p&gt;Стойкость к коррозии за счет защитного цинкового покрытия.\r\n&lt;/p&gt;&lt;p&gt;Сохранение первоначального внешнего вида и формы спустя годы эксплуатации, исключение провисания подвесной конструкции.\r\n\r\n&lt;/p&gt;&lt;p&gt;Размеры профиля\r\n\r\nШирина элемента — 60 мм.\r\nВысота — 27 мм.\r\nДлина — 1,5 метра.\r\n&lt;/p&gt;&lt;p&gt;\r\nСтрана-производитель товара — Россия.&lt;/p&gt;','','30','','',''),(179,1,'Люк потайной Maxitech 400x400 мм','&lt;p&gt;Люк потайной Maxitech размерами 400x400 мм предназначен для монтажа в потолках, стенах и перегородках. Он надежно закрывает ниши и углубления от посторонних взоров, обеспечивает удобный доступ к инженерным коммуникациям для обслуживания и ремонта. Люк оборудован дверкой на защелках, может окрашиваться различными типами красок или оклеиваться обоями. Этот оригинальный конструктивный элемент можно приобрести в комплекте по разумной цене.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nпосле установки и отделки практически не заметен;&lt;/li&gt;&lt;li&gt;\r\nоборудован страховочным тросом;\r\n&lt;/li&gt;&lt;li&gt;изготовлен из влагостойких материалов.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(180,1,'Профиль направляющий (ПН-2) Standers 50х40x3000 мм','Профиль направляющий Standers ПН-2 ― деталь металлического каркаса для конструкций из гипсокартона. Используется в качестве основы-опоры для фиксации перемычек и стоек при создании перегородок и облицовок. Отличается простой П-образной формой. Устанавливается по периметру каркаса, куда затем монтируются другие элементы системы.\r\nПрофиль изготавливается путем холодного проката металлических лент толщиной 0,6 мм через специальный профилегибочный станок. Материалом служит оцинкованная сталь с необработанным покрытием. Этот металл отличается:\r\n\r\nпрочностью и устойчивостью к деформации;\r\nувеличенным пределом износа;\r\nневосприимчивостью к коррозийным процессам и влиянию ржавчины;\r\nстойкостью к температурным перепадам и агрессивной окружающей среде.\r\n\r\nРазмеры\r\n\r\nШирина — 50 мм.\r\nВысота — 40 мм.\r\nДлина — 3 метра.\r\n\r\nСтрана производства — Россия.','','30','','',''),(181,1,'Профиль потолочный направляющий (ППН) Эконом 27x28x3000 мм','&lt;p&gt;Потолочный направляющий профиль — самое удобное приспособление для возведения перегородок из гипсокартона, одно- и многоуровневых подвесных потолков. Долговечен и не подвержен гниению, позволяет эргономично проложить инженерные коммуникации (электрические провода, трубы отопления). При помощи забивных дюбелей крепится непосредственно к потолку и полу. Кроме того, потолочный направляющий профиль не требует наличия идеально ровной поверхности.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nпозволяет удобно проложить инженерные коммуникации;&lt;/li&gt;&lt;li&gt;\r\nне требует идеально ровных поверхностей;\r\n&lt;/li&gt;&lt;li&gt;не допускает уменьшения жесткости каркаса на больших площадях.&lt;/li&gt;&lt;/ul&gt;','','50','','',''),(182,1,'Профиль потолочный направляющий (ППН) Knauf 28х27х3000 мм','&lt;p&gt;Потолочный направляющий профиль «Кнауф» представляет собой стальную основу для фиксации облицовочных панелей и листов. Как правило, крепится к стенам, полу или потолку для возведения перегородок или каркасов для натяжных потолков. Производится из высококачественной стали, что гарантирует его прочность и антикоррозийную устойчивость.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nлегкая установка;\r\n&lt;/li&gt;&lt;li&gt;надежность;&lt;/li&gt;&lt;li&gt;\r\nготовые отверстия для саморезов.\r\n&lt;/li&gt;&lt;li&gt;\r\nПрофиль «Кнауф» призван упростить монтаж несущих конструкций и их дальнейшую облицовку. &lt;/li&gt;&lt;li&gt;Демократичная цена станет еще одной причиной его покупки.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(183,1,'Люк потайной Maxitech Плюс 300x300 мм','&lt;p&gt;Люк потайной Maxitech Плюс – это современная удобная конструкция, которая используется для декорирования технологических проемов, где находятся всевозможные инженерные коммуникации – счетчики, фильтры, провода, сантехнические трубы. Название связано с тем, что в закрытом состоянии эти люки почти не заметны. Их установка дает возможность сберечь единую целостность внутреннего дизайна помещения. Также данная конструкция способствует легкому и довольно быстрому доступу к любым коммуникациям.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nдоступная цена;\r\n&lt;/li&gt;&lt;li&gt;отличное качество;&lt;/li&gt;&lt;li&gt;\r\nдолговечность;&lt;/li&gt;&lt;li&gt;\r\nнадежность.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(185,1,'Профиль Премиум  Пн-6 100х40 мм 3 м','&lt;p&gt;Профиль стальной Премиум Пн-6 — элемент системы «сухого строительства». Выполнен из оцинкованной стали методом холодной прокатки. Профиль используется для монтажа каркасно-обшивных перегородок, усиления ПВХ-профилей в оконных конструкциях и как комплектующее изделие для облицовки поверхностей стен в промышленных, общественных, жилых зданиях и сооружениях различного назначения в неагрессивной и слабоагрессивной средах. Подходит для создания каркаса перегородок, стеновой облицовки. Профиль ПН служит направляющей для стоечного профиля ПС, может использоваться для создания перемычек между стойками.\r\nПараметры профиля\r\n\r\nВысота (ширина боковых полок) — 40 мм.\r\nШирина стенки — 100 мм.\r\nДлина стандартная — 3 м: профиль легко транспортировать и крепить.\r\nИзделие соответствует основным требованиям директив ЕС (маркировка &quot;CE&quot;).\r\n&lt;/p&gt;&lt;p&gt;\r\nПреимущества\r\n&lt;/p&gt;&lt;p&gt;\r\nПрочный профиль из стали достаточной толщины позволяет создать жесткий надежный каркас для заполнения утеплителем или звукоизоляцией и последующей обшивки листовым материалом.&lt;/p&gt;&lt;p&gt;\r\nЭлемент плотно стыкуется с другими частями системы без деформирования полок.&lt;/p&gt;&lt;p&gt;\r\nПрофиль хорошо поддается сверлению, при необходимости легко обрезается по размеру ножницами по металлу.&lt;/p&gt;','','30','','',''),(186,1,'Профиль потолочный (ПП) Knauf 60х27х3000 мм','&lt;p&gt;Профиль потолочный Кнауф – стальная тонкостенная балка для создания каркасов для монтажа подвесного или натяжного потолка, выравнивания стен и других конструкций различной сложности. Изготавливается из стали посредством холодной прокатки с использованием профилегибочного оборудования. Поверхность профиля обрабатывается цинком.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nпрочность;\r\n&lt;/li&gt;&lt;li&gt;гарантия надежной состыковки всех элементов конструкции;&lt;/li&gt;&lt;li&gt;\r\nне поддается коррозии;\r\n&lt;/li&gt;&lt;li&gt;легок в работе;&lt;/li&gt;&lt;li&gt;\r\nпозволяет создавать масштабные конструкции любой сложности.\r\n\r\nДля монтажа профиля рекомендуется купить специальные саморезы гипсокартон-металл.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(187,1,'Профиль стоечный (ПС-2) Standers 50х50x3000 мм','&lt;p&gt;Профиль стоечный Standers ПС-2 — несущий элемент каркаса для гипсокартона. Применяется при установке вертикальных конструкций — перегородок и облицовок. Стоечный профиль формирует плоскость, которая служит основой для фиксации листов. Элемент имеет С-образную форму, загнутые боковые стенки увеличивают жесткость получаемой конструкции.\r\nПрофиль произведен путем холоднокатаного проката стальных лент через специальный станок, который придает изделию конечную форму с загнутыми краями. При изготовлении используется оцинкованная сталь с необработанным покрытием.&lt;/p&gt;&lt;p&gt; Этот металл характеризуется следующими преимуществами:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nстоек к воздействию коррозии и ржавчины, за счет чего сохраняет первоначальные свойства, спустя годы эксплуатации;\r\nлегко переносит перепады температуры и влажности;&lt;/li&gt;&lt;li&gt;\r\nустойчив к деформации и препятствует прогибу конечной конструкции;&lt;/li&gt;&lt;li&gt;\r\nимеет увеличенный предел износа и длительный срок службы.&lt;/li&gt;&lt;li&gt;\r\n\r\nПараметры профиля\r\n\r\nТолщина — 0,6 мм. &lt;/li&gt;&lt;li&gt;Обеспечивает достаточную жесткость и способность выдерживать высокие нагрузки.&lt;/li&gt;&lt;li&gt;\r\nШирина — 50 мм.\r\nВысота — 50 мм.\r\nДлина — 3 метра.\r\n&lt;/li&gt;&lt;li&gt;\r\nСтрана-производитель ―Россия.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(188,1,'Тяга подвеса 250 мм','&lt;p&gt;Многофункциональная тяга подвеса от известного отечественного бренда представляет собой стальной стержень или спицу с петлей. Она предназначена для подвеса различных конструкций подвесных потолков, позволяет регулировать по высоте решетку из профилей. Высококачественная тяга длиной 250 мм имеет толщину 4 мм и весит всего 0,03 кг, используется вместе с подвесами и зажимом, закрепляется анкером на плоскости. Она изготовлена из оцинкованной, устойчивой к коррозии и механическим повреждениям стали, отличается прочностью и максимальной простотой эксплуатации.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nпривлекательная цена;\r\n&lt;/li&gt;&lt;li&gt;весит всего 0,03 кг;\r\n&lt;/li&gt;&lt;li&gt;высококачественная оцинкованная сталь;\r\n&lt;/li&gt;&lt;li&gt;простота эксплуатации;\r\nуниверсальность.&lt;/li&gt;&lt;/ul&gt;','','200','','',''),(189,1,'Комплект для дверного проема 50х40 мм','Комплект для дверного проема — готовое решение для монтажа каркаса дверного проема в стенах из гипсокартона и других листовых материалов. В комплект входят стоечные и направляющие профили из оцинкованной стали, а также крепежные метизы. Конструкции обеспечивают надежную фиксацию дверного блока в проеме, подходят для самостоятельного монтажа. Страна производства товара — Россия.','','5','','',''),(190,1,'Соединитель потолочных профилей 60х27 мм одноуровневый (краб)','&lt;p&gt;Одноуровневый соединитель «краб» предназначен для крестообразного соединения потолочных конструкций на одном уровне и во взаимно перпендикулярных направлениях. Он изготовлен из высококачественной, устойчивой к коррозии и другим неблагоприятным образованиям оцинкованной стали, весит всего 0,09 кг. Элемент надёжно соединяется с профилем при помощи сгибающихся фиксирующих «лепестков», а также саморезов по металлу, используется при монтаже каркаса из профиля ПП 60х27 мм. Стальной соединитель размером 148х148 мм имеет толщину 0,55 мм, незаменим в каркасе подвесных потолков из гипсокартона и в процессе соединения отрезков несущих потолочных профилей.&lt;/p&gt;&lt;p&gt;\r\nПреимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nдоступная цена;&lt;/li&gt;&lt;li&gt;\r\nоцинкованная сталь;\r\n&lt;/li&gt;&lt;li&gt;весит всего 0,09 кг;&lt;/li&gt;&lt;li&gt;\r\nнадёжность соединения;\r\n&lt;/li&gt;&lt;li&gt;простота эксплуатации.&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(191,1,'Соединитель потолочных профилей 60х27 мм двухуровневый','&lt;p&gt;Двухуровневый соединитель для профилей потолочного типа – прочное оцинкованное изделие длиной 140 мм. С его помощью можно быстро состыковать несколько типовых профилей, если требуется создать сложную конструкцию.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nвысокий запас прочности, обеспечивающий изделию надежность и долговечность;&lt;/li&gt;&lt;li&gt;\r\nналичие оцинковки, которая защищает соединитель от коррозии, продляя ему эксплуатационный срок;&lt;/li&gt;&lt;li&gt;\r\nудобная, грамотно продуманная форма, позволяющая выполнять соединение профилей быстро и безопасно. &lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Вы сможете купить их в любом количестве благодаря невысокой цене,&amp;nbsp;&lt;/p&gt;','','100','','',''),(192,1,'Профиль Премиум  Пс-6 100х50 мм 3 м','&lt;p&gt;Профиль стальной Премиум&amp;nbsp;Пс-6 — элемент системы «сухого строительства». Выполнен из оцинкованной стали методом холодной прокатки. Профиль используется для монтажа каркасно-обшивных перегородок, усиления ПВХ-профилей в оконных конструкциях и как комплектующее изделие для облицовки поверхностей стен в промышленных, общественных, жилых зданиях и сооружениях различного назначения в неагрессивной и слабоагрессивной средах. Подходит для создания каркаса перегородок, стеновой облицовки. Профиль ПС — стоечный — имеет С-образную форму, устанавливается в качестве вертикальных стоек каркаса. Используется вместе с соответствующим по размеру направляющим профилем (ПН).\r\nПараметры профиля\r\n\r\nВысота (ширина боковых полок) — 50 мм.\r\nШирина стенки — 100 мм.\r\nДлина стандартная — 3 м: профиль легко транспортировать и крепить.\r\nИзделие соответствует основным требованиям директив ЕС (маркировка &quot;CE&quot;).\r\n&lt;/p&gt;&lt;p&gt;\r\nПреимущества\r\n&lt;/p&gt;&lt;p&gt;\r\nПрочный профиль из стали достаточной толщины позволяет создать жесткий надежный каркас для заполнения утеплителем или звукоизоляцией и последующей обшивки листовым материалом.\r\n&lt;/p&gt;&lt;p&gt;Элемент плотно стыкуется с другими частями системы без деформирования полок.\r\n&lt;/p&gt;&lt;p&gt;Профиль хорошо поддается сверлению, при необходимости легко обрезается по размеру ножницами по металлу.&lt;/p&gt;','','30','','',''),(193,1,'Люк смотровой для гипсокартона 200х200 мм, металл','&lt;p&gt;Смотровой люк для гипсокартона также используется и для других материалов, в том числе бетона, дерева и кирпича. Изделие предназначено для скрытого монтажа в потолки и стены с последующей отделкой, не нарушающей общий вид и рисунок поверхности. Люк позволяет получить быстрый и регулярный доступ к инженерным коммуникациям. Модель представляет собой прочную раму из высококачественного алюминиевого профиля угловой формы с дверцей. Специальная ручка позволяет легко открыть смотровой люк при необходимости.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nуниверсальность;\r\n&lt;/li&gt;&lt;li&gt;прочность;\r\n&lt;/li&gt;&lt;li&gt;легкий монтаж;\r\n&lt;/li&gt;&lt;li&gt;доступная цена.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(194,1,'Прямой подвес для пп-60х27 standers','&lt;p&gt;Прямой подвес для потолочного профиля Standers используется при оформлении подвесных потолков — при сборке металлического каркаса для обшивки гипсокартоном. В центральной части подвеса предусмотрено 2 отверстия, через которые элемент крепится к потолку. Для соединения с профилем используются саморезы-клопы. Навесная система формирует пространство, маскирующее слой изоляции, вентиляцию и позволяющее использовать встроенные светильники. Монтаж прямого подвеса допустим при погрешности потолочной поверхности не более 3 см.\r\n&lt;/p&gt;&lt;p&gt;Особенности\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nПодвес совместим с профилем размером 60х27 мм.\r\n&lt;/li&gt;&lt;li&gt;Изготовлен из листовой оцинкованной стали.\r\n&lt;/li&gt;&lt;li&gt;Выдерживает нагрузку до 20 кг.&lt;/li&gt;&lt;li&gt;\r\nРекомендуемый шаг установки — 60 см.&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(195,1,'Профиль потолочный (ПП) Standers 60х27x3000 мм','&lt;p&gt;Профиль потолочный Standers ПП — несущий элемент металлического каркаса, который необходим при создании конструкций из гипсокартона. В первую очередь предназначен для монтажа подвесных потолков, но может использоваться также при обшивке стен, обустройстве ниш, коробов, фальшстен, полок. Крепится с помощью П-образных подвесов, фиксируемых на поверхности чернового потолка или стен. Именно к этому профилю прикручиваются гипсокартонные листы.\r\nТолщина изделия составляет 0,6 мм, поэтому профиль легко выдерживает нагрузку всей конструкции. В качестве материала изготовления используется оцинкованная сталь с необработанным покрытием.\r\n&lt;/p&gt;&lt;p&gt;Преимущества профиля из оцинкованной стали\r\n\r\nУвеличенный срок службы.\r\n&lt;/p&gt;&lt;p&gt;Устойчивость к деформации и негативному воздействию окружающей среды.&lt;/p&gt;&lt;p&gt;\r\nСтойкость к коррозии за счет защитного цинкового покрытия.\r\n&lt;/p&gt;&lt;p&gt;Сохранение первоначального внешнего вида и формы спустя годы эксплуатации, исключение провисания подвесной конструкции.\r\n&lt;/p&gt;&lt;p&gt;\r\nРазмеры профиля\r\n\r\nШирина элемента — 60 мм.\r\nВысота — 27 мм.\r\nДлина — 3 метра.\r\n\r\nСтрана-производитель товара — Россия.&lt;/p&gt;','','30','','',''),(196,1,'Люк смотровой для гипсокартона 300х300 мм, металл','&lt;p&gt;Смотровой люк встраивается в любую рабочую поверхность, отличается надежным креплением и откидной конструкцией крышки. Люк изготовлен из металла и предназначен для стен из гипсокартона. Деталь устанавливается на горизонтальных и вертикальных поверхностях, также возможен монтаж на потолке. Размеры люка позволяют получить доступ к счетчикам воды и электричества, розеткам, трубам и другим коммуникациям. Люк открывается с помощью ручки на передней панели.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nмногофункциональность;&lt;/li&gt;&lt;li&gt;\r\nпрочность;\r\n&lt;/li&gt;&lt;li&gt;практичность;\r\n&lt;/li&gt;&lt;li&gt;универсальность;\r\n&lt;/li&gt;&lt;li&gt;оптимальный размер;\r\n&lt;/li&gt;&lt;li&gt;доступная цена.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(197,1,'Удлинитель потолочного профиля 60x27 мм','&lt;p&gt;Удлинитель для профилей – надежное изделие длиной 80 мм, изготовленное из качественного листового металла. Предназначается для наращивания типовых потолочных профилей, используемых для быстрого монтажа гипсокартонных плит. &lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nпозволяет за считанные минуты удлинить профили и создавать более сложные по конфигурации настенные и потолочные конструкции;\r\n&lt;/li&gt;&lt;li&gt;отличается долговечностью и надежностью благодаря высокому качеству материала изготовления;\r\n&lt;/li&gt;&lt;li&gt;имеет легкий вес, поэтому не способен значительно утяжелить конструкции, состоящие из профилей&lt;/li&gt;&lt;/ul&gt;','','200','','',''),(198,1,'Профиль направляющий (ПН-4) Эконом 75x40x3000 мм','&lt;p&gt;Направляющий профиль – это строительная деталь П-образной формы, которая изготовлена из оцинкованной стали. Товар имеет характерный металлический цвет. Изделие используется для создания различных каркасов и служит основой для последующей установки стоечных профилей. Профиль обладает высокой прочностью благодаря качеству материала, а также быстро устанавливается с помощью обычных саморезов.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nможно купить для создания каркасов, &lt;/li&gt;&lt;li&gt;перемычек и декоративных перегородок;\r\n&lt;/li&gt;&lt;li&gt;быстрая и простая установка;&lt;/li&gt;&lt;li&gt;\r\nвысокое качество материала;\r\n&lt;/li&gt;&lt;li&gt;подходит для монтажа комнатной звукоизоляции.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(199,1,'Люк потайной Maxitech Плюс 600x600 мм','&lt;p&gt;Люк потайной Maxitech Плюс – это изделие, которое предназначено для установки в стеновые и потолочные перегородки и конструкции из одного слоя ГКЛ. Также он обеспечивает беспрепятственный и оперативный доступ к инженерным коммуникациям. Осуществив легкое нажатие на крышку люка, можно открыть и закрыть его.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nвысокое качество;\r\n&lt;/li&gt;&lt;li&gt;демократичная цена;\r\n&lt;/li&gt;&lt;li&gt;долговечность;\r\n&lt;/li&gt;&lt;li&gt;имеет страховочный трос, предотвращающий случайное выпадение;\r\n&lt;/li&gt;&lt;li&gt;наличие съемной антивандальной крышки;\r\n&lt;/li&gt;&lt;li&gt;оперативность и простота установки;\r\n&lt;/li&gt;&lt;li&gt;прочность алюминиевого профиля.&lt;/li&gt;&lt;/ul&gt;','','5','','',''),(200,1,'Подвес прямой для потолочного профиля 60х27 мм, Премиум','&lt;p&gt;Прямой подвес – высокотехнологичный строительный элемент, который используется для закрепления потолочных профилей на несущих конструкциях. Изготовлен из стальных полос оптимальной жесткости и прочности, что позволяет оборудовать надежный каркас для подвесных потолочных систем. Благодаря специальной форме, на установку каркасов любой сложности тратится минимальное количество времени. Совместим с различными крепежами: дюбелями, шурупами, анкерами.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nуниверсальная конструкция;\r\n&lt;/li&gt;&lt;li&gt;дополнительные выступы для надежного крепления;\r\n&lt;/li&gt;&lt;li&gt;возможность использовать различные крепежные элементы.&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(201,1,'Профиль потолочный (ППН) «Удобный» 27х28х1500 мм 0,6 мм','Профиль потолочный направляющий ППН «Удобный» представляет собой отдельный вид элементов металлокаркаса, применяется при обшивке потолка гипсокартоном, обустройстве подвесных конструкций. Также может использоваться при обшивке стен, создании коробов, ниш, полок. Устанавливается по всему периметру помещения, крепится непосредственно к основаниям. В направляющих фиксируется потолочный профиль.\r\nТолщина направляющего профиля (0,6 мм) обеспечивает достаточную жесткость и прочность, устойчивость к нагрузкам и деформации.\r\nМодель изготавливается из оцинкованной стали, отличается необработанным покрытием. Металл имеет следующие преимущества:\r\n\r\nсохраняет первоначальную форму, за счет чего исключает вероятность провисания конструкции;\r\nблагодаря защитному напылению из цинка не подвержен появлению ржавчины и разрушению под влиянием коррозии;\r\nотличается увеличенным пределом износа и прочности, долгим сроком службы;\r\nустойчив к негативному воздействию окружающей среды, например к перепадам температур и влажности.\r\n\r\nПрофиль выпускается шириной 28 мм. Высота направляющей — 27 мм. Длина — 1,5 метра. Профиль произведен в России.','','100','','',''),(202,1,'Люк потайной Maxitech 300x300 мм','&lt;p&gt;Люк потайной Maxitech – это лучший вариант «скрытого» доступа к инженерным сетям. Данная модель потайного ревизионного люка признана лучшей в мире. Это универсальное изделие, его можно установить и в потолочные конструкции из однослойного гипсокартона, и в стены. У него есть антивандальная крышка, которая существенно облегчает доступ к любым инженерным коммуникациям.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nпростая установка, не требующая специальных навыков и инструмента;\r\nотменное качество продукции;\r\n&lt;/li&gt;&lt;li&gt;лучшая цена;\r\nпрочность и надежность;&lt;/li&gt;&lt;li&gt;\r\nдлительный срок службы;\r\n&lt;/li&gt;&lt;li&gt;наличие страховочного троса, который не допускает выпадение.&lt;/li&gt;&lt;/ul&gt;','','5','','',''),(203,1,'Тяга подвеса 1000 мм','&lt;p&gt;Тяга подвеса 1000 мм — это стальной стержень с петлей, предназначенный для использования в подвешивании гипсокартонных и других конструкций, преимущественно — навесных потолков. В сочетании с зажимами и профилем позволяет закрепить листы на нужной высоте.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nмалый вес;\r\n&lt;/li&gt;&lt;li&gt;простота монтажа;\r\n&lt;/li&gt;&lt;li&gt;длительный срок службы.&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;','','70','','',''),(204,1,'Профиль направляющий (ПН) Knauf 50x40x3000 мм','&lt;p&gt;Направляющий профиль «Кнауф» – изделие российского производства, изготавливаемое из прочной стали. Его обычно используют для установки перегородок и обшивки стен. Благодаря хорошему качеству изделие долго служит и не деформируется.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;p&gt;\r\n\r\nбыстро устанавливается с помощью саморезов и дюбелей;\r\n&lt;/p&gt;&lt;p&gt;если необходимо проделать дополнительные отверстия для крепежных элементов, достаточно использовать дрель;\r\n&lt;/p&gt;&lt;p&gt;при повышенной влажности воздуха изделие не ржавеет.&lt;/p&gt;','','60','','',''),(205,1,'Профиль стоечный (ПС-2) Эконом 50x50x3000 мм','&lt;p&gt;Профиль стоечный относится к длинномерным элементам для создания металлического каркаса. С его помощью обшивают поверхности дома гипсокартоном, вагонкой и другими материалами. Элемент производится из стальной ленты на профилегибочном станке методом холодной прокатки. Сталь оцинкованная и не восприимчива к коррозии. Данный профиль имеет базовый уровень качества и используется для слабонагруженных конструкций.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nуниверсальность;\r\n&lt;/li&gt;&lt;li&gt;устойчивость к температурным скачкам;&lt;/li&gt;&lt;li&gt;\r\nдолгий срок службы, по сравнению с деревянными балками.&lt;/li&gt;&lt;/ul&gt;','','50','','',''),(206,1,'Профиль направляющий (ПН) Knauf 75x40x3000 мм','&lt;p&gt;Стоечный профиль от торговой марки «Кнауф» является устойчивой к коррозии строительной деталью, которая используется в процессе монтажа гипсокартонных стен, перегородок и облицовок. Изделие произведено из оцинкованной стали, отличается прочностью и долговечностью. Модель изготовлена в стандартной П-образной форме, ее установка производится вкупе с направляющими профилями соответствующего размера.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nможно купить для монтажа стен,&lt;/li&gt;&lt;li&gt; звукоизоляции, различных перегородок;\r\n&lt;/li&gt;&lt;li&gt;быстрый и простой монтаж посредством классических саморезов;\r\n&lt;/li&gt;&lt;li&gt;сделано из высокопрочной стали.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(207,1,'Профиль потолочный направляющий (ППН) Standers 27х28x3000 мм','&lt;p&gt;Профиль потолочный направляющий Standers ППН представляет собой отдельный вид элементов металлокаркаса, применяется при обшивке потолка гипсокартоном, обустройстве подвесных конструкций. Также может использоваться при обшивке стен, создании коробов, ниш, полок. Устанавливается по всему периметру помещения, крепится непосредственно к основаниям. В направляющих фиксируется потолочный профиль.\r\nТолщина направляющего профиля  обеспечивает достаточную жесткость и прочность, устойчивость к нагрузкам и деформации.\r\nМодель изготавливается из оцинкованной стали, отличается рифленой поверхностью, которая обеспечивает легкость разметки и центрирования саморезов. &lt;/p&gt;&lt;p&gt;Металл имеет следующие преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nсохраняет первоначальную форму, за счет чего исключает вероятность провисания конструкции;&lt;/li&gt;&lt;li&gt;\r\nблагодаря защитному напылению из цинка не подвержен появлению ржавчины и разрушению под влиянием коррозии;\r\n&lt;/li&gt;&lt;li&gt;отличается увеличенным пределом износа и прочности, долгим сроком службы;&lt;/li&gt;&lt;li&gt;\r\nустойчив к негативному воздействию окружающей среды, например к перепадам температур и влажности.\r\n&lt;/li&gt;&lt;li&gt;\r\nПрофиль выпускается шириной 27 мм. Высота направляющей — 28 мм. Длина — 3 метра.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(208,1,'Профиль гибкий 60х27x1000 мм','&lt;p&gt;Металлический гибкий оцинкованный профиль предназначен для монтажа перегородок. Изделие негигроскопично и не деформируется под воздействием температур и влаги. Профиль не подвержен коррозии, на его поверхности не образовывается грибок и плесень. Монтажную панель характеризует небольшой вес, что позволяет использовать ее для возведения перегородок в строениях с неглубоким фундаментом.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nнадежность;\r\n&lt;/li&gt;&lt;li&gt;практичность;\r\n&lt;/li&gt;&lt;li&gt;функциональность;\r\n&lt;/li&gt;&lt;li&gt;долговечность;&lt;/li&gt;&lt;li&gt;\r\nневысокая цена.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(209,1,'Профиль стоечный (ПС) Knauf 50x50x3000 мм','&lt;p&gt;Стоечный профиль «Кнауф» длиной 3 000 мм используется для быстрого и качественного монтажа гипсокартонных листов при облицовке стен. Может похвастать высоким качеством и прочностью благодаря тому, что сделан из оцинкованной стали. При долговременной эксплуатации профиль не ржавеет и не деформируется, что обеспечивает ему стабильный спрос.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\n\r\nнадежность и безопасность;\r\n&lt;/li&gt;&lt;li&gt;быстрый монтаж с помощью саморезов и дюбелей, которые вставляются в уже подготовленные на заводе отверстия;\r\n&lt;/li&gt;&lt;li&gt;легко поддается обработке сверлом, если возникает необходимость сделать еще несколько отверстий.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(210,1,'Тяга подвеса 350 мм','&lt;p&gt;Стальная тяга используется в процессе изготовления потолочных каркасов в комплектации с подвесами и зажимом. Она изготовлена из высококачественной оцинкованной стали, благодаря чему не подвержена коррозийным и другим неблагоприятным образованиям. Многофункциональная тяга длиной 350 мм имеет толщину 4 мм и весит всего 0,04 кг, представляет собой стальную спицу, на одном конце которой расположена петля. Тяга от известного отечественного бренда крепится анкерами на базовом перекрытии, незаменима при подвесе профильных конструкций подвесных потолков.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nмаксимально выгодная цена;\r\n&lt;/li&gt;&lt;li&gt;небольшой вес;&lt;/li&gt;&lt;li&gt;\r\nпрактичность и простота эксплуатации;\r\n&lt;/li&gt;&lt;li&gt;высококачественная оцинкованная сталь;\r\n&lt;/li&gt;&lt;li&gt;универсальность.&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(211,1,'Профиль стоечный (ПС-4) Knauf 75x50x3000 мм','&lt;p&gt;Стоечный профиль от бренда «Кнауф» является незаменимой деталью, с помощью которой производится монтаж гипсокартонных стен и перегородок. Изделие изготовлено из прочной стали, поверхность которой устойчива к любым механическим повреждениям. Классическая П-образная форма модели позволяет фиксировать листы гипсокартона в вертикальном положении. Установка детали осуществляется с помощью обычных саморезов, вкупе с направляющим типом профилей.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nдоступная цена;\r\n&lt;/li&gt;&lt;li&gt;простая и быстрая установка;&lt;/li&gt;&lt;li&gt;\r\nизготовлено из высокопрочной стали;&lt;/li&gt;&lt;li&gt;\r\nподходит для монтажа комнатной звукоизоляции.&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(212,1,'Подвес прямой для потолочного профиля 60x27 мм, Евростандарт','&lt;p&gt;Многофункциональный прямой подвес предназначен для крепления потолочных профилей к потолкам, стенам, а также другим базовым конструкциям. Он изготовлен из оцинкованной стали, весит всего 0,05 кг. При монтаже подвеса на стену используются специальные дюбели, при работе с перекрытиями из бетона — анкеры. Благодаря простой, но надёжной конструкции и универсальности, он незаменим при проведении наружных и внутренних работ, крепеже деревянных или металлических обрешеток и монтаже гипсокартона. Элемент размером 30х306 мм имеет круглые отверстия с мелким шагом, позволяющие быстро и с высокой точностью установить необходимый уровень плоскости.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nдемократичная цена;&lt;/li&gt;&lt;li&gt;\r\nотверстия с мелким шагом;\r\n&lt;/li&gt;&lt;li&gt;универсальность;\r\n&lt;/li&gt;&lt;li&gt;весит всего 0,05 кг;\r\n&lt;/li&gt;&lt;li&gt;оцинкованная сталь.&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(184,1,'Подвес анкерный для потолочного профиля 60x27 мм','&lt;p&gt;Правильно подобранный анкерный подвес для потолочного профиля — это многофункциональный инструмент, незаменимый при проведении строительно-монтажных работ любого масштаба. Он предназначен для надёжного крепления потолочных профилей к несущей конструкции, весит всего 0,05 кг. Подвес толщиной 0,9 мм сконструирован таким образом, чтобы в процессе его монтажа можно было регулировать положение профиля по высоте. Он имеет размер 65х109,5 мм, изготовлен из высококачественной оцинкованной стали, благодаря чему отличается прочностью, долговечностью и максимальной устойчивостью к коррозии.\r\n&lt;/p&gt;&lt;p&gt;Преимущества:\r\n&lt;/p&gt;&lt;ul&gt;&lt;li&gt;\r\nмаксимально доступная цена;\r\n&lt;/li&gt;&lt;li&gt;универсальность;\r\n&lt;/li&gt;&lt;li&gt;высококачественная оцинкованная сталь;\r\n&lt;/li&gt;&lt;li&gt;простота эксплуатации;\r\n&lt;/li&gt;&lt;li&gt;небольшой вес.&lt;/li&gt;&lt;/ul&gt;','','150','','',''),(262,1,'Кабель ВБбШв 4x16,0','Изделие представляет собой не распространяющий горение силовой бронированный кабель, содержащий от одной до пяти медных жил в ПВХ-изоляции, с низким дымо- и газовыделением. Продукция производится в соответствии с требованиями ГОСТ 31996-2012, ГОСТ 31565-2012 и ТУ 3500-018-52114552-2011.','','100','','',''),(263,1,'Кабель ВБбШв 4x25,0','Изделие представляет собой не распространяющий горение силовой бронированный кабель, содержащий от одной до пяти медных жил в ПВХ-изоляции, с низким дымо- и газовыделением. Продукция производится в соответствии с требованиями ГОСТ 31996-2012, ГОСТ 31565-2012 и ТУ 3500-018-52114552-2011.','','100','','',''),(264,1,'Кабель ВБбШв 4x4,0','Изделие представляет собой не распространяющий горение силовой бронированный кабель, содержащий от одной до пяти медных жил в ПВХ-изоляции, с низким дымо- и газовыделением. Продукция производится в соответствии с требованиями ГОСТ 31996-2012, ГОСТ 31565-2012 и ТУ 3500-018-52114552-2011.','','100','','',''),(265,1,'Кабель ВБбШв 4x50,0','Изделие представляет собой не распространяющий горение силовой бронированный кабель, содержащий от одной до пяти медных жил в ПВХ-изоляции, с низким дымо- и газовыделением. Продукция производится в соответствии с требованиями ГОСТ 31996-2012, ГОСТ 31565-2012 и ТУ 3500-018-52114552-2011.','','100','','',''),(266,1,'Кабель ВБбШв 5x10,0','Изделие представляет собой не распространяющий горение силовой бронированный кабель, содержащий от одной до пяти медных жил в ПВХ-изоляции, с низким дымо- и газовыделением. Продукция производится в соответствии с требованиями ГОСТ 31996-2012, ГОСТ 31565-2012 и ТУ 3500-018-52114552-2011.','','100','','',''),(246,1,'Провод самонесущий СИП-4 4x16 Партнер Электро','Расшифровка проводов СИП-4:&lt;br&gt;С - Самонесущий&lt;br&gt;И - Изолированный&lt;br&gt;П - Провод&lt;br&gt;4 - Тип конструкции: провод самонесущий с четырьмя алюминиевыми фазными токопроводящими жилами, с изоляцией из сшитого полиэтилена 0,66/1 кВ&lt;br&gt;Элементы конструкции проводов СИП-4:&lt;br&gt;Токопроводящие жилы - алюминиевые, круглой формы, многопроволочные уплотненные.&lt;br&gt;Изоляция - из светостабилизированного сшитого полиэтилена.&lt;br&gt;Скрутка - изолированные жилы скручены между собой.&lt;br&gt;&lt;br&gt;Область применения проводов СИП-4:&lt;br&gt;Провода предназначены для воздушных линий электропередачи на напряжение до 0,6/1 кВ включительно номинальной частотой 50 Гц, для выполнения ответвлений от воздушных линий электропередачи к вводу, для прокладки по стенам зданий или инженерных сооружений, в атмосфере воздуха типов II и III по ГОСТ 15150.&lt;br&gt;&lt;br&gt;Технические параметры проводов СИП-4:&lt;br&gt;Вид климатического исполнения проводов B, категории размещения 1, 2 и 3 по ГОСТ 15150&lt;br&gt;Провода стойки к воздействию солнечного излучения.&lt;br&gt;Радиус изгиба при монтаже и установленного на опорах провода - не менее 10 наружных диаметров.&lt;br&gt;Монтаж проводится при температуре окружающей среды - не ниже -20°C.&lt;br&gt;Диапазон температур при эксплуатации от - 60°C до + 50°C.&lt;br&gt;Строительная длина провода согласовывается при заказе.&lt;br&gt;Гарантийный срок эксплуатации - 3 года с даты ввода провода в эксплуатацию.&lt;br&gt;Срок службы проводов - не менее 40 лет.&lt;br&gt;Допустимое напряжение, кВ: 1;0,380;0,660&lt;br&gt;&lt;br&gt;Исполнение: многопроволочный;изолированный;самонесущий;многожильный','','1000','','',''),(245,1,'Провод самонесущий СИП-4 4x16 Кирскабель','Расшифровка проводов СИП-4:&lt;br&gt;С - Самонесущий&lt;br&gt;И - Изолированный&lt;br&gt;П - Провод&lt;br&gt;4 - Тип конструкции: провод самонесущий с четырьмя алюминиевыми фазными токопроводящими жилами,