темы. Доступная цена и высокое качество материалов является главным плюсом торговой марки PROconnect. &lt;br&gt;Кабель акустический 2х0,35 мм² Blue Line PROconnect состоит из двух параллельных многожильных проводников в изоляции из прозрачного поливинилхлоридного пластиката. Разделительное основание позволяет обеспечить разделение проводников кабеля без повреждения изоляции и оголения жил.','','1000','','',''),(249,1,'Кабель для видеонаблюдения КВК-П-2+ 2x0,75мм (CCA) черный OUTDOOR PROCONNECT','Кабель КВК-П-2 + 2х0.75мм² (96) PROCONNECT предназначен для передачи телевизионных сигналов в системах видеонаблюдения с одновременным подключением питания и/или передачи сигналов управления.&lt;br&gt;&lt;br&gt;Кабель состоит из радиочастотного (коаксиального) кабеля и жил питания объединенных под единой оболочкой. Коаксиальный кабеля состоит из центральной (одножильной) медной жилы, вспененного диэлектрика, экраном из омедненых 96*0,12 жил и изоляции из ПВХ, аналог кабеля (РК-75-2-12). Жила питания (омедненная) многожильная, сечением 0,75мм² в изоляции из ПВХ. Рабочее напряжение токопроводящей жилы до 600В. Общая изоляция из светостабилизированного полиэтилена PE и диаметром кабеля 8мм.&lt;br&gt;&lt;br&gt;Использование кабеля КВК-П-2 + 2х0.75мм² (96) PROCONNECT регламентирует сертификат соответствия Таможенного Союза (EAC).&lt;br&gt;&lt;br&gt;Кабель КВК без потерь и помех передает видеосигнал и обеспечивает поставку электропитания на расстояние, не превышающее 120 м.','','1000','','',''),(250,1,'Провод КСПЭВ 4x0,5','Для монтажа систем сигнализации, телекоммуникации, управления и сбора данных. Для эксплуатации при напряжении до 145 В переменного тока (диаметр жил 0,40-0,64 или сечение 0,12-0,35 мм.кв.) и до 300 В переменного тока (диаметр жил 0,80-1,78 или сечение 0,50-1,00 мм.кв.) частотой 10 кГц.','','1000','','',''),(251,1,'Провод КСПВ 2x0,5','Для монтажа систем сигнализации, телекоммуникации, управления и сбора данных. Для эксплуатации при напряжении до 145 В переменного тока (диаметр жил 0,40-0,64 или сечение 0,12-0,35 мм.кв.) и до 300 В переменного тока (диаметр жил 0,80-1,78 или сечение 0,50-1,00 мм.кв.) частотой 10 кГц.&lt;br&gt;Кабель с однопроволочными медными жилами, с изоляцией из композиции полиэтилена, с оболочкой из белого ПВХ пластиката, предназначен для внутренней стационарной прокладки.&lt;br&gt;&lt;br&gt;Особенности&lt;br&gt;Монтаж проводов марки КПСВ производят при температуре не ниже 0°С','','1000','','',''),(252,1,'Провод КСПВ 4x0,5','','','1000','','',''),(253,1,'Провод КСВЭВ нг LS 4x0,5','','','1000','','',''),(254,1,'Провод П 274 М 2x0,5','Токопроводящие жилы — скручивают из 3-х стальных проволок диаметром 0.3 мм и 4-х медных проволок диаметром 0.3 мм.&lt;br&gt;2. Изоляция — из светостабилизированного полиэтилена высокой плотности толщиной 0.5 мм.&lt;br&gt;3. Две изолированные жилы — максимальным диаметром 2.3 мм скручиваются в пару с шагом 80-100 мм.&lt;br&gt;&lt;br&gt;Область применения проводов П-274М:&lt;br&gt;Провод П-274М предназначены для полевой связи: допускается прокладка в грунте, по земле, подвеска на опорах или местных предметах, кратковременная прокладка через водные преграды.&lt;br&gt;','','1000','','',''),(255,1,'Провод ШВП М 2х0,35 акустический ССА','Шнур с параллельными жилами, с поливинилхлоридной изоляцией, повышенной гибкости, на напряжение до 300 В для систем 300/300 В.&lt;br&gt;&lt;br&gt;Примечания &lt;br&gt;Провода и шнуры в зависимости от конструкции обеспечивают подключение электроприборов всех классов защиты по электробезопасности.&lt;br&gt;&lt;br&gt;Применяется для присоединения радиоэлектронной аппаратуры, бытовых осветительных приборов, электроприборов микроклимата, электромеханических бытовых приборов, электровентиляторов и других подобных приборов, если шнур часто подвергается легким механическим деформациям','','1000','','',''),(256,1,'Провод ШВП М 2х0,5 акустический ССА','Шнур с параллельными жилами, с поливинилхлоридной изоляцией, повышенной гибкости, на напряжение до 300 В для систем 300/300 В.&lt;br&gt;&lt;br&gt;Примечания &lt;br&gt;Провода и шнуры в зависимости от конструкции обеспечивают подключение электроприборов всех классов защиты по электробезопасности.&lt;br&gt;&lt;br&gt;Применяется для присоединения радиоэлектронной аппаратуры, бытовых осветительных приборов, электроприборов микроклимата, электромеханических бытовых приборов, электровентиляторов и других подобных приборов, если шнур часто подвергается легким механическим деформациям','','1000','','',''),(257,1,'Провод ШВП М 2х0,75 акустический ССА','Шнур с параллельными жилами, с поливинилхлоридной изоляцией, повышенной гибкости, на напряжение до 300 В для систем 300/300 В.&lt;br&gt;&lt;br&gt;Примечания &lt;br&gt;Провода и шнуры в зависимости от конструкции обеспечивают подключение электроприборов всех классов защиты по электробезопасности.&lt;br&gt;&lt;br&gt;Применяется для присоединения радиоэлектронной аппаратуры, бытовых осветительных приборов, электроприборов микроклимата, электромеханических бытовых приборов, электровентиляторов и других подобных приборов, если шнур часто подвергается легким механическим деформациям','','1000','','',''),(258,1,'Провод ШВП М 2х1,5 акустический ССА','Шнур с параллельными жилами, с поливинилхлоридной изоляцией, повышенной гибкости, на напряжение до 300 В для систем 300/300 В.&lt;br&gt;&lt;br&gt;Примечания &lt;br&gt;Провода и шнуры в зависимости от конструкции обеспечивают подключение электроприборов всех классов защиты по электробезопасности.&lt;br&gt;&lt;br&gt;Применяется для присоединения радиоэлектронной аппаратуры, бытовых осветительных приборов, электроприборов микроклимата, электромеханических бытовых приборов, электровентиляторов и других подобных приборов, если шнур часто подвергается легким механическим деформациям','','1000','','',''),(259,1,'Провод SILICON 2x0,75 акустический Rexant','Для получения отличного звучания акустики, даже сложных аудиосистем высокого класса, важно использовать качественный кабель. Ведь параметры и характер звука сильно зависят от выбранного кабеля, его материала и качества изготовления. Акустический кабель SILICON 2х0,75 мм2 REXANT отличается высококачественными материалами, надежностью и долговечностью. Кабель изготовлен из чистой безкислородной меди, которая обеспечивает отличную передачу сигнала и в широком диапазоне частот. Провода в жилах тоньше, чем в других разновидностях кабелей. Это еще более улучшает качество передачи звука.&lt;br&gt;Внешняя оболочка кабеля изготовлена из силикона и имеет прозрачный цвет, одна из жил кабеля состоит из луженой меди. Площадь сечения жил данного кабеля – 0,75 мм2. Этот акустический кабель подойдет для любой, даже самой сложной звуковой аппаратуры высокого класса. Хорошее качество и приемлемая цена делают кабель фирмы REXANT отличным решением как для специалистов, работающих со звуком, так и для начинающих.','','1000','','',''),(260,1,'Провод SILICON 2x1,5 акустический Rexant','Для получения отличного звучания акустики, даже сложных аудиосистем высокого класса, важно использовать качественный кабель. Ведь параметры и характер звука сильно зависят от выбранного кабеля, его материала и качества изготовления. Акустический кабель SILICON 2х1,5 мм2 REXANT отличается высококачественными материалами, надежностью и долговечностью. Кабель изготовлен из чистой безкислородной меди, которая обеспечивает отличную передачу сигнала и в широком диапазоне частот. Провода в жилах тоньше, чем в других разновидностях кабелей. Это еще более улучшает качество передачи звука.&lt;br&gt;Внешняя оболочка кабеля изготовлена из силикона и имеет прозрачный цвет, одна из жил кабеля состоит из луженой меди. Площадь сечения жил данного кабеля – 1,5 мм2. Этот акустический кабель подойдет для любой, даже самой сложной звуковой аппаратуры высокого класса. Хорошее качество и приемлемая цена делают кабель фирмы REXANT отличным решением как для специалистов, работающих со звуком, так и для начинающих.','','1000','','',''),(261,1,'Провод SILICON 2x2,5 акустический Rexant','Для получения отличного звучания акустики, даже сложных аудиосистем высокого класса, важно использовать качественный кабель. Ведь параметры и характер звука сильно зависят от выбранного кабеля, его материала и качества изготовления. Акустический кабель SILICON 2х2,5 мм2 REXANT отличается высококачественными материалами, надежностью и долговечностью. Кабель изготовлен из чистой безкислородной меди, которая обеспечивает отличную передачу сигнала и в широком диапазоне частот. Провода в жилах тоньше, чем в других разновидностях кабелей. Это еще более улучшает качество передачи звука.&lt;br&gt;Внешняя оболочка кабеля изготовлена из силикона и имеет прозрачный цвет, одна из жил кабеля состоит из луженой меди. Площадь сечения жил данного кабеля – 2,5 мм2. Этот акустический кабель подойдет для любой, даже самой сложной звуковой аппаратуры высокого класса. Хорошее качество и приемлемая цена делают кабель фирмы REXANT отличным решением как для специалистов, работающих со звуком, так и для начинающих.','','1000','','',''),(267,1,'Кабель ВБбШв 5x4,0','Изделие представляет собой не распространяющий горение силовой бронированный кабель, содержащий от одной до пяти медных жил в ПВХ-изоляции, с низким дымо- и газовыделением. Продукция производится в соответствии с требованиями ГОСТ 31996-2012, ГОСТ 31565-2012 и ТУ 3500-018-52114552-2011.','','100','','',''),(268,1,'Кабель АВВГ 1x50,0','Кабели предназначены для передачи и распределения электрической энергии в стационарных установках на номинальное переменное напряжение 0,66, 1, 3 и 6 кВ частоты 50Гц или на постоянное напряжение в 2,4 раза больше переменного напряжения.&lt;br&gt;Кабели предназначены для эксплуатации на суше на высотах до 4300 м над уровнем моря.&lt;br&gt;Кабель применяется для прокладки:&lt;br&gt;- в воздухе при условии защиты от УФ лучей и отсутствии опасности механических повреждений в ходе эксплуатации;&lt;br&gt;- для прокладки в сухих или сырых помещениях (туннелях), каналах, кабельных полуэтажах, шахт