,'Кабели предназначены для передачи и распределения электрической энергии в стационарных установках на номинальное переменное напряжение 0,66, 1, 3 и 6 кВ частоты 50Гц или на постоянное напряжение в 2,4 раза больше переменного напряжения.&lt;br&gt;Кабели предназначены для эксплуатации на суше на высотах до 4300 м над уровнем моря.&lt;br&gt;Кабель применяется для прокладки:&lt;br&gt;- в воздухе при условии защиты от УФ лучей и отсутствии опасности механических повреждений в ходе эксплуатации;&lt;br&gt;- для прокладки в сухих или сырых помещениях (туннелях), каналах, кабельных полуэтажах, шахтах, коллекторах, производственных помещениях, частично затапливаемых сооружениях при наличии среды со слабой, средней и высокой коррозионной активностью;&lt;br&gt;- для прокладки на специальных кабельных эстакадах, по мостам и в блоках;&lt;br&gt;- для прокладки во взрывоопасных зонах класса B-Iб, B-Iг, В-II, В-IIа.&lt;br&gt;Кабели предназначены для использования на вертикальных, наклонных и горизонтальных трассах.','','100','','',''),(277,1,'Кабель АВВГ 3x2,5 ГОСТ Альгиз (Б)','Расшифровка кабеля АВВГ:&lt;br&gt;А - алюминиевая токопроводящая жила&lt;br&gt;В - изоляция жил из поливинилхлоридного пластиката &lt;br&gt;В - оболочка из поливинилхлоридного пластиката&lt;br&gt;Г - гибкий &lt;br&gt;&lt;br&gt;Элементы конструкции кабеля АВВГ:&lt;br&gt;Токопроводящая жила – алюминиевая однопроволочная или многопроволочная, круглой или секторной формы, 1 или 2 класса по ГОСТ 22483.&lt;br&gt;Изоляция – из поливинилхлоридного пластиката. Изолированные жилы многожильных кабелей имеют отличительную расцветку. Изоляция нулевых жил (N) выполняется синего цвета. Изоляция жил заземления (PE) выполняется двухцветной (зелено-желтой расцветки).&lt;br&gt;Скрутка – изолированные жилы многожильных кабелей скручены в сердечник.&lt;br&gt;Электропроводящий экран (для кабелей на напряжение 6 кВ) - наложен обмоткой из ленты электропроводящей кабельной бумаги.&lt;br&gt;Металлический экран (для кабелей на напряжение 6 кВ) - из медных лент или медной фольги.&lt;br&gt;Оболочка – из поливинилхлоридного пластиката.&lt;br&gt;&lt;br&gt;Область применения кабеля АВВГ:&lt;br&gt;Кабели предназначены для передачи и распределения электрической энергии в стационарных установках на номинальное переменное напряжение 0,66, 1, 3 и 6 кВ частоты 50Гц или на постоянное напряжение в 2,4 раза больше переменного напряжения.&lt;br&gt;Кабели предназначены для эксплуатации на суше на высотах до 4300 м над уровнем моря.&lt;br&gt;Кабель применяется для прокладки:&lt;br&gt;- в воздухе при условии защиты от УФ лучей и отсутствии опасности механических повреждений в ходе эксплуатации;&lt;br&gt;- для прокладки в сухих или сырых помещениях (туннелях), каналах, кабельных полуэтажах, шахтах, коллекторах, производственных помещениях, частично затапливаемых сооружениях при наличии среды со слабой, средней и высокой коррозионной активностью;&lt;br&gt;- для прокладки на специальных кабельных эстакадах, по мостам и в блоках;&lt;br&gt;- для прокладки во взрывоопасных зонах класса B-Iб, B-Iг, В-II, В-IIа.&lt;br&gt;Кабели предназначены для использования на вертикальных, наклонных и горизонтальных трассах.&lt;br&gt;&lt;br&gt;Технические параметры кабеля АВВГ:&lt;br&gt;Вид климатического исполнения кабелей УХЛ и Т, категорий размещения 1 и 5 по ГОСТ 15150.&lt;br&gt;Диапазон температур эксплуатации от -50°С до 50°С.&lt;br&gt;Относительная влажность воздуха при температуре до 35°С до 98%.&lt;br&gt;Прокладка и монтаж кабелей без предварительного подогрева производится при температуре не ниже -15°С.&lt;br&gt;Допустимый радиус изгиба кабелей при прокладке:&lt;br&gt;- одножильные - не менее 10 наружных диаметров;&lt;br&gt;- многожильные - не менее 7,5 наружных диаметров.&lt;br&gt;Допустимые усилия при тяжении кабелей по трассе прокладки не должны превышать - 30 Н/мм².&lt;br&gt;Кабели не распространяют горение при одиночной прокладке (нормы МЭК 60332-1).&lt;br&gt;Класс пожарной опасности по ГОСТ 31565-2012: О1.8.2.5.4.&lt;br&gt;Длительно допустимая температура нагрева жил кабелей при эксплуатации - не более 70°С.&lt;br&gt;Максимально допустимая температура нагрева жил сечением до 240мм² при токах короткого замыкания - не более 160°С.&lt;br&gt;Максимально допустимая температура нагрева жил сечением от 300мм² при токах короткого замыкания - не более 140°С.&lt;br&gt;Продолжительность короткого замыкания не должна превышать - 5 с.&lt;br&gt;Допустимая температура нагрева жил кабелей в режиме перегрузки - не более 90°С.&lt;br&gt;Предельная температура нагрева жил по условиям невозгорания при коротком замыкании - не более 350°С.&lt;br&gt;Строительная длина кабелей устанавливается при заказе.&lt;br&gt;Срок службы - 30 лет с даты изготовления кабелей.&lt;br&gt;Гарантийный срок эксплуатации - 5 лет с даты ввода кабелей в эксплуатацию, но не позднее 6 месяцев с даты изготовления.&lt;br&gt;Срок хранения:&lt;br&gt;- на открытых площадках - не более 2 лет;&lt;br&gt;- под навесом - не более 5 лет;&lt;br&gt;- в закрытых помещениях - не более 10 лет.&lt;br&gt;Варианты исполнения вольтажа, кВ: 1;0,66&lt;br&gt;&lt;br&gt;Исполнение: изолированный;многожильный;многопроволочный&lt;br&gt;Источник: https://perm.cable.ru/cable/group-avvg.php#tab_description','','100','','',''),(278,1,'Кабель АВВГ 3x2,5 ГОСТ Брэкс','Кабели предназначены для передачи и распределения электрической энергии в стационарных установках на номинальное переменное напряжение 0,66, 1, 3 и 6 кВ частоты 50Гц или на постоянное напряжение в 2,4 раза больше переменного напряжения.&lt;br&gt;Кабели предназначены для эксплуатации на суше на высотах до 4300 м над уровнем моря.&lt;br&gt;Кабель применяется для прокладки:&lt;br&gt;- в воздухе при условии защиты от УФ лучей и отсутствии опасности механических повреждений в ходе эксплуатации;&lt;br&gt;- для прокладки в сухих или сырых помещениях (туннелях), каналах, кабельных полуэтажах, шахтах, коллекторах, производственных помещениях, частично затапливаемых сооружениях при наличии среды со слабой, 