ойств с номинальным переменным напряжением до 660 В частоты до 100 Гц или постоянным напряжением до 1000 В.&lt;br&gt;&lt;br&gt;Данный вид кабеля применяется для прокладки на открытом воздухе, в помещениях, каналах, туннелях, в условиях агрессивной среды, при отсутствии механических воздействий на кабели. Допускается прокладка таких кабелей в земле (траншеях) при обеспечении защиты кабелей в местах выхода на поверхность. Кабели не распространяют горение при одиночной прокладке (нормы ГОСТ 12176-89).','','200','','',''),(293,1,'Кабель КВ 2x2x0,75','','','200','','',''),(294,1,'Кабель КВВГ 10x1,5','Кабель КВВГ 10х1,5 разработан специально для неподвижного подключения к электрическому оборудованию. Возможна прокладка изделия на улице. При функционировании на открытом воздухе товар не нуждается в дополнительной защите. Выдерживает высокую влажность и влияние прямых солнечных лучей. Товар успешно эксплуатируется в земляных траншеях. В случае возникновения пожара не распространяет горение. Данную продукцию необходимо защищать от механических повреждений. Расшифровка названия осуществляется следующим образом:&lt;br&gt;&lt;br&gt;К — контрольный кабель;&lt;br&gt;В — изоляция сделана из пластиката, изготовленного из поливинилхлорида;&lt;br&gt;В — оболочка выполнена из качественного поливинилхлоридного пластиката;&lt;br&gt;Г — изделию характерно отсутствие защитных покровов.','','200','','',''),(295,1,'Кабель КВВГ 7x1,0','Для неподвижного присоединения к электрическим приборам, аппаратам, сборкам зажимов распределительных устойств с номинальным переменным напряжением до 0,66 кВ,частотой до 100 Гц или постоянным напряжением до 1 кВ','','200','','',''),(296,1,'Кабель КВВГ 7x1,5','Кабель КВВГ 7х1,5 можно прокладывать на открытом воздухе без дополнительной защиты (коробов, кабель-каналов), он стоек к различным агрессивным средам (повышенная влажность,ультрафиолет и т.д.) Однако желательно избегать механических повреждений.Возможна прокладка в земляных траншеях. При этом необходимо защитить кабель в местах выхода на поверхность. КВВГ 7х1,5 не горит при одинарной прокладке (есть сертификат пожарной безопасности). Если требуется уплотнение кабеля при вводе, то лучше использовать марку КВВГз.&lt;br&gt;&lt;br&gt;Срок службы кабеля КВВГ 7х1,5 от 15 до 25 лет в зависимости от способа монтажа (15 -при земляной прокладке, 25 - при монтаже в помещениях, туннелях, каналах)','','200','','',''),(297,1,'Кабель КВВГ э нг LS 5x1,5','КВВГ э нг LS 5х1,5&lt;br&gt;Предназначены для неподвижного присоединения к электрическим приборам, аппаратам, сборкам зажимов электрических распределительных устройств с номинальным переменным напряжением до 660 В частотой до 100 Гц или постоянным напряжением до 1000 В.&lt;br&gt;Применяются для прокладки на открытом воздухе, в помещениях, каналах, туннелях, в условиях агрессивной среды, при отсутствии механических воздействий на кабели и необходимости защиты электрических цепей от влияния внешних электрических полей. Не распространяют горение при прокладке в пучках (нормы МЭК 60332-3 категории А).&lt;br&gt;Стойки к монтажным изгибам.&lt;br&gt;&lt;br&gt;Срок службы кввгэнг(a)-ls 5х1,5 при открытой прокладке - 15 лет, при прокладке в помещениях, каналах и туннелях - 25 лет.&lt;br&gt;&lt;br&gt;Технические характеристики кввгэнг(a)-ls 5х1,5:&lt;br&gt;- Виды климатического исполнения кабелей: УХЛ, Т категория размещения 1 и 5 по ГОСТ 15150-69&lt;br&gt;- Диапазон температур эксплуатации : от - 50°С до + 50°С&lt;br&gt;- Относительная влажность воздуха при температуре +35°С:….98%&lt;br&gt;- Прокладка кабелей осуществляется при температуре окружающей среды не ниже……- 15 °С&lt;br&gt;- Кабели не распространяют горение при прокладке в пучках&lt;br&gt;- Радиус изгиба при прокладке при температуре окружающей среды не ниже 0°С составляет:&lt;br&gt;для кабелей наружным диаметром до 10 мм включ…… не менее 3-х диаметров кабеля&lt;br&gt;для кабелей наружным диаметром 10 - 25 мм включ…… не менее 4-х диаметров кабеля&lt;br&gt;- Длительно допустимая температура нагрева жил при эксплуатации: +70°С&lt;br&gt;- Дымооборазование при горении и тлении кабелей не приводит к снижению светопроницаемости в испытательной камере более чем на 40%&lt;br&gt;- Номинальная толщина изоляции для жил сечением:&lt;br&gt;0.75, 2.5 мм2 - 0.6 мм&lt;br&gt;4, 6 мм2 - 0.7 мм&lt;br&gt;- строительная длина кабелей: не менее 150 м&lt;br&gt;- гарантийный срок эксплуатации кввгэнг(a)-ls 5х1,5: 3 года со дня ввода кабелей в эксплуатацию, но не позднее 6 месяцев с даты изготовления.&lt;br&gt;','','200','','',''),(298,1,'Кабель КВВГ нг 4x1,5','Кабели предназначены для неподвижного присоединения к электрическим приборам, аппаратам, сборкам зажимов электрических распределительных устройств с номинальным переменным напряжением до 660 В частоты до 100 Гц или постоянным напряжением до 1000 В.&lt;br&gt;Кабели применяются для прокладки на открытом воздухе, в кабельных сооружениях и помещениях, в условиях агрессивной среды, при отсутствии механических воздействий на кабели, в том числе для использования в системах атомных электростанций классов 2, 3 и 4 по классификации ОПББ-88/97 (ПНАЭ Г-01-011-97). Кабели преимущественно применяются для обеспечения пожарной безопасности кабельных цепей при прокладке в пучках. Кабели не распространяют горение при прокладке в пучках (нормы ГОСТ Р МЭК 332-3-96 категории А). Снижение светопроницаемости от дымообразования при горении и тлении кабелей не более 40%.','','200','','',''),(451,1,'Кабель КГ 3x4,0 ГОСТ РКЗ','Кабели марки КГ на 660 В предназначены для присоединения передвижных механизмов к электрическим сетям при переменном напряжении 660 В частотой до 400 Гц или постоянном напряжении 1000 В, при изгибах с радиусом не менее 8 диаметров кабеля при допустимой температуре нагрева токопроводящих жил до 75 С. Для кабелей в тропическом исполнении к марке кабеля добавляют через дефис букву Т. Для кабелей в холодостойком исполнении к марке кабеля добавляют через дефис буквы ХЛ. Кабели марки КГ на 380 В предназначены для при