ката.&lt;br&gt;В - Оболочка из негорючего ПВХ пластиката.&lt;br&gt;Г - Не имеет брони.&lt;br&gt;П - Плоская конструкция.&lt;br&gt;нг - ПВХ пластикат пониженной пожарной опасности.&lt;br&gt;(А) - Индекс пожарной безопасности, означает что кабель не распространяет горение при прокладке в пучках.&lt;br&gt;2 - Количество токопроводящих жил.&lt;br&gt;4 - Сечение жил в квадратных миллиметрах.&lt;br&gt;&lt;br&gt;Технические характеристики кабеля ВВГ-Пнг(А) 2х4&lt;br&gt;Климатическое исполнение - УXЛ, категории размещения 1 - 5 по ГОСТ 15150-69.&lt;br&gt;Температуры эксплуатации от -50 до +50 градусов по Цельсию.&lt;br&gt;Монтаж кабеля ВВГ-Пнг(А) 2х4 производится при температуре не ниже -15 градусов.&lt;br&gt;Минимальный радиус изгиба при прокладке - 87.3 миллиметров.&lt;br&gt;Кабель ВВГ-Пнг(А) 2х4 не распространяет горение при групповой прокладке по категории (А).&lt;br&gt;Допустимая температура нагрева жил при эксплуатации - 70 градусов Цельсия.&lt;br&gt;Допустимая температура нагрева жил при токах короткого замыкания не более 160 °С.&lt;br&gt;Продолжительность короткого замыкания не должна превышать 5 секунд.&lt;br&gt;Предельная температура жил кабеля ВВГ-Пнг(А) 2х2,5 по условию невозгорания при коротком замыкании - 400°С.&lt;br&gt;Код ОКП - 35 3371.&lt;br&gt;Расчетная масса кабеля ВВГ-Пнг 2х4 - 0.15 килограмм в метре.&lt;br&gt;Наружный диаметр - 9.7 миллиметров.&lt;br&gt;Срок службы кабеля ВВГ-Пнг(А) 2*4 - не менее 30 лет с даты изготовления.&lt;br&gt;Растягивающее усилие при монтаже не должно превышать 250 Ньютонов.&lt;br&gt;&lt;br&gt;Токовые нагрузки кабеля ВВГ-Пнг 2х4&lt;br&gt;Допустимый ток при прокладке ВВГ-Пнг 2х4 на воздухе: 27 Ампер.&lt;br&gt;Допустимый ток при прокладке в земле: 36 Ампер.&lt;br&gt;Допустимый ток односекундного короткого замыкания: 270 Ампер.&lt;br&gt;Активное сопротивление жилы: 7.55 Ом на километр.','','400','','',''),(446,1,'ВВГ-Пнг(А)-LS 3x1,5 ГОСТ ПАРТНЕР','ВВГ-Пнг(А)-LS  3х1,5 сокращенная маркировка плоского силового кабеля с тремя медными