по ГОСТ 22483.&lt;br&gt;Изоляция – из специальной композиции ПВХ пластикатов пониженной пожарной опасности, с низким дымо- и газовыделением, низкой токсичностью продуктов горения. Изолированные жилы имеют отличительную расцветку.&lt;br&gt;Оболочка – из специальной композиции ПВХ пластикатов пониженной пожарной опасности, с низким дымо- и газовыделением, низкой токсичностью продуктов горения.&lt;br&gt;Кабель имеет плоское исполнение.&lt;br&gt;&lt;br&gt;Область применения кабеля ВВГ-Пнг(A)-LS:&lt;br&gt;Кабели предназначены для передачи и распределения электроэнергии и электрических сигналов в стационарных установках, при номинальном переменном напряжении до 1 кВ включительно номинальной частотой 50 Гц или при постоянном напряжении до 1,5 кВ. &lt;br&gt;Для эксплуатации в зданиях классов функциональной пожарной опасности Ф1-Ф3, в том числе зданиях детских дошкольных образовательных учреждений, специализированных домов престарелых и инвалидов, больниц, спальных корпусах образовательных учреждений интернатного типа и детских учреждений, гостиниц, общежитий, спальных корпусов санаториев и домов отдыха общего типа, кемпингов, мотелей, пансионатов, а также для зрелищных, клубных, спортивных сооружений, зданий организаций по обслуживанию населения, метрополитенов, а также для объектов использования атомной энергии вне гермозоны АС.&lt;br&gt;&lt;br&gt;Технические параметры кабеля ВВГ-Пнг(A)-LS:&lt;br&gt;Класс пожарной опасности по ГОСТ 31565-2012: П1б.8.2.1.2&lt;br&gt;Вид климатического исполнения УХЛ, категорий размещения 3 и 4 по ГОСТ 15150. &lt;br&gt;Диапазон температур эксплуатации от -50 °С до 50 °С. &lt;br&gt;Относительная влажность воздуха при температуре до 35 °С до 98 %. &lt;br&gt;Прокладка без предварительного подогрева производится при температуре воздуха не ниже -15 °С. &lt;br&gt;Допустимый радиус изгиба кабелей при прокладке - не менее 7,5 максимальных наружных диаметров. &lt;br&gt;Эквивалентный показатель токсичности продуктов горения более 120 г/м3. &lt;br&gt;Кабели не распространяют горение при групповой прокладке по категории А. &lt;br&gt;Дымообразование при горении и тлении кабелей не приводит к снижению светопроницаемости в испытательной камере более чем на 50 %. &lt;br&gt;Огнестойкость - не менее 180 мин. &lt;br&gt;Массовая доля хлористого водорода, выделяющегося при горении полимерных материалов:&lt;br&gt;- изоляции - не более 100 мг/г; &lt;br&gt;- оболочки - не более 80 мг/г.&lt;br&gt;Длительно допустимая температура нагрева жил кабелей при эксплуатации не более 70 °С. &lt;br&gt;Длительно допустимая температура нагрева жил кабелей в режиме перегрузки не более 90 °С. &lt;br&gt;Максимально допустимая температура нагрева жил кабелей при коротком замыкании (второе значение для кабелей с токопроводящими жилами сечением более 300 мм²) - не более 160/140 °С. Продолжительность короткого замыкания не должна превышать 5 с. &lt;br&gt;Предельная температура нагрева жил по условиям невозгорания при коротком замыкании - не более 350 °С.&lt;br&gt; &lt;br&gt;Срок службы 30 лет с даты изготовления кабелей. &lt;br&gt;Гарантийный срок эксплуатации 5 лет с даты ввода кабелей в эксплуатацию, но не позднее 6 месяцев с даты изготовления. &lt;br&gt;Срок хранения: &lt;br&gt;- на открытых площадках - не более 2 лет; &lt;br&gt;- под навесом - не более 5 лет; &lt;br&gt;- в закрытых помещениях - не более 10 лет.&lt;br&gt;Нормативный документ: ТУ 16-705.496-2011, ТУ 16.К73.108-2013&lt;br&gt;&lt;br&gt;Сечение, мм2: 10;4;1,5;6;2,5;16&lt;br&gt;&lt;br&gt;Оболочка: ПВХ&lt;br&gt;&lt;br&gt;Исполнение: негорючий;многожильный;изолированный;плоский.','','1000','','',''),(423,1,'Кабель ВВГ-Пнг(А)-LS 2x4,0 ГОСТ КАБЭКС','ВВГнг-LS - силовой кабель, предназначенный для передачи электроэнергии в установках неподвижного типа. Рассчитан на напряжение до 6 кВ и частоту 50 Гц. Подходит для пожароопасных зон. Имеет медные токопроводящие жилы и поливинилхлоридную изоляцию. Прокладывается в сетях с изолированной или заземлённой нейтралью. Устанавливается на вертикальн