,5 , NYY-O 4х1.5 , CYKY 4х1,5 , NYM 4*1.5.','','1000','','',''),(380,1,'Кабель ВВГ-нг(А)-LS 4x1,5 ок(N,PE) ГОСТ КАБЭКС','','','1000','','',''),(381,1,'Кабель ВВГ-нг(А)-LS 4x2,5 ГОСТ Элкаб','','','1000','','',''),(382,1,'Кабель ВВГ-нг(А)-LS 4x2,5 ГОСТ ПФ ТатТехКабель','','','1000','','',''),(383,1,'Кабель ВВГ-нг(А)-LS 4x2,5  ГОСТ Промэл','Кабели ВВГнг-LS - силовые с медными круглыми жилами, с изоляцией и оболочкой из ПВХ пластиката пониженной пожароопасности и пониженным дымо- и газовыделением (Low Smoke).&lt;br&gt;&lt;br&gt;Расшифровка кабеля ВВГнг-LS 4х2.5:&lt;br&gt;В - Изоляция жил из поливинилхлоридного пластиката &lt;br&gt;В - Оболочка из поливинилхлоридного пластиката &lt;br&gt;Г - Отсутствие защитных покровов&lt;br&gt;нг-LS - Изоляция жил и оболочка из поливинилхлоридного пластиката пониженной горючести с пониженным газо- дымовыделением&lt;br&gt;4 - количество жил&lt;br&gt;2.5 - сечение жилы','','1000','','',''),(384,1,'Кабель ВВГ-нг(А)-LS 4x2,5 ГОСТ Промстройкабель','Силовой кабель ВВГнг-LS 4х2,5 применяется в районах умеренного, холодного климата, при электромонтажных работах. Кабель прокладывается внутри и снаружи зданий (торгово-развлекательные гиперцентры, бизнес-центры, общественно-административные здания, эстакады мосты), благодаря высокой степени пожаро-взрыво-безопасности и негорючести возможна прокладка в пучках, потому что в случае возгорания, горение не переходит на соседние кабели,   не рекомендуется прокладывать в земле. Кабель предназначен для передачи электрических сигналов при номинальном переменном и постоянном напряжении до 1000 В, номинальной частоте до 100 Гц. Температурный режим эксплуатации -50 до +50 °C и относительная влажность воздуха 98%. Срок годности провода около 30 лет.','','1000','','',''),(385,1,'Кабель ВВГ-нг(А)-LS 4x2,5 ГОСТ TPlast Евро Профиль','','','1000','','',''),(386,1,'Кабель ВВГ-нг(А)-LS 4x2,5 ок(N-0.66 (ГОСТ)','','','1000','','',''),(387,1,'Кабель ВВГ-нг(А)-LS 4x2,5 ок(N,PE) ГОСТ КАБЭКС','','','1000','','',''),(388,1,'Кабель ВВГ-нг(А)-LS 4x4,0 ГОСТ Альфакабель','Кабели силовые, изоляция и оболочка из поливинилхлоридного пластиката, не распространяющие горение, с низким дымо- и газовыделением, на напряжение 0,66 и 1 кВ сечениями до 240 кв.мм включительно. Кабели предназначены для прокладки в сухих и влажных помещениях, на специальных кабельных эстакадах, в блоках, а также для прокладки на открытом воздухе. Не рекомендуется для прокладки в земле.','','300','','',''),(389,1,'Кабель ВВГ-нг(А)-LS 4x4,0 ГОСТ ЭлПром','','','300','','',''),(390,1,'Кабель ВВГ-нг(А)-LS 4x4,0 ГОСТ ПФ ТатТехКабель','','','300','','',''),(391,1,'Кабель ВВГ-нг(А)-LS 4x4,0 ок(N,PE) ГОСТ КАБЭКС','','','300','','',''),(392,1,'Кабель ВВГ-нг(А)-LS 4x6,0 ГОСТ ЭлПром','','','300','','',''),(393,1,'Кабель ВВГ-нг(А)-LS 4x6,0 ГОСТ ПФ ТатТехКабель','','','300','','',''),(394,1,'Кабель ВВГ-нг(А)-LS 4x6,0 ок(N,PE) ГОСТ КАБЭКС','','','300','','',''),(395,1,'Кабель ВВГ-нг(А)-LS 5x1,5 ГОСТ ЭлПром','','','1000','','',''),(396,1,'Кабель ВВГ-нг(А)-LS 5x1,5 ок(N,PE) ГОСТ КАБЭКС','','','1000','','',''),(452,1,'Кабель КГ ХЛ 1x10 ГОСТ РКЗ','Расшифровка кабеля КГ-ХЛ 1х10-0,66:&lt;br&gt;К - Кабель&lt;br&gt;Г - Гибкий&lt;br&gt;ХЛ - Климатическое исполнение (хладостойкий)&lt;br&gt;1 - количество жил&lt;br&gt;10 - сечение жил&lt;br&gt;0,66 - номинальное напряжение, кВ&lt;br&gt;&lt;br&gt;Элементы конструкции кабеля КГ-ХЛ 1х10-0,66:&lt;br&gt;1. Токопроводящая жила- скрученная из медных проволок (класс 5).&lt;br&gt;2. Обмотка - из полиэтилентерефталатной пленки марки ПЭТ-Э.&lt;br&gt;3. Изоляция - из резины типа РТИ-1-ХЛ на основе натурального и бутадиенового каучуков. &lt;br&gt;4. Слой из полиэтилентерефталатной пленки марки ПЭТ-Э (поверх скрученных изолированных жил).&lt;br&gt;5. Оболочка из резины типа РШТМ-2-ХЛ на основе изопренового и бутадиенового каучуков; изоляционно-защитная оболочка одножильных кабелей из резины типа РТИШ-ХЛ на основе изопренового и бутадиенового каучуков.&lt;br&gt;&lt;br&gt;Область применения кабеля КГ-ХЛ 1х10-0,66:&lt;br&gt;Силовые гибкие кабели предназначены для присоединения передвижных механизмов к электрическим сетям на номинальное переменное напряжение 660 В частоты до 400 Гц или постоянное напряжение 1000 В.&lt;br&gt;Предназначены для эксплуатации на суше, реках и озёрах в макроклиматических районах с умеренным, холодным, на открытом воздухе и в помещениях.&lt;br&gt;Вид климатического исполнения кабелей У, ХЛ категорий размещения 1, 2, 3 по ГОСТ 15150.&lt;br&gt;Класс пожарной опасности по ГОСТ 31565-2012: 02.8.2.5.4&lt;br&gt;&lt;br&gt;Технические характеристики кабеля КГ-ХЛ 1х10-0,66:&lt;br&gt;&lt;br&gt;Диапазон температур эксплуатации - от - 60°С до 50°С.&lt;br&gt;Кабели должны быть стойкими к воздействию относительной влажности воздуха до 98 % при температуре окружающей среды 35°С.&lt;br&gt;Прокладка и монтаж кабеля без предварительного подогрева производится при температуре - не ниже – 40°С.&lt;br&gt;Радиус изгиба кабелей при монтаже и эксплуатации - не менее 8 наружных диаметров.&lt;br&gt;Кабели устойчивы к воздействию солнечного излучения.&lt;br&gt;Многократные перегибы кабеля через систему роликов:&lt;br&gt;1. Диаметр роликов 120 мм:&lt;br&gt;- растягивающая нагрузка - 15 Н&lt;br&gt;- сечение основных жил - 2,5 мм.кв.&lt;br&gt;- число циклов перегибов - 30 000&lt;br&gt;2. Диаметр роликов 200 мм:&lt;br&gt;- растягивающая нагрузка - 20 Н&lt;br&gt;- сечение основных жил - 4,0 мм.кв.&lt;br&gt;- число циклов перегибов - 30 000&lt;br&gt;Многократные изгибы кабеля на угол ±П/2 рад при растягивающем усилии 49 Н: &lt;br&gt;1. Диаметр роликов 200 мм:&lt;br&gt;- сечение основных жил - от 6,0 до 16 кв.мм&lt;br&gt;- число циклов перегибов - 90 000&lt;br&gt;2. Диаметр роликов 200 мм:&lt;br&gt;- сечение основных жил - от 25 до 50 кв.мм&lt;br&gt;- число циклов перегибов - 60 000&lt;br&gt;3. Диаметр роликов 400 мм:&lt;br&gt;- сечение основных жил - от 70 до 120 кв.мм&lt;br&gt;- число циклов перегибов - 40 000&lt;br&gt;Для одножильных кабелей диаметр ролика должен быть не более 200 мм.&lt;br&gt;Строительная длина кабелей:&lt;br&gt;- с номинальным сечением основных жил до 35 мм² включительно - не менее 150 м;&lt;br&gt;- с номинальным сечением основных жил 50 до 120 мм² - не менее 125 м;&lt;br&gt;- с номинальным сечением основных жил 150 мм² и выше - не менее 100 м. &lt;br&gt;Гарантийный срок эксплуатации - 6 месяцев со дня ввода в эксплуатацию, но не позднее 12 месяцев со дня изготовления.&lt;br&gt;Срок службы - 4 года.&lt;br&gt;Источник: https://cable.ru/cable/marka-kg_hl_1x10_0_66.php','','200','','',''),(453,1,'Кабель КГ ХЛ 1x16,0 ГОСТ Кольчугино','Расшифровка кабеля КГ-ХЛ 1х16-0,66:&lt;br&gt;К - Кабель&lt;br&gt;Г - Гибкий&lt;br&gt;ХЛ - Климатическое исполнение (хладостойкий)&lt;br&gt;1 - количество жил&lt;br&gt;16 - сечение жил&lt;br&gt;0,66 - номинальное напряжение, кВ&lt;br&gt;&lt;br&gt;Элементы конструкции кабеля КГ-ХЛ 1х16-0,66:&lt;br&gt;1. Токопроводящая жила- скрученная из медных проволок (класс 5).&lt;br&gt;2. Обмотка - из полиэтилентерефталатной пленки марки ПЭТ-Э.&lt;br&gt;3. Изоляция - из резины типа РТИ-1-ХЛ на основе натурального и бутадиенового каучуков. Маркировка изолированных жил:&lt;br&gt;• цифровая: 1, 2, 3, 4, 5, жила заземления - 0,&lt;br&gt;• цветовая: голубой, черный, коричневый, жила заземления - зелёно-жёлтая.&lt;br&gt;4. Слой из полиэтилентерефталатной пленки марки ПЭТ-Э (поверх скрученных изолированных жил).&lt;br&gt;5. Оболочка из резины типа РШТМ-2-ХЛ на основе изопренового и бутадиенового каучуков; изоляционно-защитная оболочка одножильных кабелей из резины типа РТИШ-ХЛ на основе изопренового и бутадиенового каучуков.&lt;br&gt;&lt;br&gt;Область применения кабеля КГ-ХЛ 1х16-0,66:&lt;br&gt;Силовые гибкие кабели предназначены для присоединения передвижных механизмов к электрическим сетям на номинальное переменное напряжение 660 В частоты до 400 Гц или постоянное напряжение 1000 В.&lt;br&gt;Предназначены для эксплуатации на суше, реках и озёрах в макроклиматических районах с умеренным, холодным, на открытом воз