я кабеля).&lt;br&gt;Гарантийный срок эксплуатации – 6 месяцев со дня ввода в эксплуатацию, но не позднее 12 месяцев со дня изготовления.&lt;br&gt;Характеристики кабеля КГтп-ХЛ 5х4&lt;br&gt;Оболочка: термоэластопластовая&lt;br&gt;Нормативный документ: ТУ 3544-016-22901100-2015&lt;br&gt;Исполнение: многопроволочный; морозостойкий; многожильный; гибкий; изолированный&lt;br&gt;','','200','','',''),(479,1,'Кабель КГ тп 2x0,75 ГОСТ Электрокабель','Расшифровка кабеля КГ 2х0,75-0,66:&lt;br&gt;К - Кабель&lt;br&gt;Г - Гибкий&lt;br&gt;2 - количество жил&lt;br&gt;0,75 - сечение жил&lt;br&gt;0,66 - номинальное напряжение, кВ&lt;br&gt;&lt;br&gt;Элементы конструкции кабеля КГ 2х0,75-0,66:&lt;br&gt;1. Токопроводящая жила скрученная из медных проволок (класс 5);&lt;br&gt;2. Слой из полиэтилентерефталатной пленки марки ПЭТ-Э;&lt;br&gt;3. Изоляция из резины типа РТИ-1 или РТИ-1-ХЛ на основе натурального и бутадиенового каучуков. Маркировка изолированных жил: цифровая: 1, 2, 3, 4, 5, жила заземления - 0; цветовая: голубой, черный, коричневый, жила заземления - зелёно-жёлтая.&lt;br&gt;4. Слой из полиэтилентерефталатной пленки марки ПЭТ-Э (поверх скрученных изолированных жил);&lt;br&gt;5. Оболочка из резины типа РШТ-2 на основе изопренового и бутадиенового каучуков; изоляционно-защитная оболочка одножильных кабелей из резины типа РТИШМ на основе изопренового и бутадиенового каучуков.&lt;br&gt;&lt;br&gt;Область применения кабеля КГ 2х0,75-0,66:&lt;br&gt;Кабели предназначены для присоединения передвижных механизмов к электрическим сетям на номинальное переменное напряжение 380 В частоты до 400 Гц или постоянное номинальное напряжение 660 В.&lt;br&gt;Кабели на 660 В предназначены для присоединения передвижных механизмов к электрическим сетям при переменном напряжении 660 В частотой до 400 Гц или постоянном напряжении 1000 В, при изгибах с радиусом не менее 8 диаметров кабеля при допустимой температуре нагрева токопроводящих жил до 75°С. Кабели КГ могут использоваться в сварочных аппаратах, а также для осуществления различных видов сварочных работ. &lt;br&gt;Кабели не предназначены для применения на подъемно-транспортном оборудовании.&lt;br&gt;&lt;br&gt;Технические характеристики кабеля КГ 2х0,75-0,66:&lt;br&gt;Вид климатического исполнения кабелей У категорий размещения 1, 2, 3 по ГОСТ 15150.&lt;br&gt;Диапазон температур эксплуатации от - 40°С до 50°С.&lt;br&gt;Кабели должны быть стойкими к воздействию относительной влажности воздуха до 98 % при температуре окружающей среды 35°С.&lt;br&gt;Кабели устойчивы к воздействию солнечного излучения.&lt;br&gt;Длительно допустимая температура токопроводящих жил кабелей - не более 75°С.&lt;br&gt;Многократные перегибы через систему роликов:&lt;br&gt;1. При диаметре роликов 120 мм и сечении основных жил 2,5 мм²:&lt;br&gt;- растягивающая нагрузка - 15 Н&lt;br&gt;- число циклов перегибов - 30 000&lt;br&gt;2. При диаметре роликов 200 мм и сечении основных жил 4 мм²:&lt;br&gt;- растягивающая нагрузка - 20 Н&lt;br&gt;- число циклов перегибов - 30 000&lt;br&gt;Многократные изгибы на угол ±П/2 рад при растягивающем усилии 49 Н:&lt;br&gt;1. При диаметре роликов 200 мм и сечении основных жил от 6,0 до 16 мм²:&lt;br&gt;- число циклов перегибов - 90 000&lt;br&gt;2. При диаметре роликов 200 мм и сечении основных жил от 25 до 50 мм²:&lt;br&gt;- число циклов перегибов - 60 000&lt;br&gt;3. При диаметре роликов 400 мм (кроме одножильных кабелей) и сечении основных жил от 70 до 120 мм²:&lt;br&gt;- число циклов перегибов - 40 000&lt;br&gt;Строительная длина кабелей:&lt;br&gt;- с номинальным сечением основных жил до 35 мм² включительно - не менее 150 м;&lt;br&gt;- с номинальным сечением основных жил 50 до 120 мм² - не менее 125 м;&lt;br&gt;- с номинальным сечением основных жил 150 мм² и выше - не менее 100 м;&lt;br&gt;- по согласованию с потребителем допускается сдача кабелей любыми длинами.&lt;br&gt;Гарантийный срок эксплуатации кабелей на 660 В - 6 месяцев со дня ввода в эксплуатацию, но не позднее 12 месяцев со дня изготовления.&lt;br&gt;Срок службы – не менее 4 лет (срок службы исчисляется с момента изготовления кабеля).','','200','','',''),(480,1,'Кабель КГ тп 2x1,0 ГОСТ Электрокабель','Кабели марки КГ на 660 В предназначены для присоединения передвижных механизмов к электрическим сетям при переменном напряжении 660 В частотой до 400 Гц или постоянном напряжении 1000 В, при изгибах с радиусом не менее 8 диаметров кабеля при допустимой температуре нагрева токопроводящих жил до 75 С. Для кабелей в тропическом исполнении к марке кабеля добавляют через дефис букву Т. Для кабелей в холодостойком исполнении к марке кабеля добавляют через дефис буквы ХЛ. Кабели марки КГ на 380 В предназначены для присоединения переносных и передвижных электроприемников к электрическим сетям на номинальное переменное напряжение 380 В номинальной частотой до 400 Гц или постоянное напряжение 660 В. Кабели не предназначены для применения на подъемно-транспортном оборудовании.','','200','','',''),(481,1,'КГ 1x10 ГОСТ Экокабель','Кабели марки КГ на 660 В предназначены для присоединения передвижных механизмов к электрическим сетям при переменном напряжении 660 В частотой до 400 Гц или постоянном напряжении 1000 В, при изгибах с радиусом не менее 8 диаметров кабеля при допустимой температуре нагрева токопроводящих жил до 75 С. Для кабелей в тропическом исполнении к марке кабеля добавляют через дефис букву Т. Для кабелей в холодостойком исполнении к марке кабеля добавляют через дефис буквы ХЛ. Кабели марки КГ на 380 В предназначены для присоединения переносных и передвижных электроприемников к электрическим сетям на номинальное переменное напряжение 380 В номинальной частотой до 400 Гц или постоянное напряжение 660 В. Кабели не предназначены для применения на подъемно-транспортном оборудовании.','','200','','',''),(482,1,'КГ 2x0,75 ГОСТ Экокабель','Кабели марки КГ на 660 В предназначены для присоединения передвижных механизмов к электрическим сетям при переменном напряжении 660 В частотой до 400 Гц или постоянном напряжен