ачены для присоединения передвижных механизмов к электрическим сетям при переменном напряжении 660 В частотой до 400 Гц или постоянном напряжении 1000 В, при изгибах с радиусом не менее 8 диаметров кабеля при допустимой температуре нагрева токопроводящих жил до 75 С. Для кабелей в тропическом исполнении к марке кабеля добавляют через дефис букву Т. Для кабелей в холодостойком исполнении к марке кабеля добавляют через дефис буквы ХЛ. Кабели марки КГ на 380 В предназначены для присоединения переносных и передвижных электроприемников к электрическим сетям на номинальное переменное напряжение 380 В номинальной частотой до 400 Гц или постоянное напряжение 660 В. Кабели не предназначены для применения на подъемно-транспортном оборудовании.','','200','','',''),(488,1,'Кабель RG-6U 75 Ом (CCS/48ALI) TDM','Кабель RG-6U (75 Ом), CCS/Al/Al, 48 %  коаксиальный радиочастотный со вспененной полиэтиленовой изоляцией и в ПВХ оболочке. Является самым распространенным решением для подключения внутренних и межблочных соединений общепромышленных и бытовых радиотехнических устройств, для подключения систем телевидения, а также для подключения видеокамер наружного и внутреннего наблюдения.','','1000','','',''),(489,1,'Кабель РК75-1,5-311 75 Ом чёрный','Кабель РК 75-1,5-311, 75 Ом, 500 м. , черный считается самым распространенным решением для подключения телевизионных систем. &lt;br&gt;Обеспечивая передачу аналоговых сигналов, этот кабель применяется для прокладки снаружи помещений в составе распределительных ТВ-сетей. Кабель РК 75-1,5-311, 75 Ом, 500 м. , черный по структуре представляет собой два проводника – внутренний и внешний, расположенных соосно и разделенных изолирующим диэлектриком. &lt;br&gt;Центральный проводник – однопроводная омедненная жила- окружен изоляцией из вспененного полиэтилена. &lt;br&gt;Экран, наложенный на сердечник, имеет дополнительную алюминиевую оплетку для обеспечения его электрической непрерывности. &lt;br&gt;Сплошная внешняя оболочка изготовлена из полиэтилена и имеет черный цвет. &lt;br&gt;Полиэтилен отлично защищает от влаги и ультрафиолета, что позволяет использовать кабель вне помещений на открытом воздухе. &lt;br&gt;Номинальное волновое сопротивление данного кабеля составляет 75 Ом.&lt;br&gt;&lt;br&gt;Этот кабель имеет хорошее отношение механической прочности и себестоимости, поэтому он применяется там, где мощности небольшие, а метраж велик. &lt;br&gt;Применим для сигналов с диапазоном частот 5 - 1000МГц.&lt;br&gt;Диаметр кабеля d=6,8 мм.','','1000','','',''),(490,1,'Кабель SAT50 75 Ом (Cu/Al/Al) Proconnect','Техническое описание кабеля SAT 703 B 75 Ом PROconnect.&lt;br&gt;Кабель коаксиальный радиочастотный со вспененной полиэтиленовой изоляцией в ПВХ оболочке.&lt;br&gt;Кабель SAT 703 B 75 Ом PROconnect применяется для подключения спутниковых телевизионных систем, а также для подключения видеокамер наружного и внутреннего наблюдения. &lt;br&gt;&lt;br&gt;Конструкция:&lt;br&gt;Внутренний проводник: медная проволока &lt;br&gt;Диаметр внутреннего проводника: 0,90 мм&lt;br&gt;Диаметр по внутреннему диэлектрику: 4,8+/-0,2 мм&lt;br&gt;Диэлектрик:, вспененный полиэтилен &lt;br&gt;Экран из фольги наложен поверх диэлектрика&lt;br&gt;Внешний проводник из алюминиевой проволоки в виде оплётки&lt;br&gt;Диаметр проволоки в оплетке: 0,12-0,15 мм&lt;br&gt;Плотность оплетки: 75 %&lt;br&gt;Наружный диаметр: 6,8+/-0,2 мм&lt;br&gt;Материал оболочки: ПВХ&lt;br&gt;Цвет оболочки: белый','','400','','',''),(491,1,'Кабель SAT50 75 Ом (Cu/Al/Cu) Rexant','','','200','','',''),(492,1,'Кабель SAT50 медный TV 100м (HiFlex)','Кабель коаксиальный SAT 50 с внутренней медной однопроволочной жилой, с изоляцией из вспененного полиэтилена, с экраном из ламинированной фольги и оплетки из медной луженой проволоки более 40%. Кабель предназначен для монтажа внутри зданий в кабельных сетях, предназначенных для передачи данных и связи в соответствии с PN-EN 50173. Типовое применение: RTV, SAT, CATV.','','350','','',''),(493,1,'Кабель TV RG-6U','Кабель RG-6U (75 Ом), CCS/Al/Al, 48 % (бухта 100 м) белый PROconnect коаксиальный радиочастотный со вспененной полиэтиленовой изоляцией и в ПВХ оболочке. Является самым распространенным решением для подключения внутренних и межблочных соединений общепромышленных и бытовых радиотехнических устройств, для подключения систем телевидения, а также для подключения видеокамер наружного и внутреннего наблюдения. &lt;br&gt;Техническое описание:&lt;br&gt;Внутренний проводник: стальная проволока, плакированная медью &lt;br&gt;Диаметр внутреннего проводника: 0,9 мм&lt;br&gt;Диаметр по внутреннему диэлектрику: 4,8+/-0,2 мм&lt;br&gt;Диэлектрик: вспененный полиэтилен &lt;br&gt;Экран в виде сплошной алюминиевой фольги&lt;br&gt;Внешний проводник: из алюминиевой проволоки в виде оплётки&lt;br&gt;Диаметр проволоки экрана: 0,12-0,15 мм&lt;br&gt;Плотность оплетки: 48 %&lt;br&gt;Наружный диаметр: 6,8+/-0,2 мм&lt;br&gt;Материал оболочки: ПВХ&lt;br&gt;Длина: 100 метров&lt;br&gt;Технические характеристики:&lt;br&gt;Волновое сопротивление: 75+/-3,0 Ом&lt;br&gt;Сопротивление связи: 200 мОм/м&lt;br&gt;Рабочая температура: –40...+60 °С&lt;br&gt;Минимальная температура монтажа: –5 °С&lt;br&gt;Срок службы: 15 лет','','200','','',''),(494,1,'Кабель ВВГнг FRLS 3х4,0','&lt;p&gt;Расшифровка маркировки ВВГнг(А)-FRLS&lt;/p&gt;&lt;p&gt;В - Изоляция из ПВХ композиции.&lt;/p&gt;&lt;p&gt;В - Оболочка из ПВХ композиции.&lt;/p&gt;&lt;p&gt;Г - Не имеет брони.&lt;/p&gt;&lt;p&gt;нг - Пониженная пожарная опасность кабеля.&lt;/p&gt;&lt;p&gt;(А) - Индекс пожаробезопасности, означает что кабель не распространяет горение при групповой прокладке (прокладке в пучках).&lt;/p&gt;&lt;p&gt;FR - Стоек к воздействию открытого огня.&lt;/p&gt;&lt;p&gt;LS - Пониженное выделение дыма.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Кабель силовой медный огнестойкий с пониженным выделением дыма предназначен для стационарной установки в электрических сетях с переменным напряжением до тысячи Вольт, частотой 50 Герц, с токовой нагрузкой до 27 Ампер.&lt;/p&gt;&lt;p&gt;Кабель ВВГнг-FRLS применяют для питания оборудования систем безопасности АС, пожарной сигнализации (цепи пожарной сигнализации, питания насосов пожаротушения, освещения запасных выходов и путей эвакуации, систем дымоудаления и приточной вентиляции, эвакуационных лифтов), также во взрывоопасных зонах всех классов, кроме взрывоопасных зон класса В1, цепей аварийного электроснабжения и питания оборудования (токоприемников), функционирующих при пожаре.&lt;/p&gt;&lt;p&gt;По современным требованиям пожаробезопасности, кабель ВВГнг-FRLS не рекомендуется применять в помещениях с массовым скоплением людей (школы, детские сады и др.) в связи с токсичностью продуктов пиролиза ПВХ, для данных категорий помещений разработаны более безопасные аналоги (FRHF, FRLSLTx).&lt;/p&gt;','','200','','',''),(495,1,'Провод ПУГВ 0,5 белый ГОСТ Альгиз К','Провод ПВ-3(ПуГВ) предназначенные для электрических установок при стационарной прокладке в осветительных и силовых сетях, а также для монтажа электрооборудования до 450/750 В включительно номинальной толщиной до 400 Гц или постоянное напряжение до 700 В включительно. Допускается прокладка проводов в стальных трубах, коробах, лотках и др., для монтажа электрических цепей. ПВ-3 характеризуется повышенной гибкостью, поэтому данную продукцию можно применять там, где условия монтажа предусматривают множество изгибов.','','1000','','',''),(496,1,'Провод ПУГВ 0,5 белый ГОСТ Брэкс','Провод ПВ-3(ПуГВ) предназначенные для электрических установок при стационарной прокладке в осветительных и силовых сетях, а также для монтажа электрооборудования до 450/750 В включительно номинальной толщиной до 400 Гц или постоянное напряжение до 700 В включительно. Допускается прокладка проводов в стальных трубах, коробах, лотках и др., для монтажа электрических цепей. ПВ-3 характеризуется повышенной гибкостью, поэтому данную продукцию можно применять там, где условия монтажа предусматривают множество изгибов.','','1000','','',''),(497,1,'Пров