540,1,'Провод ПУВ 1,0 белый ГОСТ Брэкс','Провод для электрических установок при стационарной прокладкев осветительных и силовых сетях, а также для монтажаэлектрооборудования машин, механизмов и станков наноминальное напряжение до 450 В частотой до 400 Гц илипостоянное напряжение до 1000 В','','200','','',''),(541,1,'Провод ПУВ 1,0 белый ГОСТ РЭК','Провод для электрических установок при стационарной прокладкев осветительных и силовых сетях, а также для монтажаэлектрооборудования машин, механизмов и станков наноминальное напряжение до 450 В частотой до 400 Гц илипостоянное напряжение до 1000 В','','1000','','',''),(542,1,'Провод ПУВ 1,0 желто-зеленый ГОСТ Брэкс','Провод для электрических установок при стационарной прокладкев осветительных и силовых сетях, а также для монтажаэлектрооборудования машин, механизмов и станков наноминальное напряжение до 450 В частотой до 400 Гц или постоянное напряжение до 1000 В','','1000','','',''),(543,1,'Провод ПУВ 1,5 белый ГОСТ Металлист','Провод для электрических установок при стационарной прокладкев осветительных и силовых сетях, а также для монтажаэлектрооборудования машин, механизмов и станков наноминальное напряжение до 450 В частотой до 400 Гц или постоянное напряжение до 1000 В','','1000','','',''),(544,1,'Провод ПУВ 1,5 белый ГОСТ ПромЭл','Расшифровка проводов ПуВ:&lt;br&gt;П - Провод &lt;br&gt;у - Установочный&lt;br&gt;В - Изоляция - из поливинилхлоридного пластиката&lt;br&gt;Элементы конструкции проводов ПуВ:&lt;br&gt;1. Токопроводящая жила – из медной отожженной по ГОСТ 22483-77.&lt;br&gt;2. Изоляция - из поливинилхлоридного пластиката.&lt;br&gt;&lt;br&gt;Назначение проводов ПуВ:&lt;br&gt;Провода применяются для электрических установок при стационарной прокладке в осветительных и силовых сетях, а также для монтажа электрооборудования, машин, механизмов и станков, внутренних электроустановок на номинальное переменное напряжение до 450/750 В включительно номинальной частотой до 400 Гц или постоянное напряжение до 1000 В включительно.&lt;br&gt;&lt;br&gt;Условия эксплуатации и монтажа проводов ПуВ:&lt;br&gt;Провода по конструкции, техническим параметрам и эксплуатационным характеристикам соответствуют требованиям международных стандартов МЭК 60227-1:2007, МЭК 60227-3:1997, МЭК 60227-4:1997.&lt;br&gt;Провод ПуВ служит для прокладки в стальных трубах, коробах, на лотках и др., для монтажа электрических цепей&lt;br&gt;Класс пожарной опасности по ГОСТ Р 53315-2009 - О1.8.2.5.4&lt;br&gt;Вид климатического исполнения УХЛ, категория размещения 2 по ГОСТ 15150-69&lt;br&gt;Требования стойкости к внешним воздействующим факторам:&lt;br&gt;- провода стойки к воздействию повышенной температуры окружающей среды до 65°С&lt;br&gt;- провода стойки к воздействию пониженной температуры окружающей среды до -50°С&lt;br&gt;- провода стойкие к воздействию повышенной относительной влажности воздуха до 98% при температуре окружающей среды до +35°С;&lt;br&gt;Монтаж проводов производится при температуре не ниже -15°С&lt;br&gt;Радиус изгиба при монтаже– не менее 10Dн&lt;br&gt;Длительно допустимая температура нагрева жил при эксплуатации, не более +700С&lt;br&gt;Срок службы проводов ПуВ не менее 20 лет при соблюдении потребителем требований по транспортированию, хранению, монтажу и эксплуатации&lt;br&gt;Допустимое напряжение, кВ: 0,750;1;0,450&lt;br&gt;&lt;br&gt;Исполнение: изолированный','','1000','','',''),(545,1,'Провод ПУВ 1,5 синий ГОСТ КАБЭКС','Провод для электрических установок при стационарной прокладкев осветительных и силовых сетях, а также для монтажаэлектрооборудования машин, механизмов и станков наноминальное напряжение до 450 В частотой до 400 Гц или постоянное напряжение до 1000 В','','1000','','',''),(546,1,'Провод ПУВ 1,5 синий ГОСТ ВЛКЗ','Провод для электрических установок при стационарной прокладкев осветительных и силовых сетях, а также для монтажаэлектрооборудования машин, механизмов и станков наноминальное напряжение до 450 В частотой до 400 Гц или постоянное напряжение до 1000 В','','1000','',