p&gt;&lt;p&gt;- при монтаже: мин. +5 °C;&lt;/p&gt;&lt;p&gt;- при эксплуатации: от -40 °C до +70 °C;&lt;/p&gt;&lt;p&gt;- температура на проводнике: макс. +70 °C;&lt;/p&gt;&lt;p&gt;- во время короткого замыкания: +160 °C/5 c.&lt;/p&gt;&lt;p&gt;Радиус изгиба (мин.): 6 наружных диаметров кабеля.&lt;/p&gt;&lt;p&gt;Самозатухание: EN 60332-1.&lt;/p&gt;&lt;p&gt;Кабель устойчив к УФ-излучению.&lt;/p&gt;&lt;p&gt;Нормативный документ: VDE 0250 Part 204, ГОСТ Р 16442-80, ГОСТ Р МЭК 60227-4-2002&lt;/p&gt;','','1','','',''),(564,1,'Провод ПУГВВ 2x2,5 ГОСТ TPlast Евро Профиль','','','200','','',''),(565,1,'Провод ШВВП 2x0,5 ГОСТ Брэкс','','','1000','','',''),(566,1,'Провод ШВВП 2x0,5 ГОСТ ЭлектрикДомСтрой','','','1000','','',''),(567,1,'Провод ШВВП 2x0,5 ГОСТ TPlast Евро Профиль','','','1000','','',''),(568,1,'Провод ШВВП 2x0,5 ГОСТ ВЛКЗ','Конструкция&lt;br&gt;Токопроводящая жила – медная, многопроволочная класса 5 по ГОСТ 22483-77.&lt;br&gt;Изоляция – поливинилхлоридный пластикат ПВХ.&lt;br&gt;Изолированные жилы уложены параллельно и имеют отличительную расцветку.&lt;br&gt;Оболочка – поливинилхлоридный пластикат ПВХ.&lt;br&gt; Применение&lt;br&gt;Предназначен для присоединения приборов личной гигиены и микроклимата, электропаяльников, светильников, кухонных электромеханических приборов, радиоэлектронной аппаратуры, стиральных машин, холодильников и других подобных приборов, эксплуатируемых в жилых и административных помещениях, и для изготовления шнуров удлинительных на напряжение до 380 В для систем 380/380 В.&lt;br&gt;&lt;br&gt;Технические характеристики&lt;br&gt;Вид климатического исполнения кабелей УХЛ категория размещения 2 и 3 по ГОСТ 15150-69.','','1000','','',''),(569,1,'Провод ШВВП 2x0,75 ГОСТ Брэкс','','','1000','','',''),(570,1,'Провод ШВВП 2x0,75 ГОСТ ПромЭл','','','1000','','',''),(571,1,'Провод ШВВП 2x0,75 ГОСТ ВЛКЗ','','','1000','','',''),(572,1,'Провод ШВВП 3x0,75 ГОСТ Брэкс','','','1000','','',''),(573,1,'Провод ШВВП 3x0,75 ГОСТ ПромЭл','','','1000','','',''),(574,1,'Провод ШВВП (ПУГВВ) 2x1,5 ГОСТ Автопровод','Расшифровка проводов ШВВП:&lt;br&gt;Ш - Шнур&lt;br&gt;В - Изоляция жил из поливинилхлоридного пластиката &lt;br&gt;В - Оболочка из поливинилхлоридного пластиката &lt;br&gt;П - Плоский&lt;br&gt;Элементы констркуции проводов ШВВП:&lt;br&gt;&lt;br&gt;1. Токопроводящая жила.&lt;br&gt;2. Изоляция.&lt;br&gt;3. Оболочка.&lt;br&gt;&lt;br&gt;Провод проводов ШВВП соответствует ГОСТ 7999-97 и предназначен для подключения электрических приборов и оборудования к электросети с номинальным напряжением, не превышающим 380 В.&lt;br&gt;Провод выпускается со скрученными жилами, в ПВХ-изоляции и такой же оболочке.&lt;br&gt;Токопроводящая жила из мягкой медной проволоки имеет сечение 0.5 или 0.75 мм2.&lt;br&gt;Провод рассчитан на максимальное напряжение 4000 В частотой 50 Гц, приложенное в течение 1 мин.&lt;br&gt;Число жил может быть равным 2 или 3.&lt;br&gt;Оболочка: пластмассовая&lt;br&gt;&lt;br&gt;Допустимое напряжение, кВ: 0,380;0,220&lt;br&gt;&lt;br&gt;Нормативный документ: ГОСТ 7399-97&lt;br&gt;&lt;br&gt;Исполнение: многожильный; гибкий; изолированный; многопроволочный; плоский','','1000','','',''),(575,1,'Провод ШВВП (ПУГВВ) 2x1,5 ГОСТ Брэкс','Расшифровка проводов ШВВП 2х1,5:&lt;br&gt;Ш - Шнур&lt;br&gt;В - Изоляция жил из поливинилхлоридного пластиката &lt;br&gt;В - Оболочка из поливинилхлоридного пластиката &lt;br&gt;П - Плоский&lt;br&gt;2 - количество жил&lt;br&gt;1,5 - сечение жил&lt;br&gt;Элементы констркуции проводов ШВВП 2х1,5:&lt;br&gt;&lt;br&gt;1. Токопроводящая жила.&lt;br&gt;2. Изоляция.&lt;br&gt;3. Оболочка.&lt;br&gt;&lt;br&gt;Провод проводов ШВВП 2х1,5 соответствует ГОСТ 7999-97 и предназначен для подключения электрических приборов и оборудования к электросети с номинальным напряжением, не превышающим 380 В.&lt;br&gt;Провод выпускается со скрученными жилами, в ПВХ-изоляции и такой же оболочке.&lt;br&gt;Токопроводящая жила из мягкой медной проволоки имеет сечение 0.5 или 0.75 мм2.&lt;br&gt;Провод рассчитан на максимально