gt;4 - количество жил&lt;br&gt;4 - сечение жил&lt;br&gt;&lt;br&gt;Элементы конструкции проводов ПВС 4х4:&lt;br&gt;1. Токопроводящая жила.&lt;br&gt;2. Изоляция.&lt;br&gt;3. Оболочка.&lt;br&gt;&lt;br&gt;ОБЛАСТЬ ПРИМЕНЕНИЯ проводов ПВС 4х4&lt;br&gt;Провод с гибкими медными жилами, предназначен для присоединения электрических машин и приборов бытового и аналогичного применения к электрической сети, для электроприборов и электроинструмента по уходу за жилищем и его ремонту, стиральных машин, холодильников, средств малой механизации для садоводства и огородничества и для изготовления шнуров удлинительных.&lt;br&gt;&lt;br&gt;КОНСТРУКЦИЯ проводов ПВС 4х4&lt;br&gt;Провод со скрученными жилами, с ПВХ изоляцией, с ПВХ оболочкой, на напряжение до 380 В для систем 380 / 660 В.&lt;br&gt;&lt;br&gt;ТЕХНИЧЕСКИЕ ХАРАКТЕРИСТИКИ&lt;br&gt;Электрическое сопротивление на 1 км - не более 270 Ом ПВХ изоляция и оболочка проводов стойка к деформации при температуре 70 оС и к растрескиванию.&lt;br&gt;&lt;br&gt;УСЛОВИЯ ЭКСПЛУАТАЦИИ&lt;br&gt;Эксплуатация при температуре окружающей среды от -25 оС до +40 оС.&lt;br&gt;Максимальная рабочая температура жилы - 70 оС.&lt;br&gt;Радиус изгиба - не менее 40 мм.&lt;br&gt;Не распространяют горение. Провода стойки к поражению плесневыми грибами.&lt;br&gt;&lt;br&gt;Срок службы - не менее 10 лет.','','200','','',''),(633,1,'Провод ПВС 4x6,0 ГОСТ Альгиз','','','200','','',''),(634,1,'Провод ПВС 5x0,75 ГОСТ БРЭКС','','','200','','',''),(635,1,'Провод ПВС 5x1,5 ГОСТ Альфакабель','','','200','','',''),(636,1,'Провод ПВС 5x1,5 ГОСТ Альгиз','','','200','','',''),(637,1,'Провод ПВС 5x1,5 ГОСТ Коаксиал','','','200','','',''),(638,1,'Провод ПВС 5x2,5 ГОСТ Альгиз','','','200','','',''),(639,1,'Провод ПВС 5x2,5 ГОСТ БРЭКС','','','200','','',''),(640,1,'Провод ПВС 5x4,0 ГОСТ РЭК','','','200','','',''),(641,1,'Утеплитель XPS 30x585x1185 мм','&lt;p&gt;&lt;strong&gt;Утеплитель XPS&lt;/strong&gt; — теплоизоляционная плита, обеспечивающая также поглощение воздушных и конструкционных шумов. Производится методом экструзии (XPS — экструдированный пенополистирол), имеет равномерную пористую структуру с закрытыми ячейками.&lt;/p&gt;\r\n&lt;p&gt;Размеры плиты 1,185х0,585 м (S=0,69 м²), толщина — 30 мм, плотность — 22 кг/м^3^. Страна производства — Россия.&lt;/p&gt;\r\n&lt;h3&gt;Преимущества и особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Экологичность и безопасность.&lt;/li&gt;\r\n&lt;li&gt;Практически нет водопоглощения.&lt;/li&gt;\r\n&lt;li&gt;В помещениях создается комфортный микроклимат.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации примерно 50 лет.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(642,1,'Изоляция отражающая 5мм ВПЭ/лавсан, 5 м2','&lt;p&gt;&lt;strong&gt;Изоляция отражающая (5 мм)&lt;/strong&gt; применяется при утеплении помещений изнутри и снаружи. Основа изоляции — вспененный полиэтилен, покрытый с одной стороны слоем фольги. С ее помощью утепляются стены, кровля, теплые полы, изолируются трубопроводы и вентиляционные системы. Общая площадь рулона — 5 м². Материал производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Преимущества&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Низкая теплопроводность благодаря большому содержанию воздуха в пузырьках полиэтилена и фольгированному покрытию, отражающему тепловые лучи.&lt;/li&gt;\r\n&lt;li&gt;Высокие показатели звукоизоляции, паронепроницаемость.&lt;/li&gt;\r\n&lt;li&gt;Легкость и небольшая толщина материала.&lt;/li&gt;\r\n&lt;li&gt;Устойчивость к воздействию высоких температур, пожаробезопасность.&lt;/li&gt;\r\n&lt;li&gt;Стойкость к влаге и биологическим воздействиям.&lt;/li&gt;\r\n&lt;li&gt;Простота монтажа: разрезанные по размеру полосы изоляции крепятся при помощи степлера, стыки проклеиваются металлическим скотчем.&lt;/li&gt;\r\n&lt;/ul&gt;','','60','','',''),(643,1,'Фольга для бани Isobond 10 м²','','','20','','',''),(644,1,'Пенопласт ППС8-Р-А 30x1000x600 мм','&lt;p&gt;&lt;strong&gt;Пенопласт ППС8-Р-А&lt;/strong&gt; предназначен для теплоизоляции стен и пола в местах с невысокой механической нагрузкой. Согласно ГОСТ, маркировка читается:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;плиты пенополистирольные (ППС)&lt;/li&gt;\r\n&lt;li&gt;плотность до 8 кг/м^3^;&lt;/li&gt;\r\n&lt;li&gt;резаные от крупных блоков (Р);&lt;/li&gt;\r\n&lt;li&gt;с прямоугольной боковой гранью (А).&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Размер листа 1000х600 мм (площадь 0,6 м²), толщина — 30 мм, плотность — 7,5 кг/м^3^. Производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности материала&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Низкая теплопроводность (эффективно защищает от потерь тепла в зимний период и от жары летом).&lt;/li&gt;\r\n&lt;li&gt;Поглощает минимум влаги даже при непосредственном контакте с водой.&lt;/li&gt;\r\n&lt;li&gt;Устойчивость к гниению, к воздействию окружающей среды, микроорганизмов и паразитов.&lt;/li&gt;\r\n&lt;li&gt;Легкий вес, простой монтаж.&lt;/li&gt;\r\n&lt;/ul&gt;','','300','','',''),(645,1,'Утеплитель XPS 100x585x1185 мм','&lt;p&gt;&lt;strong&gt;Утеплитель XPS&lt;/strong&gt; — теплоизоляционная плита, обеспечивающая также поглощение воздушных и конструкционных шумов. Производится методом экструзии (XPS — экструдированный пенополистирол), имеет равномерную пористую структуру с закрытыми ячейками.&lt;/p&gt;\r\n&lt;p&gt;Размеры плиты 1,185х0,585 м (S=0,69 м²), толщина — 100 мм, плотность — 22 кг/м^3^. Страна производства — Россия.&lt;/p&gt;\r\n&lt;h3&gt;Преимущества и особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Экологичность и безопасность.&lt;/li&gt;\r\n&lt;li&gt;Практически нет водопоглощения.&lt;/li&gt;\r\n&lt;li&gt;В помещениях создается комфортный микроклимат.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации примерно 50 лет.&lt;/li&gt;\r\n&lt;/ul&gt;','','80','','',''),(646,1,'Изоляция Knauf ТеплоKnauf Стена 50 мм, 6 м²','&lt;p&gt;&lt;strong&gt;Минеральная вата ТеплоKnauf «Стена»&lt;/strong&gt; предназначена для утепления и шумоизоляции каркасных стен. Обработана водоотталкивающей пропиткой Aquastatik. Упругость материала позволяет заполнять конструкции без щелей и зазоров. Продукт изготовлен без добавления смол.&lt;/p&gt;\r\n&lt;p&gt;Минеральная вата изготовлена из безопасного природного материала — волокон расплавленного базальта, скрепленных клеящим веществом. Плиты не горят, не выделяют опасных веществ, не восприимчивы к воздействию влаги и микроорганизмов. Производятся в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Теплоизоляция в виде плит в сжатой упаковке удобна в транспортировке и монтаже. Прямоугольная форма упрощает расчеты, раскрой и монтаж материала.&lt;/li&gt;\r\n&lt;li&gt;Толщина материала составляет 50 мм — этого вполне достаточно для утепления в один слой.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации материала превышает 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;','','50','','',''),(647,1,'Изоляция Старт Полы и Перекрытия 50 мм, 8 м²','&lt;p&gt;&lt;strong&gt;Минеральная вата Старт «Полы и перекрытия»&lt;/strong&gt; предназначена для утепления по лагам. Выпускается в рулоне, укладывается под напольное покрытие. Материал изготавливается из базальтовых волокон, полностью безопасен для человека в процессе эксплуатации. Толщина — 50 мм. Товар производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности утеплителя&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Превосходно сохраняет и удерживает тепло.&lt;/li&gt;\r\n&lt;li&gt;Хорошо поглощает шум, обеспечивает звукоизоляцию помещения.&lt;/li&gt;\r\n&lt;li&gt;Не восприимчив к влаге и биологическим воздействиям.&lt;/li&gt;\r\n&lt;li&gt;Полностью пожаробезопасен.&lt;/li&gt;\r\n&lt;li&gt;Легко режется и укладывается.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации — более 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание: монтаж плит производится с обязательным использованием средств индивидуальной защиты!&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;','','50','','',''),(648,1,'Изоляция для стен 12 плит 1200х600х50 мм','&lt;p&gt;&lt;strong&gt;Изоляция для стен&lt;/strong&gt; — надежный и долговечный материал с отличными эксплуатационными свойствами. Предназначается для утепления стен и перегородок внутри помещений. Изоляция представляет собой прямоугольные плиты из каменной ваты. Обязательно защищается от внешних воздействий финишной отделкой. Комплект содержит 12 плит толщиной 50 мм и размером 1200x600 мм. Производится в России.&lt;/p&gt;\n&lt;h3&gt;Преимущества изоляции&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Обладает отличными теплоизоляционными свойствами.&lt;/li&gt;\n&lt;li&gt;Не боится влаги, грызунов и микроорганизмов.&lt;/li&gt;\n&lt;li&gt;Благодаря удобному формату жестких плит просто и быстро монтируется на стену.&lt;/li&gt;\n&lt;li&gt;Имеет хорошую паропроницаемость, позволяет стенам «дышать».&lt;/li&gt;\n&lt;li&gt;Не горит и не выделяет вредных веществ при нагревании.&lt;/li&gt;\n&lt;li&gt;За счет пористой структуры гасит звуковые колебания и увеличивает шумоизоляцию помещения.&lt;/li&gt;\n&lt;li&gt;Долго служит — 20 лет и более.&lt;/li&gt;\n&lt;/ul&gt;','','45','','',''),(649,1,'Напыляемый утеплитель Polynor','&lt;p&gt;Напыляемый полиуретановый утеплитель Polynor – это совершенно новый класс материалов, предназначенных для утепления и звукоизоляции. Он очень надежный, экологичный, удобный в использовании – его довольно часто используют для обработки участков сложной формы и наиболее труднодоступных мест. Расфасовка в баллонах позволяет приобретать ровно столько утеплителя, сколько нужно для требуемых работ. Скорость утепления одного квадратного метра составляет 2 минуты одним человеком&lt;/p&gt;\n&lt;p&gt;Преимущества:&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;бесшовная изоляция, отсутствие мостиков холода;&lt;/li&gt;\n&lt;li&gt;не требуется предварительное выравнивание поверхности;&lt;/li&gt;\n&lt;li&gt;100% адгезия ко всем строительным материалам;&lt;/li&gt;\n&lt;li&gt;регулируемая толщина слоя утеплителя от 1,5 см;&lt;/li&gt;\n&lt;li&gt;защита поверхности от грибка и плесени;&lt;/li&gt;\n&lt;li&gt;максимальное проникновение в стыки и щели;&lt;/li&gt;\n&lt;li&gt;нет утяжеления несущей конструкции;&lt;/li&gt;\n&lt;li&gt;не пропускает и не впитывает влагу.&lt;/li&gt;\n&lt;/ul&gt;','','45','','',''),(650,1,'Изоляция Knauf ТеплоKnauf Стена 100 мм, 7 м²','&lt;p&gt;&lt;strong&gt;Минеральная вата ТеплоKnauf «Стена»&lt;/strong&gt; предназначена для утепления и шумоизоляции каркасных стен. Обработана водоотталкивающей пропиткой Aquastatik. Упругость материала позволяет заполнять конструкции без щелей и зазоров. Продукт изготовлен без добавления смол.&lt;/p&gt;\r\n&lt;p&gt;Минеральная вата изготовлена из безопасного природного материала — волокон расплавленного базальта, скрепленных клеящим веществом. Плиты не горят, не выделяют опасных веществ, не восприимчивы к воздействию влаги и микроорганизмов. Производятся в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Теплоизоляция в рулоне позволяет удобно раскатывать материал, отмерять и отрезать по размеру, сводя к минимуму количество обрезков.&lt;/li&gt;\r\n&lt;li&gt;Толщина материала составляет 100 мм — этого вполне достаточно для утепления в один слой.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации материала превышает 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(651,1,'Изоляция Isover Плита 50 мм, 5.76 м²','&lt;p&gt;Изоляция Изовер Плита 50 мм, 5,76 м2 – удобный в применении высококачественный материал для обустройства теплоизоляционного слоя. Материал изготовлен в форме плит толщиной 50 мм из базальтовой минеральной ваты и имеет неограниченную область применения – от скатных крыш до полов, уложенных на лаги.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;экологичность;&lt;/li&gt;\r\n&lt;li&gt;пожарная безопасность;&lt;/li&gt;\r\n&lt;li&gt;быстрый и легкий монтаж без применения вспомогательного крепежа;&lt;/li&gt;\r\n&lt;li&gt;низкий коэффициент теплопроводности;&lt;/li&gt;\r\n&lt;li&gt;невысокое влагопоглощение;&lt;/li&gt;\r\n&lt;li&gt;длительный срок службы с сохранением изначальных характеристик.&lt;/li&gt;\r\n&lt;/ul&gt;','','40','','',''),(652,1,'Термоизоляционная PIR-плита PirroUniversal 30x600x1200 мм','&lt;p&gt;&lt;strong&gt;PIR-плиты PIRRO&lt;/strong&gt; – безопасный для человека и домашних животных, экологичный утеплитель с высокими теплозащитными свойствами. Плита PirroUniversal 30 мм по своим теплозащитным характеристикам эквивалентна слою утеплителя из минеральной ваты толщиной 48 мм.&lt;/p&gt;\n&lt;p&gt;PirroUniversal 30 мм – это термоизоляционная плита из вспененного полиизоцианурата (PIR) c двусторонней облицовкой алюмоламинатом.&lt;/p&gt;\n&lt;p&gt;Плита толщиной 30 мм – это еще и теплоизоляционное решение, которое позволяет сохранить максимум полезного пространства при внутреннем утеплении. Это очень важно, если речь идет об изоляции небольших помещений – таких, как балкон либо лоджия или парилка в бане либо сауне.&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Ключевые преимущества Pirro плит:&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;\n&lt;p&gt;Допускают монтаж непосредственно к утепляемой поверхности&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;Для монтажа плит утепления не требуется создание каркасных конструкций&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;Толщина 30 мм&lt;/p&gt;\n&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;&lt;strong&gt;Плиты PirroUniversal 30 мм с облицовкой из алюмоламината подходят для решения многих задач по утеплению:&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;\n&lt;p&gt;теплоизоляция балконов и лоджий под сухую отделку;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;устройство нештукатурных фасадов;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;теплоизоляция бань и саун;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;устройство теплого пола;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;внутреннее доутепление квартир;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;доутепление мансардных этажей;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;утепление кровель сплошным слоем поверх стропил.&lt;/p&gt;\n&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;&lt;strong&gt;Особенность PIR плит&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;Плита состоит из множества закрытых ячеек с жесткими стенками, наполненных негорючим газом. Благодаря этому материал огнеустойчив, паронепроницаем, не впитывает и не пропускает влагу, отличается высокими прочностными характеристиками. Теплоизоляция PIR не подвержена заражению грибком и плесенью, не привлекает грызунов и насекомых. Срок эксплуатации плит PirroUniversal 30 мм составляет от 50 лет и более, причем со временем эффективность утепления не падает.&lt;/p&gt;\n&lt;p&gt;В состав плит не входят формальдегидные смолы и стирол. Подтверждено лабораторными испытаниями: PIR не выделяет вредных веществ в атмосферу даже при экстремальных температурах 100ºС.&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Доказано: безопасны для здоровья.&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(653,1,'Жгут теплоизоляционный Вилатерм 20 мм x 6 м','&lt;p&gt;Жгут теплоизоляционный «Вилатерм» используется для герметизации швов. Уплотняющий материал востребован в строительно-ремотных работах. Изделие изготовлено из вспененного полиэтилена. Жгут заполняет швы и проемы, перекрывая мостики холода.&lt;/p&gt;\n&lt;p&gt;Преимущества:&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;долговечность;&lt;/li&gt;\n&lt;li&gt;герметичность;&lt;/li&gt;\n&lt;li&gt;надежность.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;Изделие может использоваться при герметизации швов в процессе монтажа окон и дверей, для утепления межпанельных швов и заделки щелей между бревнами. Жгут подойдет для заполнения проемов между элементами вагонки. Материал устойчив к большинству внешних факторов.&lt;/p&gt;','','200','','',''),(654,1,'Экструдированный пенополистирол «Прочный» Т-15 50х585х1185 мм','&lt;p&gt;Утеплитель XPS Прочный® — качественные, эффективные, надежные теплоизоляционные плиты.&lt;br&gt;\nИзготавливаются из полистирола общего назначения методом экструзии. Обладают высокими теплозащитными свойствами — теплопроводность в реальных условиях эксплуатации не превышает 0,034 Вт/м∙К, что ниже, чем у большинства других теплоизоляционных материалов. Отличаются повышенной прочностью — до 25 тонн на квадратный метр.&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Область применения:&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;Утеплитель XPS Прочный® используется в строительстве частных домов и ремонте квартир для теплоизоляции нагружаемых конструкций, а именно:&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;фундаментов и отмосток;&lt;/li&gt;\n&lt;li&gt;подвалов, цоколей и цокольных этажей;&lt;/li&gt;\n&lt;li&gt;полов;&lt;/li&gt;\n&lt;li&gt;балконов и лоджий;&lt;/li&gt;\n&lt;li&gt;кровель;&lt;/li&gt;\n&lt;li&gt;объектов на придомовом участке (садовых дорожек, теплиц, септиков и т.п.).&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;&lt;strong&gt;Преимущества:&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;Главное преимущество Утеплителя XPS Прочный® — обладает повышенной прочностью, что позволяет применять материал в нагружаемых конструкциях.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;&lt;strong&gt;А также:&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;хорошо хранит тепло — теплопроводность ниже, чем у утеплителей из других материалов;&lt;/li&gt;\n&lt;li&gt;водостойкость — обеспечивает стабильно низкую теплопроводность при нахождении во влажном грунте или даже в воде;&lt;/li&gt;\n&lt;li&gt;высокая прочность на сжатие и изгиб;&lt;/li&gt;\n&lt;li&gt;экологическая безопасность — изготовлен из чистого пенополистирола, также применяемого в медицинской и пищевой промышленности;&lt;/li&gt;\n&lt;li&gt;биостойкость — не допускает размножения плесени;&lt;/li&gt;\n&lt;li&gt;Г-образная кромка — обеспечивает плотную стыковку без мостиков холода;&lt;/li&gt;\n&lt;li&gt;долговечность — срок службы 50 лет и выше.&lt;/li&gt;\n&lt;/ul&gt;','','200','','',''),(655,1,'Пенопласт ППС 16Ф 1000х1000х100 мм','&lt;p&gt;&lt;strong&gt;Пенопласт ППС 16Ф&lt;/strong&gt; (Россия) предназначен для пола и стен, для фасадов (на это указывает буква «Ф» в маркировке). Расшифровка других символов: ППС — плиты пенополистирольные, 16 — плотность 16 кг/м^3^. Размер листа 1000х1000 мм (площадь покрытия 1 м²), толщина — 100 мм. Изделие имеет квадратную форму. Помимо прочего, из пенопласта изготавливают элементы декора стен и фасада.&lt;/p&gt;\n&lt;p&gt;Преимущества материала:&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;ровная поверхность, которая легко поддается декоративной отделке;&lt;/li&gt;\n&lt;li&gt;низкая теплопроводность;&lt;/li&gt;\n&lt;li&gt;высокая прочность, устойчивость к влаге и атмосферным воздействиям;&lt;/li&gt;\n&lt;li&gt;стойкость к гниению, непривлекательность для жучков, грызунов.&lt;/li&gt;\n&lt;/ul&gt;','','50','','',''),(656,1,'Пенопласт ППС16Ф-Р-А 50x1000x1200 мм','&lt;p&gt;&lt;strong&gt;Пенопласт ППС16Ф-Р-А&lt;/strong&gt; — ячеистая вспененная пластмасса, которая обеспечивает теплоизоляцию, поглощает воздушные и конструкционные шумы. Выпускается в пластинах прямоугольной формы. Монтируется на внутренние стены и перегородки, полы, потолки, перекрытия, лоджии и балконы, скатные крыши.&lt;/p&gt;\n&lt;p&gt;Длина материала 1,2 м, ширина — 1 м (площадь покрытия 1,2 м²), толщина — 50 мм. Страна производства — Россия.&lt;/p&gt;\n&lt;h3&gt;Особенности и преимущества&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Малый вес: практически не нагружаются конструкции.&lt;/li&gt;\n&lt;li&gt;Быстрый монтаж: листы легко режутся ножом.&lt;/li&gt;\n&lt;li&gt;Морозостойкость: пенопласт без проблем выдерживает полсотни циклов замораживания и оттаивания.&lt;/li&gt;\n&lt;li&gt;Срок службы около 80 лет: стройматериал не гниет и не портится грызунами.&lt;/li&gt;\n&lt;li&gt;Удобство транспортирования.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;Пенопласт рекомендуется хранить в сухом, темном, отапливаемом помещении. Беречь от воздействия ультрафиолета, от контакта с химическими соединениями и нагревательными приборами.&lt;/p&gt;','','60','','',''),(657,1,'Уплотнитель межвенцовый 20 см х 20 м','&lt;p&gt;Межвенцовый уплотнитель от популярного российского производителя предназначен для прокладки между венцами деревянных конструкций, представляет собой натуральную, простую в эксплуатации изоляцию. Он используется в процессе строительства деревянных домов, утепляет соединения между элементами для сборки. Благодаря устойчивости к влажности и гниению, подходит для утепления бань. Высококачественный плотный материал сжимается под естественным весом бревен, заполняя зазоры между срубами и делая постройку герметичной, устойчивой к продуванию и потере тепла. Уплотнитель длиной 20 м имеет ширину 20 см, весит всего 0,35 кг.&lt;/p&gt;\n&lt;p&gt;Преимущества:&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;привлекательная цена;&lt;/li&gt;\n&lt;li&gt;высококачественный материал;&lt;/li&gt;\n&lt;li&gt;натуральная изоляция;&lt;/li&gt;\n&lt;li&gt;простота эксплуатации;&lt;/li&gt;\n&lt;li&gt;небольшой вес.&lt;/li&gt;\n&lt;/ul&gt;','','40','','',''),(658,1,'Изоляция отражающая 3мм ВПЭ/лавсан, 5 м²','&lt;p&gt;&lt;strong&gt;Изоляция отражающая (3 мм)&lt;/strong&gt; применяется при утеплении помещений изнутри и снаружи. Основа изоляции — вспененный полиэтилен, покрытый с одной стороны слоем фольги. С ее помощью утепляются стены, кровля, теплые полы, изолируются трубопроводы и вентиляционные системы. Общая площадь рулона — 5 м². Материал производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Преимущества&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Низкая теплопроводность благодаря большому содержанию воздуха в пузырьках полиэтилена и фольгированному покрытию, отражающему тепловые лучи.&lt;/li&gt;\r\n&lt;li&gt;Высокие показатели звукоизоляции, паронепроницаемость.&lt;/li&gt;\r\n&lt;li&gt;Легкость и небольшая толщина материала.&lt;/li&gt;\r\n&lt;li&gt;Устойчивость к воздействию высоких температур, пожаробезопасность.&lt;/li&gt;\r\n&lt;li&gt;Стойкость к влаге и биологическим воздействиям.&lt;/li&gt;\r\n&lt;li&gt;Простота монтажа: разрезанные по размеру полосы изоляции крепятся при помощи степлера, стыки проклеиваются металлическим скотчем.&lt;/li&gt;\r\n&lt;/ul&gt;','','80','','',''),(659,1,'Жгут теплоизоляционный Вилатерм 6 мм x 30 м','&lt;p&gt;Жгут теплоизоляционный обладает высокой эластичностью, что обеспечивает качественное утепление любых конструкций. Изделие не теряет свойств от перепадов температур, цельный рулон длиной 30 м обеспечивает сплошную теплоизоляцию больших объектов. Жгут предназначен для снижения тепловых потерь на швах гипсокартонных перегородок, утепления окон, мансард, балконов и других конструкций.&lt;/p&gt;\n&lt;p&gt;Преимущества:&lt;/p&gt;\n&lt;p&gt;· прочный материал;&lt;br&gt;\n· эластичность;&lt;br&gt;\n· отличные изоляционные характеристики;&lt;br&gt;\n· универсальность применения.&lt;/p&gt;\n&lt;p&gt;Жгут теплоизоляционный Вилатерм обеспечивает качественное устранение неплотностей на стыках конструкций любого типа для снижения уровня тепловых потерь.&lt;/p&gt;','','200','','',''),(660,1,'Изоляция отражающая Пенотерм 10 мм НПП ЛФ, 9 м²','&lt;p&gt;Изоляция отражающая Пенотерм НПП ЛФ 10мм, разработанная специально для применения в банях и саунах, отличается высокой эффективностью отражения тепловой энергии. Это достигается за счет сочетания уникальных свойств вспененного полипропилена и фольгированного отражающего покрытия. Использование материала позволяет добиться «эффекта термоса»: обеспечить быстрый нагрев помещения и его медленное остывание.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;верхний порог эксплуатационной температуры достигает +150 градусов по Цельсию;&lt;/li&gt;\r\n&lt;li&gt;простой и удобный монтаж материала;&lt;/li&gt;\r\n&lt;li&gt;функциональность;&lt;/li&gt;\r\n&lt;li&gt;длительный срок службы (не менее 50 лет).&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(661,1,'Утеплитель напыляемый Polynor «Home»','&lt;p&gt;&lt;strong&gt;Утеплитель напыляемый Polynor «Home»&lt;/strong&gt; на основе полиуретана предназначен для утепления сложных криволинейных конструкций и труднодоступных мест.&lt;/p&gt;\n&lt;p&gt;Может использоваться для теплоизоляции:&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;межпанельных швов;&lt;/li&gt;\n&lt;li&gt;фасадов зданий;&lt;/li&gt;\n&lt;li&gt;стен и перегородок;&lt;/li&gt;\n&lt;li&gt;лоджий и балконов;&lt;/li&gt;\n&lt;li&gt;дверных и оконных откосов.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;Благодаря распылению создается сплошной бесшовный слой изоляции нужной толщины, исключаются «мостики холода». Состав полностью высыхает за 12-24 ч. Утеплитель поставляется в аэрозольных баллонах объемом 0,75 л с удобной насадкой-аппликатором в комплекте. Произведен в России.&lt;/p&gt;','','50','','',''),(662,1,'Уплотнитель межвенцовый 15 см х 20 м','&lt;p&gt;Уплотнитель межвенцовый 15 см х 20 м  готовый к укладке строительный материал пакля, которая изготовлена из натурального сырья: волокон льна джута. Ленточная пакля представлена в виде готовых к использованию лент утеплителя. Ширина ленты 15 см при длине 20 м. Легко монтируется: укладывается вдоль паза бруса и закрепляется строительным степлером.&lt;/p&gt;\n&lt;p&gt;Преимущества:&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;экологичность;&lt;/li&gt;\n&lt;li&gt;легкость монтажа;&lt;/li&gt;\n&lt;li&gt;высокая плотность: не выветривается и не высыпается.&lt;/li&gt;\n&lt;/ul&gt;','','100','','',''),(663,1,'Изоляция Knauf ТеплоKnauf Баня 50 мм, 15 м²','&lt;p&gt;&lt;strong&gt;Минеральная вата ТеплоKnauf «Баня»&lt;/strong&gt; предназначена для утепления стен и перекрытий в банях и саунах. Имеет фольгированный слой, отражающий тепловые лучи и защищающий утеплитель от прямого теплового воздействия. Материал без запаха, изготовлен без применения смол. Группа горючести продукта — Г1 (не горит).&lt;/p&gt;\r\n&lt;p&gt;Минеральная вата изготовлена из безопасного природного материала — волокон расплавленного базальта, скрепленных клеящим веществом. Плиты не горят, не выделяют опасных веществ, не восприимчивы к воздействию влаги и микроорганизмов. Производятся в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Теплоизоляция в рулоне позволяет удобно раскатывать материал, отмерять и отрезать по размеру, сводя к минимуму количество обрезков.&lt;/li&gt;\r\n&lt;li&gt;Толщина материала составляет 50 мм — этого вполне достаточно для утепления в один слой.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации материала превышает 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(664,1,'Термоизоляционная PIR-плита PirroUniversal 50x600x1200 мм','&lt;p&gt;&lt;strong&gt;PIR-плиты PIRRO&lt;/strong&gt; – безопасный для человека и домашних животных, экологичный утеплитель с высокими теплозащитными свойствами. Плита PirroUniversal 50 мм по своим теплозащитным характеристикам эквивалентна слою утеплителя из минеральной ваты толщиной 80,4 мм.&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;PirroUniversal 50 мм&lt;/strong&gt; – это термоизоляционная плита из вспененного полиизоцианурата (PIR) c двусторонней облицовкой алюмоламинатом.&lt;/p&gt;\n&lt;p&gt;Плита толщиной 50 мм – это еще и теплоизоляционное решение, которое позволяет сохранить максимум полезного пространства при внутреннем утеплении. Это очень важно, если речь идет об изоляции небольших помещений – таких, как балкон либо лоджия или парилка в бане либо сауне.&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Ключевые преимущества Pirro плит:&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;\n&lt;p&gt;Допускают монтаж непосредственно к утепляемой поверхности&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;Для монтажа плит утепления не требуется создание каркасных конструкций&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;Толщина 50 мм&lt;/p&gt;\n&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;&lt;strong&gt;Плиты PirroUniversal 50 мм с облицовкой из алюмоламината подходят для решения многих задач по утеплению:&lt;/strong&gt;&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;\n&lt;p&gt;теплоизоляция балконов и лоджий под сухую отделку;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;устройство нештукатурных фасадов;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;теплоизоляция бань и саун;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;устройство теплого пола;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;внутреннее доутепление квартир;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;доутепление мансардных этажей;&lt;/p&gt;\n&lt;/li&gt;\n&lt;li&gt;\n&lt;p&gt;утепление кровель сплошным слоем поверх стропил.&lt;/p&gt;\n&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;&lt;strong&gt;Особенность PIR плит&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;Плита состоит из множества закрытых ячеек с жесткими стенками, наполненных негорючим газом. Благодаря этому материал огнеустойчив, паронепроницаем, не впитывает и не пропускает влагу, отличается высокими прочностными характеристиками. Теплоизоляция PIR не подвержена заражению грибком и плесенью, не привлекает грызунов и насекомых. Срок эксплуатации плит PirroUniversal 50 мм составляет от 50 лет и более, причем со временем эффективность утепления не падает.&lt;/p&gt;\n&lt;p&gt;В состав плит не входят формальдегидные смолы и стирол. Подтверждено лабораторными испытаниями: PIR не выделяет вредных веществ в атмосферу даже при экстремальных температурах 100ºС.&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;Доказано: безопасны для здоровья.&lt;/strong&gt;&lt;/p&gt;','','80','','',''),(665,1,'Утеплитель XPS 20х585х1185 мм','&lt;p&gt;&lt;strong&gt;Утеплитель XPS&lt;/strong&gt; — теплоизоляционная плита, обеспечивающая также поглощение воздушных и конструкционных шумов. Производится методом экструзии (XPS — экструдированный пенополистирол), имеет равномерную пористую структуру с закрытыми ячейками.&lt;/p&gt;\n&lt;p&gt;Размеры плиты 1,185х0,585 м (S=0,69 м^2^), толщина — 20 мм, плотность — 22 кг/м^3^. Страна производства — Россия.&lt;/p&gt;\n&lt;h3&gt;Преимущества и особенности&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Экологичность и безопасность.&lt;/li&gt;\n&lt;li&gt;Практически нет водопоглощения.&lt;/li&gt;\n&lt;li&gt;В помещениях создается комфортный микроклимат.&lt;/li&gt;\n&lt;li&gt;Срок эксплуатации примерно 50 лет.&lt;/li&gt;\n&lt;/ul&gt;','','100','','',''),(666,1,'Изоляция Knauf ТеплоKnauf Крыша 150 мм, 5 м²','&lt;p&gt;&lt;strong&gt;Минеральная вата ТеплоKnauf «Крыша»&lt;/strong&gt; используется для утепления скатных кровель. От возможных протечек крыши защищен специальной водоотталкивающей пропиткой Aquastatik. Упругий материал хорошо заполняет пространство под кровлей. Изготавливается без применения смол.&lt;/p&gt;\r\n&lt;p&gt;Минеральная вата изготовлена из безопасного природного материала — волокон расплавленного базальта, скрепленных клеящим веществом. Плиты не горят, не выделяют опасных веществ, не восприимчивы к воздействию влаги и микроорганизмов. Производятся в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Теплоизоляция в рулоне позволяет удобно раскатывать материал, отмерять и отрезать по размеру, сводя к минимуму количество обрезков.&lt;/li&gt;\r\n&lt;li&gt;Толщина материала составляет 150 мм — этого вполне достаточно для утепления в один слой.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации материала превышает 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;','','40','','',''),(667,1,'Утеплитель XPS 50х585х1185 мм','&lt;p&gt;&lt;strong&gt;Утеплитель XPS&lt;/strong&gt; — теплоизоляционная плита, обеспечивающая также поглощение воздушных и конструкционных шумов. Производится методом экструзии (XPS — экструдированный пенополистирол), имеет равномерную пористую структуру с закрытыми ячейками.&lt;/p&gt;\n&lt;p&gt;Размеры плиты 1,185х0,585 м (S=0,69 м^2^), толщина — 50 мм, плотность — 22 кг/м^3^. Страна производства — Россия.&lt;/p&gt;\n&lt;h3&gt;Преимущества и особенности&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Экологичность и безопасность.&lt;/li&gt;\n&lt;li&gt;Практически нет водопоглощения.&lt;/li&gt;\n&lt;li&gt;В помещениях создается комфортный микроклимат.&lt;/li&gt;\n&lt;li&gt;Срок эксплуатации примерно 50 лет.&lt;/li&gt;\n&lt;/ul&gt;','','200','','',''),(669,1,'Лента алюминиевая Термо 50 мм х 40 м','&lt;p&gt;&lt;strong&gt;Лента алюминиевая «Термо»&lt;/strong&gt; используется при утеплении бань и саун. Применяется для скрепления между собой фольгированных материалов при обустройстве и ремонте теплоизоляции, при сборке воздухо- и теплопроводов, сантехнических систем. Лента шириной 50 мм и длиной 40 м изготовлена из алюминия. Производится в России.&lt;/p&gt;\n&lt;h3&gt;Преимущества&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Нанесенный на ленту клеевой состав, облегчающий монтаж, сохраняет свои свойства при высоких температурах.&lt;/li&gt;\n&lt;li&gt;Металлическая поверхность материала отражает тепловые лучи, улучшая теплоизоляцию помещения.&lt;/li&gt;\n&lt;li&gt;Лента обладает высокой прочностью, термоустойчива, не горит, влагонепроницаема, не поддается воздействию химических веществ.&lt;/li&gt;\n&lt;li&gt;Изделие может использоваться для герметизации и теплоизоляции в труднодоступных местах, где затруднено использование более габаритных материалов.&lt;/li&gt;\n&lt;/ul&gt;','','78','','',''),(670,1,'Изоляция Isover Плита 100 мм, 2.88 м²','&lt;p&gt;Изоляция Изовер Плита 100 мм, 2,88 м2 – современный теплоизоляционный материал на основе минеральной ваты. Благодаря увеличенной до 100 мм толщине обладает улучшенными характеристиками и может быть использован в самых сложных условиях эксплуатации. область применения универсальна – обустройство теплоизоляции ограждающих конструкций и перегородок, кровли, уложенных на лаги полов, навесных фасадов.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;экологическая безопасность;&lt;/li&gt;\r\n&lt;li&gt;удобство обработки и подгонки в требуемый размер;&lt;/li&gt;\r\n&lt;li&gt;простота монтажа;&lt;/li&gt;\r\n&lt;li&gt;отличные теплоизоляционные свойства;&lt;/li&gt;\r\n&lt;li&gt;хорошая паропроницаемость;&lt;/li&gt;\r\n&lt;li&gt;многолетний срок службы с сохранением изначальных характеристик.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(671,1,'Экструдированный полистирол штукатурный Т-15 50х585х1185 мм','&lt;p&gt;&lt;strong&gt;Пенополистирол экструдированный (XPS) штукатурный Т-15&lt;/strong&gt; — теплоизоляционный материал, который изготавливается вспениванием полимерных составов. Препятствует проникновению в помещение как жары, так и холода.&lt;br&gt;\r\n&lt;strong&gt;Области применения:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;стена внутренняя,&lt;/li&gt;\r\n&lt;li&gt;стена внешняя под вентилируемым сайдингом,&lt;/li&gt;\r\n&lt;li&gt;обшивка тонкими досками.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;p&gt;Материал подходит для теплоизоляции фундаментов, цоколей, а также подвальных и полуподвальных помещений. Влагостоек, морозоустойчив, прочен, долговечен. При утеплении внешних стен требуется слой XPS в 1,5 раза меньше толщины альтернативных утеплителей (например, пенопласта или минваты).\r\nФинишная отделка облегчается фрезерованной структурой одной из поверхностей плиты. Она повышает адгезию к клеевым составам при облицовке штукатуркой, плиткой или натуральным камнем.&lt;/p&gt;\r\n&lt;h3&gt;Характеристики материала&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Размер плиты — 585х1185 мм.&lt;/li&gt;\r\n&lt;li&gt;Толщина — 50 мм.&lt;/li&gt;\r\n&lt;li&gt;Плотность плиты — 20 кг/м^3^.&lt;/li&gt;\r\n&lt;li&gt;Теплопроводность — 0,034 Вт/м*°С.&lt;/li&gt;\r\n&lt;li&gt;Производится в России.&lt;/li&gt;\r\n&lt;/ul&gt;','','80','','',''),(672,1,'Изоляция самоклеящаяся 5 мм ВПЭ/фольга, 3 м²','&lt;p&gt;Изоляция самоклеящаяся ВПЭ из вспененного полиэтилена с покрытием из фольги толщиной 5мм представляет собой теплоизоляционный материал, реализуемый в упаковках по 3 м². Предназначена для использования в системах кондиционирования. Покрытие из фольги выполняет функцию отражения.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;хорошая акустическая изоляция;&lt;/li&gt;\r\n&lt;li&gt;покрытие из фольги повышает коэффициент теплового отражения до 97%;&lt;/li&gt;\r\n&lt;li&gt;гибкость материала позволяет применять этот вид изоляции для конструкций любых форм;&lt;/li&gt;\r\n&lt;li&gt;надежная защита от скопления конденсата.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;','','65','','',''),(668,1,'Изоляция отражающая Пенотерм 5 мм НПП ЛФ, 9 м²','&lt;p&gt;Изоляция отражающая «Пенотерм» НПП ЛФ толщиной 5мм – это высокоэффективный теплоизоляционный материал из вспененного полипропилена с закрытой ячеистой структурой, дублированный алюминиевой фольгой. Предназначен специально для бань и саун. В качестве отражающего элемента (теплового зеркала) используется полированная алюминиевая фольга, отражающая до 98% лучистого тепла. Реализуется в рулонах площадью 9м2.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;способность выдерживать высокие температуры (до +150°С);&lt;/li&gt;\r\n&lt;li&gt;обеспечивает быстрый нагрев и медленное остывание помещения бани (эффект термоса);&lt;/li&gt;\r\n&lt;li&gt;длительный срок службы (до 50 лет).&lt;/li&gt;&lt;/ul&gt;','','30','','',''),(673,1,'Жгут теплоизоляционный Вилатерм 10 мм x 15 м','&lt;p&gt;Жгут теплоизоляционный&lt;/p&gt;','','200','','',''),(674,1,'Изоляция отражающая 5мм ВПЭ/лавсан, 15 м² ','&lt;p&gt;&lt;strong&gt;Изоляция отражающая (5 мм)&lt;/strong&gt; применяется при утеплении помещений изнутри и снаружи. Основа изоляции — вспененный полиэтилен, покрытый с одной стороны слоем фольги. С ее помощью утепляются стены, кровля, теплые полы, изолируются трубопроводы и вентиляционные системы. Общая площадь рулона — 15 м². Материал производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Преимущества&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Низкая теплопроводность благодаря большому содержанию воздуха в пузырьках полиэтилена и фольгированному покрытию, отражающему тепловые лучи.&lt;/li&gt;\r\n&lt;li&gt;Высокие показатели звукоизоляции, паронепроницаемость.&lt;/li&gt;\r\n&lt;li&gt;Легкость и небольшая толщина материала.&lt;/li&gt;\r\n&lt;li&gt;Устойчивость к воздействию высоких температур, пожаробезопасность.&lt;/li&gt;\r\n&lt;li&gt;Стойкость к влаге и биологическим воздействиям.&lt;/li&gt;\r\n&lt;li&gt;Простота монтажа: разрезанные по размеру полосы изоляции крепятся при помощи степлера, стыки проклеиваются металлическим скотчем.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(675,1,'Пистолет для монтажной пены Polynor «Premium Gun»','&lt;p&gt;&lt;strong&gt;Пистолет для монтажной пены Polynor «Premium Gun»&lt;/strong&gt; предназначен для нанесения монтажной пены при заделывании щелей, пустот. При работе положение пистолета с баллоном должно быть таким, чтобы баллон находился вертикально, дном вверх. Для подачи пены в места, находящиеся под потолком, когда вертикальность баллона обеспечить невозможно, пистолет применяется с угловыми насадками, позволяющими производить нанесение под углом к трубке инструмента. Страна производства — Литва.&lt;/p&gt;\n&lt;h3&gt;Достоинства&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Применение пистолета обеспечивает больший выход пены из баллона, чем если бы пена распылялась через трубчатую насадку.&lt;/li&gt;\n&lt;li&gt;При использовании пистолета можно оставить неопорожненный баллон с пеной на длительный срок — до нескольких месяцев. Пена при этом не полимеризуется. Достаточно лишь перекрыть кран подачи пены.&lt;/li&gt;\n&lt;li&gt;Корпус пистолета имеет специальное покрытие, нейтральное к химическому составу пены, поэтому она не прилипает к трубке.&lt;/li&gt;\n&lt;/ul&gt;','','20','','',''),(676,1,'Изоляция Isover Тепло под сайдинг 50 мм, 4.8 м²','&lt;p&gt;&lt;strong&gt;Минеральная вата Isover «Тепло под сайдинг»&lt;/strong&gt; служит для утепления и шумоизоляции стен под сайдинг. Может использоваться для укладки под штукатурку или облицовочный кирпич. Плиты отличаются повышенной упругостью, поэтому не требуют дополнительных крепежных элементов при монтаже. Не теряют своих свойств в процессе установки при воздействии погодных условий. Материал изготавливается из базальтовых волокон, полностью безопасен для человека в процессе эксплуатации. Толщина — 50 мм. Товар производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности утеплителя&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Превосходно сохраняет и удерживает тепло.&lt;/li&gt;\r\n&lt;li&gt;Хорошо поглощает шум, обеспечивает звукоизоляцию помещения.&lt;/li&gt;\r\n&lt;li&gt;Не восприимчив к влаге и биологическим воздействиям.&lt;/li&gt;\r\n&lt;li&gt;Полностью пожаробезопасен.&lt;/li&gt;\r\n&lt;li&gt;Легко режется и укладывается.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации — более 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание: монтаж плит производится с обязательным использованием средств индивидуальной защиты!&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;','','50','','',''),(677,1,'Изоляция Старт Полы и Перекрытия 50 мм, 20 м²','&lt;p&gt;&lt;strong&gt;Минеральная вата Старт «Полы и перекрытия»&lt;/strong&gt; предназначена для утепления по лагам. Выпускается в рулоне, укладывается под напольное покрытие. Материал изготавливается из базальтовых волокон, полностью безопасен для человека в процессе эксплуатации. Толщина — 50 мм. Товар производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности утеплителя&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Превосходно сохраняет и удерживает тепло.&lt;/li&gt;\r\n&lt;li&gt;Хорошо поглощает шум, обеспечивает звукоизоляцию помещения.&lt;/li&gt;\r\n&lt;li&gt;Не восприимчив к влаге и биологическим воздействиям.&lt;/li&gt;\r\n&lt;li&gt;Полностью пожаробезопасен.&lt;/li&gt;\r\n&lt;li&gt;Легко режется и укладывается.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации — более 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание: монтаж плит производится с обязательным использованием средств индивидуальной защиты!&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;','','20','','',''),(678,1,'Изоляция Isover Тепло под штукатурку 50 мм','&lt;p&gt;&lt;strong&gt;Минеральная вата Isover «Тепло под штукатурку»&lt;/strong&gt; представляет собой жесткую плиту. Является надежным основанием для штукатурного слоя и обладает прочным сцеплением с ним. Служит для утепления и звукоизоляции стен снаружи под штукатурку, сайдинг или облицовочный кирпич. Материал изготавливается из базальтовых волокон, полностью безопасен для человека в процессе эксплуатации. Толщина — 50 мм. Товар производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности утеплителя&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Превосходно сохраняет и удерживает тепло.&lt;/li&gt;\r\n&lt;li&gt;Хорошо поглощает шум, обеспечивает звукоизоляцию помещения.&lt;/li&gt;\r\n&lt;li&gt;Не восприимчив к влаге и биологическим воздействиям.&lt;/li&gt;\r\n&lt;li&gt;Полностью пожаробезопасен.&lt;/li&gt;\r\n&lt;li&gt;Легко режется и укладывается.&lt;/li&gt;\r\n&lt;li&gt;Срок эксплуатации — более 20 лет.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Внимание: монтаж плит производится с обязательным использованием средств индивидуальной защиты!&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;','','70','','',''),(679,1,'Изоляция самоклеящаяся 10 мм ВПЭ/фольга, 4.5 м²','&lt;p&gt;Изоляция самоклеящаяся ВПЭ толщиной10мм с отражающим слоем из фольги в рулоне площадью 4,5м2 предназначена для тепло- и шумоизоляции воздуховодов, вентиляционных коробов, систем кондиционирования, оборудования жилых и производственных помещений. На одну сторону материала нанесена алюминиевая фольга, на другую – липкий слой, закрытый пленкой.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;алюминиевая фольга обеспечит коэффициент отражения на уровне 97%;&lt;/li&gt;\r\n&lt;li&gt;гарантирована акустическая изоляция;&lt;/li&gt;\r\n&lt;li&gt;предотвращает появление конденсата;&lt;/li&gt;\r\n&lt;li&gt;небольшая толщина материала и гибкость позволяют ему принимать форму любых металлических поверхностей.&lt;/li&gt;&lt;/ul&gt;','','70','','',''),(680,1,'Пенопласт ППС16Ф-Р-А 100x1000x1200 мм','&lt;p&gt;&lt;strong&gt;Пенопласт ППС16Ф-Р-А&lt;/strong&gt; — ячеистая вспененная пластмасса, которая обеспечивает теплоизоляцию, поглощает воздушные и конструкционные шумы. Выпускается в пластинах прямоугольной формы. Монтируется на внутренние стены и перегородки, полы, потолки, перекрытия, лоджии и балконы, скатные крыши.&lt;/p&gt;\n&lt;p&gt;Длина материала 1,2 м, ширина — 1 м (площадь покрытия 1,2 м²), толщина — 100 мм. Страна производства — Россия.&lt;/p&gt;\n&lt;h3&gt;Особенности и преимущества&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Малый вес: практически не нагружаются конструкции.&lt;/li&gt;\n&lt;li&gt;Быстрый монтаж: листы легко режутся ножом.&lt;/li&gt;\n&lt;li&gt;Морозостойкость: пенопласт без проблем выдерживает полсотни циклов замораживания и оттаивания.&lt;/li&gt;\n&lt;li&gt;Срок службы около 80 лет: стройматериал не гниет и не портится грызунами.&lt;/li&gt;\n&lt;li&gt;Удобство транспортирования.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;Пенопласт рекомендуется хранить в сухом, темном, отапливаемом помещении. Беречь от воздействия ультрафиолета, от контакта с химическими соединениями и нагревательными приборами.&lt;/p&gt;','','80','','',''),(681,1,'Пенопласт ППС8-Р-А 50x1000x1200 мм','&lt;p&gt;&lt;strong&gt;Пенопласт ППС8-Р-А&lt;/strong&gt; — ячеистая вспененная пластмасса, которая обеспечивает теплоизоляцию, поглощает воздушные и конструкционные шумы. Выпускается в пластинах прямоугольной формы. Монтируется на внутренние стены и перегородки, полы, потолки, перекрытия, лоджии и балконы, скатные крыши.&lt;/p&gt;\n&lt;p&gt;Длина материала 1,2 м, ширина — 1 м (площадь покрытия 1,2 м²), толщина — 50 мм. Страна производства — Россия.&lt;/p&gt;\n&lt;h3&gt;Особенности и преимущества&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Малый вес: практически не нагружаются конструкции.&lt;/li&gt;\n&lt;li&gt;Быстрый монтаж: листы легко режутся ножом.&lt;/li&gt;\n&lt;li&gt;Морозостойкость: пенопласт без проблем выдерживает полсотни циклов замораживания и оттаивания.&lt;/li&gt;\n&lt;li&gt;Срок службы около 80 лет: стройматериал не гниет и не портится грызунами.&lt;/li&gt;\n&lt;li&gt;Удобство транспортирования.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;p&gt;Пенопласт рекомендуется хранить в сухом, темном, отапливаемом помещении. Беречь от воздействия ультрафиолета, от контакта с химическими соединениями и нагревательными приборами.&lt;/p&gt;','','80','','',''),(682,1,'Изоляция отражающая 3мм ВПЭ/лавсан, 15 м2 ','&lt;p&gt;&lt;strong&gt;Изоляция отражающая (3 мм)&lt;/strong&gt; применяется при утеплении помещений изнутри и снаружи. Основа изоляции — вспененный полиэтилен, покрытый с одной стороны слоем фольги. С ее помощью утепляются стены, кровля, теплые полы, изолируются трубопроводы и вентиляционные системы. Общая площадь рулона — 15 м^2^. Материал производится в России.&lt;/p&gt;\n&lt;h3&gt;Преимущества&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Низкая теплопроводность благодаря большому содержанию воздуха в пузырьках полиэтилена и фольгированному покрытию, отражающему тепловые лучи.&lt;/li&gt;\n&lt;li&gt;Высокие показатели звукоизоляции, паронепроницаемость.&lt;/li&gt;\n&lt;li&gt;Легкость и небольшая толщина материала.&lt;/li&gt;\n&lt;li&gt;Устойчивость к воздействию высоких температур, пожаробезопасность.&lt;/li&gt;\n&lt;li&gt;Стойкость к влаге и биологическим воздействиям.&lt;/li&gt;\n&lt;li&gt;Простота монтажа: разрезанные по размеру полосы изоляции крепятся при помощи степлера, стыки проклеиваются металлическим скотчем.&lt;/li&gt;\n&lt;/ul&gt;','','60','','',''),(683,1,'Угловая насадка Рolynor для напыления','&lt;p&gt;&lt;strong&gt;Угловая насадка Рolynor для напыления&lt;/strong&gt; применяется при утеплении горизонтальных поверхностей — полов или потолков. Аксессуар крепится на кончик монтажного пистолета и изменяет направление распыления пенополиуретанового утеплителя. Это позволяет не наклонять баллон с пеной и оставлять его в положении «дном вверх». Пластиковая насадка, изменяя угол распыления на 90°, позволяет нанести состав без выхода газа-вытеснителя, сохраняя правильное положение баллона.&lt;/p&gt;\n&lt;h3&gt;Особенности&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Угловая насадка изготавливается из пластика.&lt;/li&gt;\n&lt;li&gt;Предназначена для применения с фирменными баллонами Рolynor.&lt;/li&gt;\n&lt;li&gt;Используется при утеплении труднодоступных мест, потолков и полов снизу.&lt;/li&gt;\n&lt;li&gt;После окончания работы промывается вместе с монтажным пистолетом.&lt;/li&gt;\n&lt;/ul&gt;','','200','','',''),(684,1,'Очиститель Polynor Cleaner, 500 мл','&lt;p&gt;&lt;strong&gt;Очиститель POLYNOR CLEANER&lt;/strong&gt; представляет собой чистящее средство аэрозольного типа, применяемое во время строительных и отделочных работ. Состав на основе метилацетата эффективно удаляет незатвердевшие остатки утеплителя и монтажной пены, оставшиеся на инструментах и обрабатываемых поверхностях. При помощи POLYNOR CLEANER можно очистить пистолет для НПУ изнутри и снаружи, а также спецодежду после завершения работы с утеплителем. Страна производства — Россия.&lt;/p&gt;\n&lt;h3&gt;Преимущества очистителя&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Мгновенная очистка загрязненных поверхностей.&lt;/li&gt;\n&lt;li&gt;Простота применения.&lt;/li&gt;\n&lt;li&gt;Удобная емкость.&lt;/li&gt;\n&lt;/ul&gt;','','80','','',''),(685,1,'Ветро-влагоизоляция A, 70 м²','&lt;p&gt;&lt;strong&gt;Ветро-влагоизоляция A&lt;/strong&gt; с прямым краем предназначена для защиты утеплителя от выветривания и атмосферных осадков при устройстве вентфасадов, утепленных перекрытий, утепленной скатной кровли. Изготовлена из полипропилена. Материал экологичен, устойчив к неблагоприятным внешним факторам, не подвержен биоразложению. Площадь — 15 м². Страна производства — Россия.&lt;/p&gt;','','50','','',''),(686,1,'Гидро-пароизоляция Axton (d) 15 м²','&lt;p&gt;&lt;strong&gt;Гидро-пароизоляция Axton&lt;/strong&gt; применяется в качестве подкровельной изоляции для защиты скатных крыш; универсальной гидроизоляции для защиты кровли, стен и перекрытий с внутренней стороны. Основа — полимерная ткань, ламинированная защитной пленкой с интегрированной влагостойкой монтажной лентой для герметизации стыков, отделка края прямая. Продукт служит универсальной пароизоляцией для всех видов утепленных ограждающих конструкций: кровли, стены, перекрытия (с внутренней стороны). Производится в России.&lt;/p&gt;\r\n&lt;p&gt;Размеры мембраны для расчетов требуемого количества: ширина — 150 см, общая площадь — 15 м², площадь укрывания — до 13 м².&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Гидро-пароизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Неутепленные скатные кровли и утепленные мансарды.&lt;/li&gt;\r\n&lt;li&gt;Утепленные стены.&lt;/li&gt;\r\n&lt;li&gt;Утепленные межэтажные, цокольные и чердачные перекрытия.&lt;/li&gt;\r\n&lt;li&gt;Плоские кровли.&lt;/li&gt;\r\n&lt;li&gt;Цементные стяжки во влажных помещениях.&lt;/li&gt;\r\n&lt;/ul&gt;','','50','','',''),(687,1,'Гидро-пароизоляция Axton (d) 35 м²','&lt;p&gt;&lt;strong&gt;Гидро-пароизоляция Axton&lt;/strong&gt; применяется в качестве подкровельной изоляции для защиты скатных крыш; универсальной гидроизоляции для защиты кровли, стен и перекрытий с внутренней стороны. Основа — полимерная ткань, ламинированная защитной пленкой с интегрированной влагостойкой монтажной лентой для герметизации стыков, отделка края прямая. Продукт служит универсальной пароизоляцией для всех видов утепленных ограждающих конструкций: кровли, стены, перекрытия (с внутренней стороны). Производится в России.&lt;/p&gt;\r\n&lt;p&gt;Размеры мембраны для расчетов требуемого количества: ширина — 150 см, общая площадь — 35 м², площадь укрывания — до 31 м².&lt;/p&gt;\r\n&lt;h3&gt;Использование&lt;/h3&gt;\r\n&lt;p&gt;Гидро-пароизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Неутепленные скатные кровли и утепленные мансарды.&lt;/li&gt;\r\n&lt;li&gt;Утепленные стены.&lt;/li&gt;\r\n&lt;li&gt;Утепленные межэтажные, цокольные и чердачные перекрытия.&lt;/li&gt;\r\n&lt;li&gt;Плоские кровли.&lt;/li&gt;\r\n&lt;li&gt;Цементные стяжки во влажных помещениях.&lt;/li&gt;\r\n&lt;/ul&gt;','','20','','',''),(688,1,'Пароизоляция B, 70 м²','&lt;p&gt;Пароизоляция B применяется для защиты утеплителя от пара и намокания при устройстве вентфасадов, утепленных перекрытий, утепленной скатной кровли. Полотно имеет прямой край, поставляется в рулонах. Площадь — 70 м². Производится в России. Материал имеет базовый уровень качества. При работе с материалом необходимо обращаться аккуратно, не допуская разрывов.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Используется в следующих направлениях:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Потолок;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Неэксплуатируемые чердачные помещения;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Оборудованные чердачные помещения (в два слоя);&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Обшивка стены.&lt;/p&gt;\r\n&lt;p&gt;Подходящую паропроницаемую мембрану удобнее выбирать в торговом зале гипермаркета «Леруа Мерлен». У нас вы сможете своими глазами рассмотреть каждую из представленных моделей изоляции, уточнить назначение и параметры. Наши консультанты помогут сделать выбор и расскажут об особенностях монтажа.&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;/ul&gt;','','25','','',''),(689,1,'Гидро-пароизоляция Axton (d) 70 м²','&lt;p&gt;&lt;strong&gt;Гидро-пароизоляция Axton&lt;/strong&gt; применяется в качестве подкровельной изоляции для защиты скатных крыш; универсальной гидроизоляции для защиты кровли, стен и перекрытий с внутренней стороны. Основа — полимерная ткань, ламинированная защитной пленкой с интегрированной влагостойкой монтажной лентой для герметизации стыков, отделка края прямая. Продукт защищает утеплитель и ограждающие конструкции стен и кровель от проникновения водяных паров из отапливаемых помещений. Производится в России.&lt;/p&gt;\r\n&lt;p&gt;Размеры мембраны для расчетов требуемого количества: ширина — 150 см, общая площадь — 70 м², площадь укрывания — до 63 м².&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Гидро-пароизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Неутепленные скатные кровли и утепленные мансарды.&lt;/li&gt;\r\n&lt;li&gt;Утепленные стены.&lt;/li&gt;\r\n&lt;li&gt;Утепленные межэтажные, цокольные и чердачные перекрытия.&lt;/li&gt;\r\n&lt;li&gt;Плоские кровли.&lt;/li&gt;\r\n&lt;li&gt;Цементные стяжки во влажных помещениях.&lt;/li&gt;\r\n&lt;/ul&gt;','','20','','',''),(690,1,'Ветро-влагоизоляция Axton (a) 15 м²','&lt;p&gt;&lt;strong&gt;Ветро-влагоизоляция Axton&lt;/strong&gt; с прямым краем предназначена для защиты утепленных скатных крыш, стен, перекрытий и вентилируемых фасадов с внешней стороны. Изготовлена из нетканого материала из полипропилена с интегрированной влагостойкой монтажной лентой для герметизации стыков. Мембрана надежно защищает утеплитель и элементы кровли и стен от атмосферной влаги и конденсата. Материал экологичен, устойчив к неблагоприятным внешним факторам, не подвержен биоразложению. Ширина — 150 см, общая площадь — 15 м². Страна производства — Россия.&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Ветро-влагоизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Утепленные скатные крыши с 2 вентиляционными зазорами (с наклоном ≥40º).&lt;/li&gt;\r\n&lt;li&gt;Утепленные стены малоэтажных зданий.&lt;/li&gt;\r\n&lt;li&gt;Вентфасады многоэтажных зданий.&lt;/li&gt;\r\n&lt;li&gt;Утепленные цокольные и чердачные перекрытия.&lt;/li&gt;\r\n&lt;/ul&gt;','','40','','',''),(691,1,'Гидро-пароизоляция D, 70 м²','&lt;p&gt;&lt;strong&gt;Гидро-пароизоляция&lt;/strong&gt; применяется в качестве универсальной пароизоляции для всех видов ограждающих конструкций. Основа — полиэтилен и полипропилен, отделка края прямая. Производится в России.&lt;/p&gt;\r\n&lt;p&gt;Размеры мембраны для расчетов требуемого количества: площадь — 70 м².&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Потолок.&lt;/li&gt;\r\n&lt;li&gt;Неэксплуатируемые чердачные помещения.&lt;/li&gt;\r\n&lt;li&gt;Обшивка стены.&lt;/li&gt;\r\n&lt;li&gt;Пол и стена.&lt;/li&gt;\r\n&lt;/ul&gt;','','15','','',''),(692,1,'Ветро-влагоизоляция Axton (a) 70 м²','&lt;p&gt;&lt;strong&gt;Ветро-влагоизоляция Axton&lt;/strong&gt; с прямым краем предназначена для защиты утепленных скатных крыш, стен, перекрытий и вентилируемых фасадов с внешней стороны. Изготовлена из нетканого материала из полипропилена с интегрированной влагостойкой монтажной лентой для герметизации стыков. Мембрана надежно защищает утеплитель и элементы кровли и стен от атмосферной влаги и конденсата. Материал экологичен, устойчив к неблагоприятным внешним факторам, не подвержен биоразложению. Ширина — 150 см, общая площадь — 70 м², площадь укрывания — до 63 м². Страна производства — Россия.&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Ветро-влагоизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Утепленные скатные крыши с 2 вентиляционными зазорами (с наклоном ≥40º).&lt;/li&gt;\r\n&lt;li&gt;Утепленные стены малоэтажных зданий.&lt;/li&gt;\r\n&lt;li&gt;Вентфасады многоэтажных зданий.&lt;/li&gt;\r\n&lt;li&gt;Утепленные цокольные и чердачные перекрытия.&lt;/li&gt;\r\n&lt;/ul&gt;','','10','','',''),(693,1,'Пароизоляция Axton (b) 35 м²','&lt;p&gt;&lt;strong&gt;Пароизоляция Axton&lt;/strong&gt; применяется для защиты утепленных крыш, стен и перекрытий с внутренней стороны. Дополнительно защищает утеплитель и ограждающие конструкции стен и кровель от проникновения водяных паров из отапливаемых помещений. Высокие эксплуатационные свойства обеспечивает материал мембраны — нетканое полотно из полипропилена, ламинированное защитной пленкой с интегрированной влагостойкой монтажной лентой для герметизации стыков. Полотно имеет прямой край, поставляется в рулонах. Ширина — 150 см, общая площадь — 35 м², площадь укрывания — до 31 м². Производится в России.&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Пароизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Утепленные стены.&lt;/li&gt;\r\n&lt;li&gt;Утепленные мансарды.&lt;/li&gt;\r\n&lt;li&gt;Утепленные межэтажные перекрытия.&lt;/li&gt;\r\n&lt;li&gt;Межкомнатные перегородки.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(694,1,'Пароизоляция Axton (b) 70 м²','&lt;p&gt;&lt;strong&gt;Пароизоляция Axton&lt;/strong&gt; применяется для защиты утепленных крыш, стен и перекрытий с внутренней стороны. Дополнительно служит универсальной пароизоляцией для всех видов утепленных ограждающих конструкций: кровли, стены, перекрытия (с внутренней стороны). Высокие эксплуатационные свойства обеспечивает материал мембраны — нетканое полотно из полипропилена, ламинированное защитной пленкой с интегрированной влагостойкой монтажной лентой для герметизации стыков. Полотно имеет прямой край, поставляется в рулонах. Ширина — 150 см, общая площадь — 70 м², площадь укрывания — до 63 м². Производится в России.&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Пароизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Утепленные стены.&lt;/li&gt;\r\n&lt;li&gt;Утепленные мансарды.&lt;/li&gt;\r\n&lt;li&gt;Утепленные межэтажные перекрытия.&lt;/li&gt;\r\n&lt;li&gt;Межкомнатные перегородки.&lt;/li&gt;\r\n&lt;/ul&gt;','','20','','',''),(695,1,'Ветро-влагоизоляционная мембрана Axton 70 м²','&lt;p&gt;&lt;strong&gt;Ветро-влагоизоляционная мембрана Axton&lt;/strong&gt; укладывается с внешней стороны при утеплении крыш, стен и перекрытий, обустройстве вентилируемых фасадов. Покрытие с прямыми краями площадью 70 м² и шириной 1,5 м способно защитить утеплитель, конструктивные элементы кровли и стен площадью до 63 м² от атмосферной влаги и проникновения холодного воздуха. Не дает образовываться конденсату, при этом не препятствует выведению водяных паров из утеплителя.&lt;/p&gt;\r\n&lt;p&gt;Супердиффузионная мембрана с двух сторон снабжена защитным нетканым слоем из полипропилена, а также влагостойкой монтажной лентой, обеспечивающей надежную герметизацию стыков. Производится в России.&lt;/p&gt;\r\n&lt;h4&gt;Область применения&lt;/h4&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Утепление скатных крыш, имеющих 1 вентиляционный зазор (наклон 15°).&lt;/li&gt;\r\n&lt;li&gt;Строительство утепленных мансард.&lt;/li&gt;\r\n&lt;li&gt;Организация утепления стен малоэтажных зданий.&lt;/li&gt;\r\n&lt;li&gt;Утепление цокольных и чердачных перекрытий.&lt;/li&gt;\r\n&lt;li&gt;Обустройство вентфасадов многоэтажных зданий.&lt;/li&gt;\r\n&lt;/ul&gt;','','20','','',''),(696,1,'Пароизоляция Axton (b) 15 м²','&lt;p&gt;&lt;strong&gt;Пароизоляция Axton&lt;/strong&gt; применяется для защиты утепленных крыш, стен и перекрытий с внутренней стороны. Дополнительно защищает утеплитель и ограждающие конструкции стен и кровель от проникновения водяных паров из отапливаемых помещений. Высокие эксплуатационные свойства обеспечивает материал мембраны — нетканое полотно из полипропилена, ламинированное защитной пленкой с интегрированной влагостойкой монтажной лентой для герметизации стыков. Полотно имеет прямой край, поставляется в рулонах. Ширина — 150 см, общая площадь — 15 м², площадь укрывания — до 13 м². Производится в России.&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Пароизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Утепленные стены.&lt;/li&gt;\r\n&lt;li&gt;Утепленные мансарды.&lt;/li&gt;\r\n&lt;li&gt;Утепленные межэтажные перекрытия.&lt;/li&gt;\r\n&lt;li&gt;Межкомнатные перегородки.&lt;/li&gt;\r\n&lt;/ul&gt;','','70','','',''),(697,1,'Ветро-влагоизоляция Axton (a) 35 м²','&lt;p&gt;&lt;strong&gt;Ветро-влагоизоляция Axton&lt;/strong&gt; с прямым краем предназначена для защиты утепленных скатных крыш, стен, перекрытий и вентилируемых фасадов с внешней стороны. Изготовлена из нетканого материала из полипропилена с интегрированной влагостойкой монтажной лентой для герметизации стыков. Мембрана надежно защищает утеплитель и элементы кровли и стен от атмосферной влаги и конденсата. Материал экологичен, устойчив к неблагоприятным внешним факторам, не подвержен биоразложению. Ширина — 150 см, общая площадь — 35 м², площадь укрывания — до 31 м². Страна производства — Россия.&lt;/p&gt;\r\n&lt;h4&gt;Использование&lt;/h4&gt;\r\n&lt;p&gt;Ветро-влагоизоляция используется в следующих направлениях:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Утепленные скатные крыши с 2 вентиляционными зазорами (с наклоном ≥40º).&lt;/li&gt;\r\n&lt;li&gt;Утепленные стены малоэтажных зданий.&lt;/li&gt;\r\n&lt;li&gt;Вентфасады многоэтажных зданий.&lt;/li&gt;\r\n&lt;li&gt;Утепленные цокольные и чердачные перекрытия.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(698,1,'Звукоизоляция Knauf АкустиKnauf 50 мм, 6 м²','&lt;p&gt;&lt;strong&gt;Шумоизоляция Knauf&lt;/strong&gt; используется для повышения шумоизоляционных свойств потолков и стен внутри помещения. Основной материал — каменная вата. В одной упаковке элементы общей площадью 6 м². Материал производится в России.&lt;/p&gt;','','70','','',''),(699,1,'Вибродемпфирующая лента NoiseBlock70 12000x70x2 мм','&lt;p&gt;&lt;strong&gt;Вибродемпфирующая лента NoiseBlock70&lt;/strong&gt; предназначается для абсорбции ударного шума внутри помещения. Применяется для повышения звукоизоляционных свойств потолков, стен или полов. Самоклеящаяся полимерная лента имеет прямые края, легко и быстро монтируется.&lt;/p&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Плотность материала составляет 2,8 кг/м³.&lt;/li&gt;\r\n&lt;li&gt;Одной упаковки хватает на формирование звукоизоляционного слоя общей площадью 0,84 м².&lt;/li&gt;\r\n&lt;li&gt;Лента снижает уровень акустического шума на 49 дБ, общий индекс звукоизоляции составляет 30 дБ.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3&gt;Размеры ленты&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Толщина — 2 мм.&lt;/li&gt;\r\n&lt;li&gt;Длина в рулоне — 12 м.&lt;/li&gt;\r\n&lt;li&gt;Ширина — 0,07 м.&lt;/li&gt;\r\n&lt;/ul&gt;','','60','','',''),(700,1,'Набор для установки Тихий дом №8, 10.8 м²','&lt;p&gt;Набор для установки Тихий дом – часть системы дополнительной звукоизоляции стен Тихий Дом толщиной 53 мм, защищающая от бытовых шумов: громкого голоса, лая собак, теле-радио аппаратуры. Снижение шума при применении данного решения составляет до 60%, или до 12 Дб.&lt;/p&gt;\r\n&lt;p&gt;В набор для установки входят все необходимые комплектующие для самостоятельного монтажа системы «Тихий Дом».&lt;/p&gt;\r\n&lt;p&gt;В состав наборов входят (в разном количестве для разных типов наборов):&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Направляющие потолочные профили (ППН) 18 х 20 мм&lt;/li&gt;\r\n&lt;li&gt;Потолочные профили (ПП) 47 х 17 мм&lt;/li&gt;\r\n&lt;li&gt;Подвесы&lt;/li&gt;\r\n&lt;li&gt;Одноуровневые соединители профилей («крабы»)&lt;/li&gt;\r\n&lt;li&gt;Удлинители вертикальных профилей&lt;/li&gt;\r\n&lt;li&gt;Герметик акриловый&lt;/li&gt;\r\n&lt;li&gt;Лента уплотнительная&lt;/li&gt;\r\n&lt;li&gt;Дюбель-гвозди 6 х 40 мм&lt;/li&gt;\r\n&lt;li&gt;Саморезы ГКЛ-металл 3,5 х 25 мм&lt;/li&gt;\r\n&lt;li&gt;Шурупы «клопы» 4,2 х 13 мм&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(701,1,'Звукоизоляционная лента Вибростек-М100, 30 м','&lt;p&gt;Вибростек-М100 - Звукоизоляционная лента для дополнительной звукоизоляции. Применяется при проведении работ по шумо-звукоизоляциии в местах стыков пола/потолка и стен, и в местах соединений шумоизоляцонных панелей. Представляет собой ленту из стеклохолста в рулоне, ширина рулона 100 мм, длина рулона 30 м, толщина ленты 4 мм. Изоляция шума обеспечивается за счет пористо-волокнистой структуры материала.&lt;/p&gt;','','40','','',''),(702,1,'Набор для установки Тихий дом №4, 5.4 м²','&lt;p&gt;Набор для установки Тихий дом – часть системы дополнительной звукоизоляции стен Тихий Дом толщиной 53 мм, защищающая от бытовых шумов: громкого голоса, лая собак, теле-радио аппаратуры. Снижение шума при применении данного решения составляет до 60%, или до 12 Дб.&lt;/p&gt;\r\n&lt;p&gt;В набор для установки входят все необходимые комплектующие для самостоятельного монтажа системы «Тихий Дом».&lt;/p&gt;\r\n&lt;p&gt;В состав наборов входят (в разном количестве для разных типов наборов):&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Направляющие потолочные профили (ППН) 18 х 20 мм&lt;/li&gt;\r\n&lt;li&gt;Потолочные профили (ПП) 47 х 17 мм&lt;/li&gt;\r\n&lt;li&gt;Подвесы&lt;/li&gt;\r\n&lt;li&gt;Одноуровневые соединители профилей («крабы»)&lt;/li&gt;\r\n&lt;li&gt;Удлинители вертикальных профилей&lt;/li&gt;\r\n&lt;li&gt;Герметик акриловый&lt;/li&gt;\r\n&lt;li&gt;Лента уплотнительная&lt;/li&gt;\r\n&lt;li&gt;Дюбель-гвозди 6 х 40 мм&lt;/li&gt;\r\n&lt;li&gt;Саморезы ГКЛ-металл 3,5 х 25 мм&lt;/li&gt;\r\n&lt;li&gt;Шурупы «клопы» 4,2 х 13 мм&lt;/li&gt;\r\n&lt;/ul&gt;','','10','','',''),(719,1,'Мастика для гидроизоляции Weber Vetonit Weber.Tec 822, цвет розовый','&lt;p&gt;Мастика Weber.Tec 822 — готовая к употреблению суспензия на основе синтетических веществ. С ее помощью производится гидроизоляция стен и полов и другие внутренние и наружные работы. Наносится валиком или кистью, быстро высыхает. Рекомендуется купить состав для влажных помещений (душевых, туалетных и ванных комнатах, балконах и террасах) под облицовочную плитку и «теплый пол». Состав окрашен в розовый цвет, что помогает легко оценить качество нанесения. Цена указана за пластиковое ведерко массой 8 кг.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокая эластичность;&lt;/li&gt;\r\n&lt;li&gt;водонепроницаемость;&lt;/li&gt;\r\n&lt;li&gt;простое нанесение;&lt;/li&gt;\r\n&lt;li&gt;быстрое высыхание.&lt;/li&gt;\r\n&lt;/ul&gt;','','25','','',''),(703,1,'Демпферная лента 10x100 мм x 15 м','&lt;p&gt;Лента демпферная – важный элемент при обустройстве теплого пола. Это долговечный и экономичный материал с прекрасными звуко-, термо- и влагоизоляционными свойствами. Чаще всего он применяется для герметизации зазоров и щелей и уплотнения стыков. Такая лента значительно снижает тепловые затраты через боковые стены здания, так как обеспечивается тепловая изоляция пола. Также она отличается устойчивостью к перепадам температур и воздействию прямых солнечных лучей.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокий коэффициент звукопоглощения;&lt;/li&gt;\r\n&lt;li&gt;низкая теплопроводность;&lt;/li&gt;\r\n&lt;li&gt;отличное качество;&lt;/li&gt;\r\n&lt;li&gt;демократичная цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','40','','',''),(704,1,'Вибродемпфирующая лента NoiseBlock30 12000x30x2 мм','&lt;p&gt;&lt;strong&gt;Вибродемпфирующая лента NoiseBlock30&lt;/strong&gt; предназначается для абсорбции ударного шума внутри помещения. Применяется для повышения звукоизоляционных свойств потолков, стен или полов. Самоклеящаяся полимерная лента имеет прямые края, легко и быстро монтируется.&lt;/p&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Плотность материала составляет 2,8 кг/м³.&lt;/li&gt;\r\n&lt;li&gt;Одной упаковки хватает на формирование звукоизоляционного слоя общей площадью 0,36 м².&lt;/li&gt;\r\n&lt;li&gt;Лента снижает уровень акустического шума на 49 дБ, общий индекс звукоизоляции составляет 30 дБ.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3&gt;Размеры ленты&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Толщина — 2 мм.&lt;/li&gt;\r\n&lt;li&gt;Длина в рулоне — 12 м.&lt;/li&gt;\r\n&lt;li&gt;Ширина — 0,03 м.&lt;/li&gt;\r\n&lt;/ul&gt;','','60','','',''),(705,1,'Панель звукоизоляционная Тихий Дом 1.5x0.9 м','&lt;p&gt;«Тихий Дом» — система дополнительной звукоизоляции стен толщиной 45 мм, защищающая от бытовых шумов: громкого голоса, лая собак, теле-радио аппаратуры. Снижение шума при применении данного решения составляет до 60%, или до 12 Дб. Преимуществом системы является простота и скорость монтажа.&lt;/p&gt;\r\n&lt;p&gt;Главный элемент системы — звукоизоляционные панели «Тихий дом», размером 1500 х 900 мм и толщиной 45 мм, которые крепятся на металлический каркас из набора для установки. Панели «Тихий дом» состоят из акустического листа и плиты минеральной ваты высокой плотности, склеенных между собой. Минеральная вата размещена на листе с необходимыми отступами от краев листа для максимального удобства монтажа. Панель выдерживает нагрузку до 65 кг на один дюбель-бабочку, что дает возможность повесить на стену большой телевизор или шкаф для посуды.&lt;/p&gt;\r\n&lt;p&gt;Набор для установки Тихий дом №4, 5.4 м² - это набор комплектующих для установки плит Тихий дом площадью 5,4м2.\r\nНапример, для звукоизоляции стен площадью 20м2 вам потребуется два набора для установки Тихий дом №8, 10.8 м².\r\nНаборы для монтажа приобретаются отдельно.&lt;/p&gt;\r\n&lt;p&gt;В состав наборов входят (в разном количестве для разных типов наборов):&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Направляющие потолочные профили (ППН) 18 х 20 мм&lt;/li&gt;\r\n&lt;li&gt;Потолочные профили (ПП) 47 х 17 мм&lt;/li&gt;\r\n&lt;li&gt;Подвесы&lt;/li&gt;\r\n&lt;li&gt;Одноуровневые соединители профилей («крабы»)&lt;/li&gt;\r\n&lt;li&gt;Удлинители вертикальных профилей&lt;/li&gt;\r\n&lt;li&gt;Герметик акриловый&lt;/li&gt;\r\n&lt;li&gt;Лента уплотнительная&lt;/li&gt;\r\n&lt;li&gt;Дюбель-гвозди 6 х 40 мм&lt;/li&gt;\r\n&lt;li&gt;Саморезы ГКЛ-металл 3,5 х 25 мм&lt;/li&gt;\r\n&lt;li&gt;Шурупы «клопы» 4,2 х 13 мм&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(720,1,'Герметик эластичный Glims GreenResin, 7 кг','&lt;p&gt;Многоцелевой эластичный герметик, изготовленный на основе полимерного латекса, станет залогом качественного ремонта. После его использования на полах, потолках, стенах помещений разного типа образуется гидроизоляционный слой. Благодаря инновационному составу эта масса легко наносится не только на сухие, но и на влажные поверхности. Кроме того, герметик устойчив к температурным перепадам, способен выдержать прямое давление воды до 60 м, а также замораживание до 50 циклов. Экологически безопасен. Купить этот универсальный материал можно на нашем сайте. Цена вас порадует!&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Высокая эластичность.&lt;/li&gt;\r\n&lt;li&gt;Морозо- и термостойкость.&lt;/li&gt;\r\n&lt;li&gt;Повышенная водонепроницаемость.&lt;/li&gt;\r\n&lt;li&gt;Простота нанесения на любые поверхности.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(706,1,'Звукоизоляция для пола Пенотерм НПП ЛЭ 5 мм, 26 м²','&lt;p&gt;Пенотерм НПП ЛЭ(Э) - виброшумоизоляционный рулонный материал, изготовленный из вспененного полипропилена с добавлением пластификаторов, антипиренов и других технологических добавок. Используется в качестве вибродемпфирующей прокладки в конструкциях «плавающих полов» для улучшения изоляции ударного и воздушного шума.&lt;/p&gt;\r\n&lt;p&gt;Материал имеет гибкий скелет, закрытую ячеистую структуру, в его порах содержится воздух, который и гасит энергию удара и вибрации, снижая тем самым уровень ударного и воздушного шума.&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;снижает напряжения, воздействующие на основание;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;компенсирует небольшие неровности основания;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;непроницаемый для жидкостей;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;сохраняет оптимальные физико-механические и динамические характеристики на протяжении 50 лет и более.&lt;/p&gt;\r\n&lt;p&gt;Индекс улучшения изоляции ударного шума до 22 дБ. Этот показатель рассчитан для «плавающих» стяжек с поверхностной плотностью 100 кг/м², уложенных на Пенотерм НПП ЛЭ(Э).&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Монтаж материала:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Очистить от грязи, мусора и посторонних веществ плиту перекрытия помещения, а также стены на высоту 150 мм для плотного прилегания вибродемпфирующей прокладки Пенотерм и демпферной ленты к основанию пола и стен. Очистка и выравнивание поверхности позволяют избежать повреждения звукоизоляционного полотна и появления звуковых мостиков.&lt;/p&gt;\r\n&lt;p&gt;После проведения подготовительных работ, материал Пенотерм НПП ЛЭ укладывается по всей поверхности плиты перекрытия. Укладка материала производится «стык в стык». Стыки могут проклеиваться скотчем или другими клеящимися материалами. В помещениях с повышенными требованиями к гидроизоляции стыки проклеиваются водозащитной армированной клейкой лентой. Далее по звукоизоляционному слою Пенотерм устраивают стяжку, выполненную из цементно-песчаного раствора или плит ГВЛ (ГКЛ).&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;/ul&gt;','','25','','',''),(707,1,'Герметик звукоизоляционный Вибросил 290мл','&lt;p&gt;Герметик ВИБРОСИЛ - звукоизоляционный силиконовый герметик для дополнительной изоляции и герметизации стыков и соединений при проведении работ по шумо-звукоизоляциии.&lt;/p&gt;\r\n&lt;p&gt;Герметик обеспечивает высокую виброизоляцию стыков между строительными конструкциями. Снижает распространение структурного шума по ним. Основу герметика составляют силиконовые смолы и кремнийорганические модификаторы.&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Обеспечивает надежную герметизацию независимо от толщины шва;&lt;/li&gt;\r\n&lt;li&gt;не является агрессивной средой;&lt;/li&gt;\r\n&lt;li&gt;устойчив к изменениям влажности, колебаниям температур и солнечному излучению;&lt;/li&gt;\r\n&lt;li&gt;хорошие адгезионные свойства с любыми видами поверхностей;&lt;/li&gt;\r\n&lt;li&gt;температура применения от -10 °С до +40 °С;&lt;/li&gt;\r\n&lt;li&gt;температура эксплуатации от -40 °С до +150 °С&lt;/li&gt;\r\n&lt;/ul&gt;','','80','','',''),(708,1,'Панель звукоизоляционная ЗИПС-III Ультра 1.2x0.6 м','&lt;p&gt;Панель ЗИПС - Звукоизолирующая панельная система для дополнительной звукоизоляции стен и потолков толщиной 53 мм. Панель ЗИПС эффективна в отношении большинства бытовых шумов: речь, плач, лай собак, теле-радио аппаратура средней мощности, бытовой ударный шум. Снижение шума при применении панелей ЗИПС и соблюдении правил монтажа составляет до 80%.&lt;/p&gt;\r\n&lt;p&gt;Панель размером 1200х600 мм, крепится без дополнительных приспособлений - вам не понадобятся металлические профили или другие каркасные конструкции.&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Снижение шума до 80%;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Индекс дополнительной звукоизоляции воздушного шума ΔRw=11-15 дБ на стене Rw=50дБ;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Самая тонкая звукоизоляция с показателями до 65 дБ.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Комплект панели ЗИПС&lt;/strong&gt;&lt;br&gt;\r\nПанель ЗИПС состоит из пазогребневого гипсоволокнистого листа толщиной 20 мм и стекловолокнистой плиты толщиной 20 мм. Для опоры на стену или перекрытие в составе панели используются восемь опор - специальных виброизоляторов 48х48 мм, что усиливает звукоизоляционные свойства целой конструкции.&lt;br&gt;\r\nДля финишной отделки дополнительно следует приобрести &lt;a href=&quot;https://leroymerlin.ru/catalogue/gipsokarton/&quot;&gt;листы гипсокартона&lt;/a&gt; толщиной 12,5 мм. Толщина проекта звукоизоляции 53 мм.&lt;/p&gt;\r\n&lt;p&gt;В комплект панели шумоизоляции ЗИПС 3-Ультра входит необходимый набор крепежей (дюбеля и анкеры для крепления сэндвич панели из ГВЛ к стене/потолку, саморезы для крепления финишной панели из гипсокартона).&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Способ установки&lt;/strong&gt;&lt;br&gt;\r\nДо начала монтажных работ поверхность стен и потолка должна быть выровнена. По периметру помещения в местах стыка пола/потолка и стен в два слоя монтируется звукоизоляционная лента Вибростек в два слоя. Монтаж ленты на герметик вибросил 290. Применение ленты и герметика улучшают качество звукоизоляции конструкции.&lt;br&gt;\r\nМонтировать панели следует в шахматном порядке. Сначала на стену монтируется сэндвич панель толщиной 40 мм. На звукоизолирующую сэндвич панель в шахматном порядке монтировать финишный лист ГКЛ, толщиной 12,5 мм. Излишки звукоизоляционной ленты, выступающей за край, срезать.&lt;br&gt;\r\nПанели Зипс-III-Ультра монтируются исключительно через виброузлы, такой тип монтажа исключает жесткую связь между панелью и стеной через анкер или дюбель, и таким образом исключает появление звукового мостика. Сверлить панель ЗИПС вне узла крепления нельзя, потому что таким образом нарушится герметичность панели и испортятся её звукоизоляционные свойства.&lt;/p&gt;\r\n&lt;p&gt;Монтаж панелей удобнее вести снизу вверх, слева направо. У первой панели подрезаются гребни по короткой и длинной стороне, у следующих панелей первого ряда - только по длинной стороне. Непосредственно через виброузлы просверливаются отверстия в стене/потолке глубиной 60 мм. В полученные отверстия вставляются дюбели.&lt;br&gt;\r\nЕсли сэндвич-панель полностью размещается на поверхности стены – ее монтаж осуществляется только с помощью шести виброузлов крепления (центральные узлы не используются). Если стеновая панель подлежит обрезке – используются все доступные узлы крепления. При монтаже панелей на потолок дополнительно используются два центральных виброузла, в которые вставляются металлические анкерные винты. При закручивании головка винта утапливается в поверхность виброузла на 1-2 мм.&lt;br&gt;\r\nПанели стыкуются между собой посредством пазогребневого соединения, стык позволяет сохранить многослойность в местах стыка панелей, исключить образования прямого звукового мостика. Панели стягиваются между собой саморезами из комплекта крепежа. Отрезанные части панели длиной менее 250 мм не используются. Панели монтируют со смещением поперечных стыков в соседних рядах.&lt;br&gt;\r\nК полученной поверхности закрепляют финишный слой листов гипсокартона толщиной 12,5 мм. Которые, как и панели ЗИПС, крепятся в шахматном порядке в разбежку с помощью саморезов из комплекта крепежа. Швы заполняют виброакустическим силиконовым герметиком Вибросил.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Где можно использовать&lt;/strong&gt;&lt;br&gt;\r\nЗвукоизолирующую панель возможно использовать на стенах или потолках из бетона, блоков или кирпича, а также на плитах межэтажных перекрытий. Не рекомендуется монтировать панельную систему на конструкции толщиной менее 80 мм.&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(709,1,'Набор для установки Тихий дом №6, 8.1 м²','&lt;p&gt;Набор для установки Тихий дом – часть системы дополнительной звукоизоляции стен Тихий Дом толщиной 53 мм, защищающая от бытовых шумов: громкого голоса, лая собак, теле-радио аппаратуры. Снижение шума при применении данного решения составляет до 60%, или до 12 Дб.&lt;/p&gt;\r\n&lt;p&gt;В набор для установки входят все необходимые комплектующие для самостоятельного монтажа системы «Тихий Дом».&lt;/p&gt;\r\n&lt;p&gt;В состав наборов входят (в разном количестве для разных типов наборов):&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Направляющие потолочные профили (ППН) 18 х 20 мм&lt;/li&gt;\r\n&lt;li&gt;Потолочные профили (ПП) 47 х 17 мм&lt;/li&gt;\r\n&lt;li&gt;Подвесы&lt;/li&gt;\r\n&lt;li&gt;Одноуровневые соединители профилей («крабы»)&lt;/li&gt;\r\n&lt;li&gt;Удлинители вертикальных профилей&lt;/li&gt;\r\n&lt;li&gt;Герметик акриловый&lt;/li&gt;\r\n&lt;li&gt;Лента уплотнительная&lt;/li&gt;\r\n&lt;li&gt;Дюбель-гвозди 6 х 40 мм&lt;/li&gt;\r\n&lt;li&gt;Саморезы ГКЛ-металл 3,5 х 25 мм&lt;/li&gt;\r\n&lt;li&gt;Шурупы «клопы» 4,2 х 13 мм&lt;/li&gt;\r\n&lt;/ul&gt;','','17','','',''),(721,1,'Мастика для гибкой черепицы Технониколь №23 Фиксер, 3.6 кг','&lt;p&gt;Мастика для гибкой черепицы — многокомпонентная масса, предназначенная для проклеивания швов гибкой черепицы и склеивания других кровельных материалов на основе битума. Обеспечивает надежное сцепление с кирпичными, деревянными, бетонными, керамическими и металлическим основаниями. Перед применением на пористых поверхностях требует предварительной грунтовки битумным праймером. Выдерживает значительные перепады температур (от -20 С° до +40 С°).&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;хорошая сцепляемость со всеми типами битумной кровли;&lt;/li&gt;\r\n&lt;li&gt;минимальный расход.&lt;/li&gt;\r\n&lt;/ul&gt;','','45','','',''),(710,1,'Звуко-гидроизоляция Шуманет 100 Гидро 5 мм, 10 м²','&lt;p&gt;Шуманет 100 гидро – материал двойного назначения, позволяющий решить одновременно две задачи: обеспечить гидроизоляцию пола «плавающего» типа и повысить звукоизоляцию пола. Снижение шума при применении Шуманет 100 Гидро и соблюдении правил монтажа составляет до 50%.&lt;/p&gt;\r\n&lt;p&gt;Представляет собой многослойную стекловолоконную ткань с нанесенным на одну из его поверхностей слоем битумополимера. Размер рулона 10х1 м, толщина изоляции 5 мм. Индекс снижения ударного шума 24 дБ.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Преимущества:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Тонкий материал;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Влагостойкость;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Минимальное водопоглощение;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Высокий уровень звукоизоляции;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Отличная теплостойкость;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Простота применения;&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;Долговечность.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Инструкция по монтажу:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ol&gt;\r\n&lt;li&gt;Подготовить поверхность пола - очистить от стротиельного мусора.&lt;/li&gt;\r\n&lt;li&gt;Полотна Шуманет-100 Гидро раскатать битумным слоем вверх. Каждый рулон с одного из краев имеет напуск гидроизолирующего слоя битума шириной 100 мм для монтажа внахлест.&lt;/li&gt;\r\n&lt;li&gt;Материал Шуманет-100 Гидро заводится на стены и колонны выше уровня устраиваемой стяжки.&lt;/li&gt;\r\n&lt;li&gt;Для предотвращения сдвига во время устройства стяжки рекомендуется зафиксировать заведенные края на стенах и колоннах при помощи строительного фена или газовой горелки. Нахлесты материала аналогичным способом скрепляются между собой.&lt;/li&gt;\r\n&lt;li&gt;Коммуникации, проходящие через перекрытие, и прочие выступы необходимо также герметично обернуть материалом для исключения возникновения щелей и акустических мостиков.&lt;/li&gt;\r\n&lt;li&gt;После укладки звукоизоляционного материала Шуманет-100 Гидро выполняется цементно-песчаная стяжка толщиной 60 мм из пескобетона марки не ниже М-300.&lt;/li&gt;\r\n&lt;li&gt;Стяжка армируется металлической сеткой с размером ячейки 50 х 50 мм и диаметром прутка 4 мм. Сетка укладывается на высоту не менее 20 мм от нижнего уровня стяжки, а её элементы соединяются с перехлестом стыков 100 мм вязальной проволокой через каждые 200 мм.&lt;/li&gt;\r\n&lt;li&gt;При большой площади поверхности пола выравнивающая стяжка выполняется участками площадью до 30 м² с обязательным устройством деформационных швов.&lt;/li&gt;\r\n&lt;li&gt;После набора прочности стяжки кромочный слой подрезается строительным ножом. Образовавшийся шов заполняется герметиком Вибросил.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;/li&gt;\r\n&lt;/ul&gt;','','15','','',''),(711,1,'Демпферная лента 10x100 мм x 5 м','&lt;p&gt;Демпферная лента с сечением 10x100 мм — материал, который функционально выступает в качестве звуко- и теплоизоляции щелей и стыков между полом и стеной или ограждающими конструкциями. Часто используют в процессе устройства стяжки перед монтажом водяного или электрического теплого пола, так как является отличным компенсатором при температурном расширении. Для монтажа необходимо дополнительно купить жидкие гвозди, которые вместе со стяжкой основательно прижмут изделие к поверхности.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;устойчивость к воздействию влаги;&lt;/li&gt;\r\n&lt;li&gt;низкий коэффициент теплопроводности;&lt;/li&gt;\r\n&lt;li&gt;экологическая безопасность.&lt;/li&gt;\r\n&lt;/ul&gt;','','30','','',''),(712,1,'Звукоизоляция для пола Пенолон Акустик 5 мм, 23 м²','&lt;p&gt;Penolon Acoustic (Пенолон Акустик) – звукоизоляционная подложка в конструкцию &quot;плавающий пол&quot;. Применяется при устройстве стяжки пола для защиты от бытовых шумов: звуков шагов, передвижениях мебели.&lt;br&gt;\r\nПенолон Акустик - это современный материал на основе сшитого пенополиэтилена, который укладывается под стяжку и позволяет смягчить многие бытовые шумы, уменьшить шум от соседей и создать в помещении более комфортную, спокойную обстановку.&lt;br&gt;\r\nМатериал обладает устойчивостью к механическим нагрузкам и не теряет своих свойств под весом стяжки и предметов мебели.&lt;br&gt;\r\nПрименяется профессиональными строителями для снижения ударного шума в конструкциях межэтажных перекрытий.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Преимущества:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Материал устойчив к нагрузкам.&lt;/li&gt;\r\n&lt;li&gt;Снижает ударный шум. Высокие звукоизоляционные свойства (индекс снижения ударного шума 23-25 дБ.)&lt;/li&gt;\r\n&lt;li&gt;Обеспечивает гидроизоляцию.&lt;/li&gt;\r\n&lt;li&gt;100% экологичен.&lt;/li&gt;\r\n&lt;/ul&gt;','','23','','',''),(713,1,'Звукоизоляция NoiseBlock2a 600x500x2 10 шт.','&lt;p&gt;&lt;strong&gt;Звукоизоляция NoiseBlock2A&lt;/strong&gt; используется для повышения шумоизоляционных свойств потолков и стен внутри помещения. Назначение — поглощение воздушных и конструкционных шумов. Основной материал — полимер. В упаковке 10 элементов общей площадью 3 м². Материал производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Особенности звукоизоляции&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Снижает уровень акустического шума на 49 дБ.&lt;/li&gt;\r\n&lt;li&gt;Общий индекс шумоизоляции — 30 дБ.&lt;/li&gt;\r\n&lt;li&gt;Преимущество — удобство нарезки и нанесения.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3&gt;Размеры материала&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Толщина — 2 мм.&lt;/li&gt;\r\n&lt;li&gt;Длина — 0,6 м.&lt;/li&gt;\r\n&lt;li&gt;Ширина — 0,5 м.&lt;/li&gt;\r\n&lt;/ul&gt;','','21','','',''),(714,1,'Панель звукоизоляционная Knauf «Акуборд»','&lt;p&gt;Панели звукоизоляционные КНАУФ-Акуборд - материал для дополнительной звукоизоляции стен и перегородок. Применяется на стенах и перегородках из гипсовых блоков и газопенобетона толщиной до 100 мм. Снижение шума при применении панелей Knauf-Акуборд и соблюдении правил монтажа составляет до 60%.&lt;/p&gt;\r\n&lt;p&gt;Размер панели 1500х1200 мм, толщина панели 20 мм, индекс снижения шума от 5 до 9 дБ. Панель состоит из Knauf-листа и многослойного стеклохолста.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Монтаж панелей&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Панели монтируются непосредственно на стену или перегородку без дополнительного каркаса, монтируются с помощью саморезов с шагом 380 мм по горизонтали, 480 мм по вертикали и отступом от края панели минимум 30 мм. Колличество саморезов на одну полноформатную панель 16 шт.&lt;/p&gt;\r\n&lt;p&gt;Монтаж на перегородку или стену из гипсовых блоков осуществляется при помощи саморезов 4.2х65 мм без предварительного засверливания и применения дюбелей. Головки шурупов утапливается в поверхность листов на глубину около 1 мм с целью их последующего &lt;a href=&quot;https://leroymerlin.ru/catalogue/shpaklevki/&quot;&gt;шпаклевания&lt;/a&gt;.&lt;/p&gt;\r\n&lt;p&gt;Монтаж на перегородку или стену из пенобетона производится при помощи саморезова 4.2х65 мм и дюбеля 6х40 мм с предварительным засверливанием.&lt;/p&gt;\r\n&lt;p&gt;Для увеличения прочности финишной отделки с краев панели с открытом гипсовым сердечником рекомендуется снять фаску. По окончании монтажа произвести заделку стыков и мест расположения шурупов. Стыки с открытым гипсовым сердечником перед шпаклеванием рекомендуется &lt;a href=&quot;https://tver.leroymerlin.ru/catalogue/gruntovki/&quot;&gt;прогрунтовать&lt;/a&gt;. Швы листов заделываются с помощью шпаклевочной смеси с &lt;a href=&quot;https://leroymerlin.ru/catalogue/uplotnitelnaya-lenta-i-serpyanka-dlya-gipsokartona/&quot;&gt;армирующей лентой&lt;/a&gt;.&lt;/p&gt;\r\n&lt;p&gt;Последующая отделка выполняется в соответствии с технологией в зависимости от вида финишного покрытия стен.&lt;/p&gt;','','34','','',''),(715,1,'Вибродемпфирующий материал GB1.5 350x570x1.5 мм, 20 шт.','&lt;p&gt;&lt;strong&gt;Вибродемпфирующий материал GB1.5&lt;/strong&gt; используется для поглощения шума от канализации. Монтируется на канализационные трубы внутри помещений, снижает уровень акустического шума на 49 дБ.&lt;/p&gt;\r\n&lt;p&gt;Набор содержит 20 полимерных пластин звукоизоляции с прямыми краями общей площадью 40 м². Плотность — 2,1 кг/м³, общий индекс звукоизоляции — 25 дБ. Материал экологичный, легко монтируется. Производится в России.&lt;/p&gt;\r\n&lt;h3&gt;Размеры&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Толщина — 15 мм.&lt;/li&gt;\r\n&lt;li&gt;Длина — 0,57 м.&lt;/li&gt;\r\n&lt;li&gt;Ширина — 0,35 м.&lt;/li&gt;\r\n&lt;/ul&gt;','','23','','',''),(716,1,'Звукоизоляция Евроблок 20 мм','&lt;p&gt;Евроблок – листовой материал для тепло- и звукоизоляции, содержащий несколько слоев вспененного полиэтилена различной плотности и толщины. Применяется для звукоизоляции под подвесной потолок. Снижение бытового шума до 10%. Евроблок не выделяет токсичных веществ, не впитывает влагу и совместим с любыми поверхностями.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Преимущества:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;экологически чистый продукт&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;не утяжеляет строительные конструкции&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;легкий монтаж утеплителя&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;p&gt;срок службы более 50 лет&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Способ монтажа&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Поверхность монтажа предварительно подготовить, &lt;a href=&quot;https://alyansss.ru/stroymaterialy/sukhie-smesi-i-gruntovki/gruntovki/&quot;&gt;прогрунтовать&lt;/a&gt; в два слоя. Монтировать листы на потолок с помощью жидких гвоздей на спиртовой основе.&lt;/p&gt;\r\n&lt;/li&gt;\r\n&lt;/ul&gt;','','89','','',''),(717,1,'Вибродемпфирующая лента NoiseBlock50 1200x50x2мм','&lt;p&gt;&lt;strong&gt;Вибродемпфирующая лента NoiseBlock50&lt;/strong&gt; предназначается для абсорбции ударного шума внутри помещения. Применяется для повышения звукоизоляционных свойств потолков, стен или полов. Самоклеящаяся полимерная лента имеет прямые края, легко и быстро монтируется.&lt;/p&gt;\r\n&lt;h3&gt;Особенности&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Плотность материала составляет 2,8 кг/м³.&lt;/li&gt;\r\n&lt;li&gt;Одной упаковки хватает на формирование звукоизоляционного слоя общей площадью 0,6 м².&lt;/li&gt;\r\n&lt;li&gt;Лента снижает уровень акустического шума на 49 дБ, общий индекс звукоизоляции составляет 30 дБ.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3&gt;Размеры ленты&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Толщина — 2 мм.&lt;/li&gt;\r\n&lt;li&gt;Длина в рулоне — 12 м.&lt;/li&gt;\r\n&lt;li&gt;Ширина — 0,05 м.&lt;/li&gt;\r\n&lt;/ul&gt;','','40','','',''),(718,1,'Технониколь для пола 8 плит 1200x600x30 мм','&lt;p&gt;&lt;strong&gt;Технониколь для пола&lt;/strong&gt; — изоляционный материал для внутреннего использования. Применяется при обустройстве плавающего пола под стяжку. Увеличивает теплоизоляцию поверхности за счет низкого коэффициента теплопроводности — 0,037 Вт/(м·°C). Улучшает шумоизоляцию.&lt;/p&gt;\r\n&lt;p&gt;Основной материал — каменная вата. Упаковка содержит 8 плит общей площадью 5,76 м^2^. Страна производства — Россия.&lt;/p&gt;\r\n&lt;h3&gt;Размеры плиты&lt;/h3&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Толщина — 30 мм.&lt;/li&gt;\r\n&lt;li&gt;Длина — 1,2 м.&lt;/li&gt;\r\n&lt;li&gt;Ширина — 0,6 м.&lt;/li&gt;\r\n&lt;/ul&gt;','','34','','',''),(722,1,'Герметик битумный Sika BlackSeal-1, 300 г','&lt;p&gt;Битумный герметик Sika BlackSeal-1 позволяет устранить протекание кровли. Также он используется в качестве клея при монтаже изоляции на основе пенополистирола и полиуретана. Позволяет герметизировать швы толщиной до 2 сантиметров, может использоваться при температуре от +5 градусов.&lt;/p&gt;\r\n&lt;p&gt;Преимущества битумного герметика Sika BlackSeal-1:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Может использоваться даже в сырую погоду, в том числе для устранения течи непосредственно во время дождя.&lt;/li&gt;\r\n&lt;li&gt;Уже готов к применению, его не нужно разогревать.&lt;/li&gt;\r\n&lt;li&gt;Не требует предварительного грунтования и обезжиривания поверхности.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Используя этот герметик, вы сможете быстро и без специального оборудования избавиться от протекания кровли.&lt;/p&gt;','','60','','',''),(723,1,'Мастика битумная AquaMast Гидроизоляция Фундамента, 3 кг','&lt;p&gt;Битумная мастика AquaMast предназначена для гидроизоляции заглубляемой в грунт части постройки. Купить её можно для фундаментных блоков, свай, столбов и т. д. Она создаёт долговечный защитный слой, который предотвращает разрушение сооружения из-за контакта с влажной средой. Тем самым мастика значительно увеличивает срок службы фундамента. На рынок поставляется в удобной металлической ёмкости, в которой её можно использовать и длительное время хранить. Наносится на очищенную поверхность с помощью шпателя. Полное высыхание наступает через 24 часа.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокие гидроизоляционные свойства;&lt;/li&gt;\r\n&lt;li&gt;удобное нанесение;&lt;/li&gt;\r\n&lt;li&gt;смесь полностью готова к использованию.&lt;/li&gt;\r\n&lt;/ul&gt;','','70','','',''),(724,1,'Мастика кровельная Технониколь №21 (Техномаст), 10 кг','&lt;p&gt;Кровельная мастика «Технониколь» №21 — готовая к употреблению замазка, представляющая собой смесь битума, органического растворителя, каучука, минеральных и других технологических добавок. Она используется для ремонта крыш, изготовления мастичных кровель, гидроизоляции и антикоррозийной обработки строительный конструкций и металлических изделий. С помощью замазки создается бесшовное покрытие, надежно защищающее объекты от проникновения влаги и продлевающее их срок службы.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;p&gt;· эластичность;&lt;br&gt;\r\n· надежность сцепления с основанием;&lt;br&gt;\r\n· стойкость к температурному воздействию;&lt;br&gt;\r\n· удобство применения.&lt;/p&gt;','','32','','',''),(725,1,'Гидроизоляция Sika 101A «Стоп-Вода», 5кг','','','70','','',''),(726,1,'Праймер битумный AquaMast, 3 л','&lt;p&gt;Битумный праймер AquaMast для фундаментов предназначен для предварительного грунтования и подготовки основания перед последующей гидроизоляцией. Обладает хорошей сцепляемостью с поверхностями из бетона, дерева, кирпича, металла. Может использоваться с рулонными материалами и обмазочной изоляцией. Наносится кистью или валиком на предварительно очищенную поверхность. Купить праймер, а также другие материалы для фундаментных работ можно в интернет-магазине Альянстройснаб.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокая укрывистость;&lt;/li&gt;\r\n&lt;li&gt;хорошая адгезия с разными видами поверхностей;&lt;/li&gt;\r\n&lt;li&gt;простота использования.&lt;/li&gt;\r\n&lt;/ul&gt;','','78','','',''),(727,1,'Лента-герметик Никобенд, 3x0,1 м, цвет красный','&lt;p&gt;Самоклеящаяся лента «Никобенд» предназначена в первую очередь для герметизации и гидроизоляции кровли и водостоков. Но будет незаменима и при строительстве конструкций из самых разных материалов (металл, бетон, пластик, стекло, шифер). Битумно-полимерная основа обеспечивает надежное прилегание к поверхностям и абсолютную водонепроницаемость. Ремонт будет осуществлен в самые короткие сроки без применения дополнительного оборудования. Nicoband – это высокое качество по доступной цене.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;устойчивость к УФ-излучению;&lt;/li&gt;\r\n&lt;li&gt;большой срок службы (10 лет);&lt;/li&gt;\r\n&lt;li&gt;простота в применении;&lt;/li&gt;\r\n&lt;li&gt;отличная адгезия и прочность.&lt;/li&gt;\r\n&lt;/ul&gt;','','60','','',''),(728,1,'Лента-герметик Никобенд, 10x0,1 м, цвет зелёный','&lt;p&gt;Лента-герметик «Никобенд» зеленого цвета станет незаменимым помощником при строительных или ремонтных работах. Благодаря наличию на ее поверхности особого битумно-полимерного состава она надежно осуществит гидроизоляцию скрытых швов или герметизацию трещин, щелей и различных соединений. Использование этого материала не вызовет трудностей, ведь его нижний самоклеящийся слой прочно скрепляется с металлическими, деревянными или пластиковыми поверхностями. Кроме того, здесь присутствует защита от ультрафиолета, а значит, срок службы вне помещения значительно увеличен. Купить рулон ленты длиной 10 м по приемлемой цене вы можете в нашем интернет-магазине.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Прочность и долговечность.&lt;/li&gt;\r\n&lt;li&gt;Гидро- и пароизоляция.&lt;/li&gt;\r\n&lt;li&gt;Легкий монтаж.&lt;/li&gt;\r\n&lt;li&gt;Диапазон рабочей температуры – от -35 до +95°C.&lt;/li&gt;\r\n&lt;/ul&gt;','','57','','',''),(729,1,'Лента-герметик Никобенд, 10x0,1 м, цвет коричневый','&lt;p&gt;Лента Nicoband — незаменимая вещь для проведения монтажно-ремонтных работ. Ее отличительной особенностью является наличие толстого битумного слоя, способствующего не только склеиванию, но и отличной герметизации. Выполнена из высокопрочного и эластичного материала, обладающего устойчивостью к повреждениям. Также она прекрасно справляется с резкими температурными перепадами.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;российский производитель;&lt;/li&gt;\r\n&lt;li&gt;доступная цена;&lt;/li&gt;\r\n&lt;li&gt;надежность;&lt;/li&gt;\r\n&lt;li&gt;прочность;&lt;/li&gt;\r\n&lt;li&gt;универсальность;&lt;/li&gt;\r\n&lt;li&gt;термостойкость;&lt;/li&gt;\r\n&lt;li&gt;эластичность.&lt;/li&gt;\r\n&lt;/ul&gt;','','45','','',''),(730,1,'Лента гидроизоляционная Weber Vetonit Weber.Tec 828 ДБ 75, 10 м','&lt;p&gt;Гидроизоляционная лента российской торговой марки Weber Vetonit используется для эффективной защиты скрытых швов, стыков и других монтажных соединений от попадания влаги. Изделие произведено из современного материала, состоящего из гибких и эластичных волокон. Благодаря высоким техническим характеристикам ленту применяют как для внутренней, так и для наружной изоляции. В магазине Leroy Merlin всегда в наличии имеется большое разнообразие товаров для качественного ремонта и строительства.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;простота и удобство использования;&lt;/li&gt;\r\n&lt;li&gt;износостойкость и долговечность;&lt;/li&gt;\r\n&lt;li&gt;выгодная цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','43','','',''),(731,1,'Гидроизоляция Glims ГидроПломба, 800 г','&lt;p&gt;Гидропломба GLIMS — смесь, предназначенная для заделки щелей, трещин и прочих дефектов, образовавшихся в бетонной, кирпичной или керамической структуре здания. Пластичный материал создан на основе цементного раствора, при высыхании образует надежный барьер для воды. Смесь активно используют для отделки поштукатуренных и прошпаклеванных поверхностей. Цена упаковки в сети гипермаркетов Leroy Merlin доступна для российского потребителя.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;пластичная структура;&lt;/li&gt;\r\n&lt;li&gt;совместимость с большинством строительных материалов;&lt;/li&gt;\r\n&lt;li&gt;экономный расход.&lt;/li&gt;\r\n&lt;/ul&gt;','','78','','',''),(732,1,'Гидроизоляция жёсткая цементная Ceresit CR65/20','','','40','','',''),(733,1,'Герметик эластичный Glims GreenResin, 1.3 кг','&lt;p&gt;Герметик эластичный GLIMS-GreenResin представляет собой пасту на водной основе, готовую к использованию при устройстве гидроизоляции. Можно применять внутри и снаружи помещений для обработки стен, полов, потолков, фундаментов, а также бассейнов.&lt;br&gt;\r\nГерметик наносится на влажные или сухие поверхности с помощью валика, кисти либо шпателя. Перекрывает имеющиеся трещины до 2 мм величиной. Поверх герметика можно наносить любые отделочные материалы, приклеивать керамическую плитку.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокая адгезия ко многим материалам;&lt;/li&gt;\r\n&lt;li&gt;морозостойкий;&lt;/li&gt;\r\n&lt;li&gt;паропроницаемый;&lt;/li&gt;\r\n&lt;li&gt;создает надежную водонепроницаемую мембрану;&lt;/li&gt;\r\n&lt;li&gt;легко использовать;&lt;/li&gt;\r\n&lt;li&gt;экологически безопасен;&lt;/li&gt;\r\n&lt;li&gt;невысокая цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','70','','',''),(734,1,'Гидроизоляция быстротвердеющая Bergauf Hydroplomba','&lt;p&gt;Быстротвердеющая гидроизоляция Hydroplomba представляет собой смесь, предназначенную для быстрого устранения протечек. Средство заполняет трещины и поврежденные места, появившиеся в результате сколов или коррозии. Состав быстро затвердевает, что позволяет провести гидроизоляционные работы в кратчайшие сроки. Рекомендуется купить для использования в зонах как с нормальной, так и повышенной влажностью, а также при выполнении наружных фасадных и цокольных работ.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;повышенная прочность;&lt;/li&gt;\r\n&lt;li&gt;отсутствие усадки;&lt;/li&gt;\r\n&lt;li&gt;срок отвердевания составляет 3-5 минут.&lt;/li&gt;\r\n&lt;/ul&gt;','','210','','',''),(735,1,'Гидроизоляция цементная Glims BoдoStop, 5 кг','&lt;p&gt;Glims-BoдoStop — цементная смесь, применяемая для герметизации емкостей, строений и сооружений. Ее покупают, когда нужно защитить от протекания бассейн, колодец, резервуар с питьевой и технической водой. Состав пригоден для внутренних и наружных работ, может использоваться для защиты фундаментов, стен и перекрытий в санузлах или подвалах. Его можно наносить на бетон, цементную штукатурку, водостойкий гипсокартон, кирпич, камень.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;отличная адгезия;&lt;/li&gt;\r\n&lt;li&gt;высокая морозостойкость;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к растворам солей, кислот и щелочей;&lt;/li&gt;\r\n&lt;li&gt;допускается нанесение на влажные поверхности.&lt;/li&gt;\r\n&lt;/ul&gt;','','45','','',''),(736,1,'Мастика кровельная Технониколь №21 (Техномаст), 20 кг','&lt;p&gt;Мастика кровельная ТЕХНОНИКОЛЬ №21 (другое название – Техномаст) предназначена для работ с кровельными материалами рулонного типа, создания гидроизоляции, ремонта кровель и цокольных этажей, а также других объектов, находящихся в контакте с землей или влажной средой. Поставляется готовой к применению. Состоит из битума, минеральных связующих, орг.растворителя, полимерных добавок и искусственного каучука. Имеет высокую эластичность и адгезию, устойчива к воздействию влаги и температур. Цена – одна из самых низких на рынке.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;широкий спектр назначений;&lt;/li&gt;\r\n&lt;li&gt;стойкость к действию воды и влаги;&lt;/li&gt;\r\n&lt;li&gt;высокая адгезия;&lt;/li&gt;\r\n&lt;li&gt;эластичность;&lt;/li&gt;\r\n&lt;li&gt;теплостойкость.&lt;/li&gt;\r\n&lt;/ul&gt;','','37','','',''),(737,1,'Мастика для гидроизоляции Weber Vetonit Weber.Tec 822, цвет серый','&lt;p&gt;Мастика для гидроизоляции Weber.Tec — водоотталкивающий полужидкий состав серого цвета, полностью готовый к применению. Им обрабатывают любые минеральные, в том числе, гипсовые поверхности перед оклейкой их облицовочной плиткой. Мастика образует эластичный водонепроницаемый слой, предотвращая загнивание и появление плесени. Ее можно купить для обработки пола и стен помещений с повышенной влажностью: санузла, кухни, ванной комнаты, лоджии, балкона.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;подходит для пола с подогревом;&lt;/li&gt;\r\n&lt;li&gt;простое нанесение кистью или валиком;&lt;/li&gt;\r\n&lt;li&gt;неограниченный срок службы.&lt;/li&gt;\r\n&lt;/ul&gt;','','42','','',''),(738,1,'Лента-герметик Никобенд, 3x0,1 м, цвет зелёный','&lt;p&gt;Ленту-герметик «Никобенд» можно купить для гидроизоляции швов и соединений как для наружных, так и для внутренних работ. Лента сохраняет свои характеристики в широком температурном диапазоне и может использоваться вместе с металлом, пластиком и древесиной.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;надежная гидроизоляция швов и соединений;&lt;/li&gt;\r\n&lt;li&gt;эксплуатация при температуре от -35 до +95 градусов;&lt;/li&gt;\r\n&lt;li&gt;расход герметика 1,5 кг на квадратный метр;&lt;/li&gt;\r\n&lt;li&gt;может применяться с древесиной, пластиком и металлом.&lt;/li&gt;\r\n&lt;/ul&gt;','','67','','',''),(739,1,'Герметик Sikaflex Construction серый 600 мл','&lt;p&gt;Sikaflex Construction — это однокомпонентный эластичный герметик на основе полиуретана. Его можно использовать снаружи и внутри помещений. Эксплуатируется в широком диапазоне температуры воздуха (от -40 °C до +70 °C). Обладает высокой адгезией к большинству строительных материалов. Не образует пустот и пузырей при отверждении. Прочен, надежен и прост в использовании. Не требует дополнительной подготовки, после покупки сразу готов к применению.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;универсальность и удобство использования;&lt;/li&gt;\r\n&lt;li&gt;швейцарское качество;&lt;/li&gt;\r\n&lt;li&gt;приемлемая цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','43','','',''),(740,1,'Герметик Sika Sikaflex Construction 600 мл цвет белый','&lt;p&gt;Герметик Sikaflex Construction – это однокомпонентный, эластичный герметик, выполненный на основе полиуретана. Предназначен для внешнего и внутреннего использования. Изделие нашло применение для герметизации стыков дверей, окон, металлических облицовок, фасадных элементов, бетонных конструкций, швов балконных парапетов. Кроме этого, герметик способен прекрасно справиться со швами в металлических и деревянных конструкциях.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;низкая цена при отличном качестве;&lt;/li&gt;\r\n&lt;li&gt;многофункциональность;&lt;/li&gt;\r\n&lt;li&gt;простота использования;&lt;/li&gt;\r\n&lt;li&gt;очень быстро схватывает.&lt;/li&gt;\r\n&lt;/ul&gt;','','65','','',''),(741,1,'Герметик Sikaflex Precast серый 600 мл','&lt;p&gt;Герметик Sikaflex Construction – это полиуретановый однокомпонентный материал, который используется для строительных швов. Чаще всего эксплуатируется при выполнении наружных работ. Широко применяется с целью герметизации швов в различных строительных конструкциях – кирпичных, бетонных, металлических, деревянных, из ПВХ. Элемент необходим для заделки изоляционных и деформационных швов за счет дверей, окон, оболочек, фасадных элементов.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;прекрасное сочетание цены и качества;&lt;/li&gt;\r\n&lt;li&gt;надежность;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к атмосферным воздействиям;&lt;/li&gt;\r\n&lt;li&gt;удобство применения;&lt;/li&gt;\r\n&lt;li&gt;подходит для использования в тропическом и жарком климате.&lt;/li&gt;\r\n&lt;/ul&gt;','','43','','',''),(742,1,'Мембрана профилированная Gruntflex Landshaft, 1x10 м','&lt;p&gt;&lt;strong&gt;Мембрана профилированная Gruntflex Landshaft&lt;/strong&gt; выполнена из полиэтилена высокой плотности (400 г/м²). Материал выпускается в рулонах шириной 1 м. Длина — 10 м, толщина — 8 мм. За счет большого количества выступов (до 922 шт./м) мембрана равномерно распределяет общее давление и отдельную точечную нагрузку. Предел прочности при растяжении — 30,59 кг/м².&lt;/p&gt;\r\n&lt;p&gt;Благодаря высокой прочности на сжатие мембрана обеспечивает надежную защиту на глубине до 10 м. Материал защищает грунт от проникновения ядохимикатов, фундамент — от повреждений прорастающими корнями растений. Применяется при обустройстве подъездной дороги для автомобиля, тротуарных дорожек.&lt;/p&gt;','','74','','',''),(743,1,'Мембрана профилированная Gruntflex Landshaft, 1x20 м','&lt;p&gt;&lt;strong&gt;Мембрана профилированная Gruntflex Landshaft&lt;/strong&gt; выполнена из полиэтилена высокой плотности (400 г/м²). Материал выпускается в рулонах шириной 1 м. Длина — 20 м, толщина — 8 мм. За счет большого количества выступов (до 922 шт./м) мембрана равномерно распределяет общее давление и отдельную точечную нагрузку. Предел прочности при растяжении — 30,59 кг/м².&lt;/p&gt;\r\n&lt;p&gt;Благодаря высокой прочности на сжатие мембрана обеспечивает надежную защиту на глубине до 10 м. Материал защищает грунт от проникновения ядохимикатов, фундамент — от повреждений прорастающими корнями растений. Применяется при обустройстве подъездной дороги для автомобиля, тротуарных дорожек.&lt;/p&gt;','','34','','',''),(744,1,'Мастика битумная AquaMast Гидроизоляция Фундамента, 10 кг','&lt;p&gt;Мастика AquaMast сделана на основе битума и предназначена для гидроизоляции фундамента, свай, а также различных материалов, заглубляемых в землю. Она образует высокопрочное покрытие, которое защищает поверхность от разрушительного воздействия влаги. Тем самым значительно продляется срок службы строений и конструкций. Мастика представляет собой вязкий состав, готовый к использованию после тщательного перемешивания. Наносить его можно шпателем. Поставляется в удобной таре весом 10 кг. Производитель заявляет о среднем расходе 1 кг мастики на 1 м2 поверхности.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;надёжная защита от влаги;&lt;/li&gt;\r\n&lt;li&gt;удобная ёмкость для хранения;&lt;/li&gt;\r\n&lt;li&gt;оправданная эффективностью цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','53','','',''),(745,1,'Гидроизоляция полиакриловая Kobus, 5 кг','&lt;p&gt;Жидкая полиакриловая гидроизоляция торговой марки Kobus представляет собой бесшовное гидроизоляционное покрытие, предназначенное для гидроизоляции полов и стен в жилых и общественных помещениях, а также для обработки санузлов, ванных комнат и крыш. Наносится на бетон, оцинкованную сталь, черепицу, древесину, пенопласт и прочие строительные материалы. Поставляется в емкости по 5 л.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;надежно защищает от возможных протечек воды на нижние уровни помещений;&lt;/li&gt;\r\n&lt;li&gt;образует эластичный водонепроницаемый слой;&lt;/li&gt;\r\n&lt;li&gt;не содержит токсичных веществ;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Купив полиакриловую гидроизоляцию марки Kobus, вы сможете защитить стены и полы от проникновения влаги.&lt;/p&gt;','','43','','',''),(746,1,'Лента-герметик Никобенд, 10x0,1 м, цвет красный','&lt;p&gt;Лента-герметик&lt;/p&gt;','','56','','',''),(747,1,'Гидроизоляция обмазочная Bergauf Hydrostop, 5 кг','&lt;p&gt;Гидроизоляция BERGAUF Hydrostop — защитное вяжущее средство обмазочного типа серого цвета. Изделие производится на основе цемента, фракционированного песка, минеральных наполнителей, модифицирующих полимерных и гидрофобизирующих добавок. Состав используется для внутренних и наружных работ по бетону, кирпичу, цементной стяжке и штукатурке. Средство применяется для гидроизоляции стен, потолка и пола в помещениях с повышенной и нормальной влажностью. Купить гидроизоляцию марки BERGAUF можно в удобной упаковке по 5 кг.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;водонепроницаемость;&lt;/li&gt;\r\n&lt;li&gt;стойкость к появлению трещин;&lt;/li&gt;\r\n&lt;li&gt;легко наносится шпателем или кистью.&lt;/li&gt;\r\n&lt;/ul&gt;','','78','','',''),(748,1,'Лента-герметик Никобенд, 3x0,1 м, цвет серебристый','&lt;p&gt;Лента Nicoband — незаменимая вещь при проведении ремонтных, строительных и монтажных работ. Применяется для гидроизоляции и герметизации швов, стыков и трещин. Материал изготовления обладает высокими характеристиками прочности и эластичности. Она устойчива к температурным перепадам и другим негативным воздействиям. Также изделие имеет отличную адгезию с любыми типами материалов.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;известный российский производитель;&lt;/li&gt;\r\n&lt;li&gt;доступная цена;&lt;/li&gt;\r\n&lt;li&gt;простота монтажа;&lt;/li&gt;\r\n&lt;li&gt;износостойкость;&lt;/li&gt;\r\n&lt;li&gt;надежность;&lt;/li&gt;\r\n&lt;li&gt;многопрофильность.&lt;/li&gt;\r\n&lt;/ul&gt;','','86','','',''),(749,1,'Гидроизоляция отсечная Технониколь 400','&lt;p&gt;Отсечная гидроизоляция в рулонах подойдет для защиты фундамента, блочных и деревянных построек от проникновения и накапливания излишней влаги. Защита происходит благодаря специальным химическим пропиткам материала, блокирующим просачивание воды в бетонные поры и микротрещины. Ее можно купить для использования при строительстве загородного дома, хозяйственной постройки, гаража или бани. Преимущества: - удобная и практичная упаковка; - плотный слой пропитки по рулону; - высокая степень защиты от проникновения и накапливания влаги; - доступная цена.&lt;/p&gt;','','43','','',''),(750,1,'Мембрана профилированная Gruntflex Drenaj, 1x10 м','&lt;p&gt;&lt;strong&gt;Мембрана профилированная Gruntflex Drenaj&lt;/strong&gt; выполнена из полиэтилена высокой плотности (800 г/м²). Материал выпускается в рулонах шириной 1 м. Длина — 10 м, толщина — 9 мм. За счет большого количества выступов (до 922 шт./м) мембрана равномерно распределяет общее давление и отдельную точечную нагрузку. Предел прочности при растяжении — 46,4 кг/м².&lt;/p&gt;\r\n&lt;p&gt;Мембрана обеспечивает надежную защиту объектов подземного расположения от инфильтрационной воды, земельного участка от дождевой и талой воды, фундамента здания от высоко залегающих подземных слоев воды. Материал применяется при обустройстве вертикального дренажа, эксплуатируемой зеленой кровле здания, тротуарных дорожек.&lt;/p&gt;','','32','','',''),(751,1,'Лента-герметик Никобенд, 3x0,1 м, цвет коричневый','&lt;p&gt;Лента-герметик «Никобенд» является универсальным средством для обработки швов, трещин и прочих изъянов металлических, пластиковых, деревянных и других поверхностей. Материал в равной степени подходит для наружных и внутренних работ, а также для герметизации кровли и деталей водостоков. У нас вы можете купить ленту длиной 3 м в рулоне.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Отличная устойчивость к погодным воздействиям, в том числе к УФ-излучению.&lt;/li&gt;\r\n&lt;li&gt;Надежная герметизация поверхностей.&lt;/li&gt;\r\n&lt;li&gt;Долговечность и приемлемая цена материала.&lt;/li&gt;\r\n&lt;/ul&gt;','','78','','',''),(752,1,'Цемент монтажный водоостанавливающий Ceresit CX5, 2 кг','&lt;p&gt;Монтажный водоостанавливающий цемент Ceresit CX5 предназначен для наружных и внутренних работ в различных помещениях. Его используют для быстрого закрепления стальной и полимерной арматуры в растворах, бетоне, кирпичной кладке; остановки водопритока в оградительных системах; срочной ликвидации трещин, выбоин при проведении ремонтных работ. Стройматериал незаменим при обустройстве ванных комнат, санузлов, кухонь. Цемент начинает схватываться через 3 минуты и набирает прочность через 5 часов. Температура эксплуатации от +90 °C до -55 °С. Не дает усадки, не вызывает коррозии арматуры и не содержит хлоридов.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;водонепроницаемость;&lt;/li&gt;\r\n&lt;li&gt;высокая адгезия;&lt;/li&gt;\r\n&lt;li&gt;экологическая безопасность;&lt;/li&gt;\r\n&lt;li&gt;привлекательная цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','65','','',''),(753,1,'Лента-герметик Никобенд, 10x0,15 м, цвет коричневый','&lt;p&gt;Битумно-полимерную ленту «Никобенд» можно купить для герметизации щелей и скрытых швов на металле, дереве или пластике. Для монтажа ленты не требуется клеевой состав, а ее компоненты сохраняют герметичность в широком диапазоне температур.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;в состав входит битум и полимеры;&lt;/li&gt;\r\n&lt;li&gt;лента обладает самоклеящимися свойствами;&lt;/li&gt;\r\n&lt;li&gt;в одном рулоне 10 метров ленты шириной 15 см;&lt;/li&gt;\r\n&lt;li&gt;сохраняет свои свойства в широком диапазоне температур.&lt;/li&gt;\r\n&lt;/ul&gt;','','46','','',''),(754,1,'Герметик Sika Sikaflex Construction 600 мл цвет коричневый','&lt;p&gt;Герметик Sikaflex Construction объемом 600 мл предназначен для обработки соединительных швов балконных парапетов, а также для надежной герметизации монтажных стыков при установке оконных, дверных и других типов конструкций. Изделие представляет собой однокомпонентный материал, изготовленный на основе технического полиуретана. Благодаря высокой устойчивости к природным и механическим воздействиям, его можно использовать как для внутренних, так и для наружных отделочных работ.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;доступная цена;&lt;/li&gt;\r\n&lt;li&gt;продолжительный срок годности;&lt;/li&gt;\r\n&lt;li&gt;совместим с различными строительными материалами;&lt;/li&gt;\r\n&lt;li&gt;быстро твердеет и не образует подтеков.&lt;/li&gt;\r\n&lt;/ul&gt;','','74','','',''),(755,1,'Мастика для ремонта и приклеивания AquaMast, 3 кг','&lt;p&gt;AquaMast – это мастика для ремонта и приклеивания с формой выпуска в банках по 3 кг. Создана специально для проведения ремонтных и коррекционных работ на рулонных и мастичных кровлях в условиях оптимального проветривания. Дополнительно может применяться для надежного склеивания битумных материалов с различными поверхностями. С помощью мастики AquaMast можно просто и быстро восстановить гидроизоляцию крыши.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;br&gt;\r\n· теплостойкость;&lt;br&gt;\r\n· экономичный расход;&lt;br&gt;\r\n· доступная стоимость;&lt;br&gt;\r\n· длительное скрепление.&lt;/p&gt;','','54','','',''),(756,1,'Гидроизоляция обмазочная Bergauf Hydrostop, 20 кг','&lt;p&gt;Цементная обмазочная гидроизоляция Hydrostop от торговой марки BERGAUF подходит для изоляции стен, пола и потолка в ванной комнате и санузле, отличается эластичностью и простотой нанесения. Она устойчива к образованию трещин и постоянному контакту с водой, наносится на обрабатываемые поверхности такими доступными подручными инструментами, как шпатель и кисть. Водонепроницаемая изоляция предназначена для внутренних и внешних работ, высыхает в течение 48 часов после использования. Она совместима с такими покрытиями, как цементная и цементно-известковая штукатурка, железобетон, кирпичная кладка, бетон, стяжка, натуральный и искусственный камень, используется при температуре от +5 до +25°C.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;доступная цена;&lt;/li&gt;\r\n&lt;li&gt;морозостойкость класса 50F;&lt;/li&gt;\r\n&lt;li&gt;водостойкость;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к трещинам;&lt;/li&gt;\r\n&lt;li&gt;лёгкое нанесение.&lt;/li&gt;\r\n&lt;/ul&gt;','','73','','',''),(757,1,'Гидроизоляция Геркулес Аква-Стоп, 5 кг','&lt;p&gt;Раствор «Геркулес Аква-Стоп» используется для гидроизоляции конструкций, стен и перекрытий, выполненных из минеральных материалов. Средство необходимо наносить на поверхность из одного материала, стены или конструкции из разных (кирпич+бетон и т.д.) необходимо покрывать штукатуркой.&lt;/p&gt;\r\n&lt;p&gt;Особенности:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;в упаковке 5 кг;&lt;/li&gt;\r\n&lt;li&gt;защищает конструкции и перекрытия от воды и высолов;&lt;/li&gt;\r\n&lt;li&gt;подходит для внешней и внутренней гидроизоляции;&lt;/li&gt;\r\n&lt;li&gt;наносится на предварительно очищенную и высушенную поверхность.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;В интернет-каталоге Альянстроснаб вы сможете найти широкий ассортимент строительных добавок по отличной цене.&amp;nbsp;&lt;/p&gt;','','57','','',''),(758,1,'Мастика битумно-резиновая AquaMast, 3 кг','&lt;p&gt;Битумно-резиновая мастика AquaMast (3 кг) – это готовый гидроизоляционный материал для кровли на основе битума и дроблёной резины. Обработка мастикой AquaMast позволяет защитить кровлю от протечек, а также существенно продлить срок её службы.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;образует прочное сцепление с любыми материалами – бетоном, деревом, керамикой, кирпичом, бетоном;&lt;/li&gt;\r\n&lt;li&gt;обработку кровли можно проводить при температуре от –10 до +40°С;&lt;/li&gt;\r\n&lt;li&gt;высыхает за 24 часа;&lt;/li&gt;\r\n&lt;li&gt;экономный расход смеси (3,3-4,3 кг/м2).&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&lt;span style=&quot;background-color: rgb(255, 0, 0);&quot;&gt;&lt;font color=&quot;#ffffff&quot;&gt;Важно: при температуре ниже +5°С мастику перед началом работы нужно выдержать при комнатной температуре в течение 24 часов.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;','','85','','',''),(759,1,'Гидроизоляция цементная Glims BoдoStop, 20 кг','&lt;p&gt;Гидроизоляция цементная GLIMS-BoдoStop (20 кг) является цементным герметиком, предназначенным для бассейнов, фундаментов, колодцев, стен, потолков, полов в ванных комнатах и подвалах, в резервуарах с водой (в том числе и питьевой). Применяется для наружных и внутренних работ. Реализуется в упаковках по 20 кг. Расход сухой смеси составляет 1,4 кг на 1 м2. Выдерживает давление до 7 атмосфер. Может наноситься на влажные (но не мокрые) основания.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;устойчива к солевым растворам, разбавленным кислотам, щелочам и бензо-масляным смесям;&lt;/li&gt;\r\n&lt;li&gt;высокая адгезия;&lt;/li&gt;\r\n&lt;li&gt;морозо- и атмосферостойкость;&lt;/li&gt;\r\n&lt;li&gt;высокая прочность;&lt;/li&gt;\r\n&lt;li&gt;экологическая безопасность.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Интнернет магазин Альянсстройснаб предлагают большой выбор цементных герметиков по низким ценам.&lt;/p&gt;','','54','','',''),(760,1,'Мастика битумная Империал Изоляционная, 13 л','&lt;p&gt;Битумная изоляционная мастика «Империал» - это готовая к применению битумная мастика, предназначенная для защиты от коррозии конструкций из бетона, металла, или древесины, заглубляемых в грунт.&lt;br&gt;\r\nЧаще всего она применяется для устройства обмазочной гидроизоляции фундаментов при строительстве, но подходит также для обработки металлических конструкций.&lt;br&gt;\r\nРасход мастики зависит от типа основания, при толщине нанесения 1,5-2,5 мм составляет 1,5-2,5 кг на 1 м². По характеру отверждения данная мастика относится к неотверждаемым мастикам.&lt;/p&gt;','','42','','',''),(848,1,'Металлочерепица 1.16x0.47м с полиэстеровым покрытием 0.4 мм цвет красный','&lt;p&gt;Металлочерепица – весьма распространенный кровельный материал. Характеризуется надежностью в эксплуатации, легкостью монтажа, небольшой массой. Одноволновый лист профнастила покрыт полиэстером, защищающим материал от негативного воздействия атмосферных явлений. Металлочерепица окрашена в красный цвет. &lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;p&gt; - привлекательный внешний вид;&lt;/p&gt;&lt;p&gt; - длительный срок эксплуатации;&lt;/p&gt;&lt;p&gt; - доступная цена;&lt;/p&gt;&lt;p&gt; - хорошая цветостойкость.&lt;/p&gt;&lt;p&gt;\r\n&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(849,1,'Планка карнизная с полиэстеровым покрытием 2 м цвет зелёный','&lt;p&gt;Планка карнизная — стальной элемент кровли, имеющий полимерной покрытие для улучшения эксплуатационных характеристик. Используется для отвода в водосточный желоб конденсата и защиты от влаги подкровельного пространства. Помимо защитной функции планка карнизная выполняет роль декоративного элемента.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;прекрасные защитные свойства;&lt;/li&gt;\r\n&lt;li&gt;долговечность и износостойкость;&lt;/li&gt;\r\n&lt;li&gt;эстетичный внешний вид;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к коррозии;&lt;/li&gt;\r\n&lt;li&gt;простота монтажа.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Планку карнизную с полиэстровым покрытием следует купить при устройстве крыши с применением металлочерепицы.&lt;/p&gt;','','100','','',''),(850,1,'Металлочерепица 1.16x1.17м с полиэстеровым покрытием 0.4 мм цвет коричневый','&lt;p&gt;Металлочерепица с полиэстеровым покрытием — один из самых популярных кровельных материалов. Смотрится эстетично, относительно недорого стоит и не утяжеляет крышу. Лист металлочерепицы, покрытый полиэстером, выдерживает высокую температуру воздуха и противостоит коррозии. Полиэстеровое покрытие износостойкое, не выцветает и не впитывает влагу. &lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;p&gt; - устойчивость к коррозии; &lt;/p&gt;&lt;p&gt;- прослужит минимум 5 лет; &lt;/p&gt;&lt;p&gt;- прочность и пластичность; &lt;/p&gt;&lt;p&gt;- невысокая цена.\r\n&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(847,1,'Снегозадержатель трубчатый Эко 3 м цвет коричневый','&lt;p&gt;Снегозадержатель трубчатый не позволяет снегу сходить с крыши крупными комами. Этим крыша и водосточная система дома защищаются от деформаций. Задерживая снег, снегозадержатель пропускает его через себя небольшими частями. Снеговой барьер – важный элемент кровельной системы.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;антикоррозийное покрытие, обеспечивающее долгий срок службы;&lt;/li&gt;\r\n&lt;li&gt;Невысокая цена на стандартный размер 3 метра;&lt;/li&gt;\r\n&lt;li&gt;монтируется непосредственно к сплошной обрешетке металлочерепицы.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(843,1,'Планка для наружных углов с полиэстеровым покрытием 2 м цвет красный','&lt;p&gt;Планка для наружных углов защищает места стыков от осадков и придает кровле более аккуратный вид. Полиэстеровое покрытие обеспечивает детали высокую устойчивость к негативным атмосферным воздействиям: коррозии и перепадам температур. Такая планка сохраняет свой первоначальный вид на протяжении длительного срока эксплуатации, не выгорая на солнце и не деформируясь. Купить эту деталь можно в нашем магазине.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;декоративная функция;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к коррозии, перепадам температур и выгоранию;&lt;/li&gt;\r\n&lt;li&gt;защита мест соединения.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(844,1,'Металлочерепица 1.16x0.47м с полиэстеровым покрытием 0.4 мм цвет коричневый','&lt;p&gt;Одноволновая металлочерепица с полиэстеровым покрытием — прочный и долговечный кровельный материал, который характеризуется привлекательным внешним видом, простотой укладки и низкой ценой. Полиэстеровое покрытие хорошо переносит температурные перепады и не удерживает на поверхности пыль и грязь, поэтому даже спустя долгие годы кровля выглядит, как новая. &lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;p&gt; - минимальные трудозатраты на монтаж;&lt;/p&gt;&lt;p&gt; - выдерживает значительные перепады температур;&lt;/p&gt;&lt;p&gt; - не впитывает грязь и пыль.\r\n&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(845,1,'Снегозадержатель трубчатый Эко 3 м цвет вишнёвый','&lt;p&gt;Трубчатый снегозадержатель - это приспособление, которое устанавливается на кровле зданий. Служит для предотвращения сползания большой массы снега, способной повредить автомобили, растения и причинить вред здоровью проходящих мимо людей. Купить и установить это приспособление рекомендуется владельцам частных домов, офисных зданий, а также администрации ОСМД.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;обеспечивает безопасность;&lt;/li&gt;\r\n&lt;li&gt;лакокрасочное покрытие защищает изделие от коррозии;&lt;/li&gt;\r\n&lt;li&gt;вишневый цвет идеально подойдет к кровле соответствующего цвета.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(846,1,'Металлочерепица 1.16x2.22м с полиэстеровым покрытием 0.4 мм цвет красный','&lt;p&gt;Листовая металлочерепица – это удобный и надежный кровельный материал, который легко устанавливать даже на большой площади. Листы покрыты защитным слоем полиэстера, устойчивого к воздействию влаги и перепадам температуры. &lt;/p&gt;&lt;p&gt;Преимущества:&lt;/p&gt;&lt;p&gt; - привлекательный внешний вид кровли;&lt;/p&gt;&lt;p&gt; - долговечная металлическая основа; &lt;/p&gt;&lt;p&gt;- износостойкое покрытие из полиэстера;&lt;/p&gt;&lt;p&gt; - насыщенный красный цвет.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(841,1,'Планка снегозадержания с полиэстеровым покрытием 2 м цвет коричневый','&lt;p&gt;Планка снегозадержания с полиэстеровым покрытием 2 м коричневая предназначена для установки на скатных кровлях всех типов. С ее помощью вы сможете предотвратить падение больших пластов снега и льда с крыши. Купить изделие вы можете для установки на кровли из металла, шифера и других материалов.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Покрытие из полиэстера, устойчивое к морозам, появлению царапин и выгоранию под солнечными лучами.&lt;/li&gt;\r\n&lt;li&gt;Строгий коричневый цвет.&lt;/li&gt;\r\n&lt;li&gt;Невысокая цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(842,1,'Конёк плоский с полиэстеровым покрытием 2 м цвет коричневый','&lt;p&gt;Конёк плоский с полиэстеровым покрытием — доборный элемент, необходимый для монтажа скатной кровли. Используется для закрытия профилированных листов в местах соединения скатов и наружных переломов. Основное предназначение — защита от попадания влаги, пыли и грязи под кромки черепицы, профнастила и ондулина. Также планка препятствует срыву профилированных листов порывами ветра и придаёт законченный вид крыше здания. При этом имеет более низкую цену, чем конструкция полукруглой формы.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;цвет изделия совпадает с оттенком металлочерепицы;&lt;/li&gt;\r\n&lt;li&gt;обладает высоким уровнем прочности и долговечности;&lt;/li&gt;\r\n&lt;li&gt;отражает ультрафиолетовые лучи и не выгорает.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(821,1,'Ендова внешняя с полиэстеровым покрытием 2 м цвет зелёный','&lt;p&gt;Ендова внешняя с полиэстеровым покрытием - это стык между плоскостями кровли. Ендова внешняя предназначена для оттока воды с кровли и защиты пространства под ней от снега и дождя. Это необходимый конструктивный элемент крыши, который облегчает уборку и является важным декоративным элементом.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокая устойчивость материала к перепадам температуры и повышенной влажности;&lt;/li&gt;\r\n&lt;li&gt;долговечность;&lt;/li&gt;\r\n&lt;li&gt;прочность;&lt;/li&gt;\r\n&lt;li&gt;немаркий цвет;&lt;/li&gt;\r\n&lt;li&gt;доступная цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(822,1,'Планка примыкания верхняя с полиэстеровым покрытием 2 м цвет зелёный','&lt;p&gt;Планка примыкания верхняя с полиэстеровым покрытием — аксессуар для металлической кровли. Используется для герметизации кровельного покрытия в том месте, где листы металлочерепицы примыкают к трубе. Металлическая планка закрепляется на саморезы.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;простой монтаж;&lt;/li&gt;\r\n&lt;li&gt;долговечность;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к влаге и ультрафиолету;&lt;/li&gt;\r\n&lt;li&gt;надежная защита пространства под кровлей от протечек.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Планка не подвержена коррозии — она покрыта слоем полимера. Полимер зеленого цвета придает изделию эстетичный вид. Кровельный элемент всегда будет иметь яркий и насыщенный зеленый цвет — материал устойчив к ультрафиолету&lt;/p&gt;','','100','','',''),(823,1,'Планка снегозадержания с полиэстеровым покрытием 2 м цвет зелёный','&lt;p&gt;Планка снегозадержания с полиэстеровым покрытием — элемент системы безопасности, предназначенный для профилированных кровельных покрытий. Основная цель — обеспечить равномерный и постепенный сход снега в зимне-весенний период. Отсутствие снегозадержателей может привести к угрозе падения крупных пластов снега на головы жильцов дома и прохожих, а также на припаркованные машины. Для монтажа планки используются саморезы (не входят в комплектацию).&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокие эксплуатационные характеристики;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к негативному атмосферному воздействию;&lt;/li&gt;\r\n&lt;li&gt;простота монтажа;&lt;/li&gt;\r\n&lt;li&gt;доступная цена.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Планка снегозадержания предотвращает повреждение элементов здания и кровли, водосточных систем.&lt;/p&gt;','','100','','',''),(824,1,'Металлочерепица 1.16x1.17м с полиэстеровым покрытием 0.4 мм цвет красный','&lt;p&gt;Лист металлочерепицы трехволновый с полиэстеровым покрытием, цвет красный, жесткий кровельный материал, изготовленный из стали. Полимерное покрытие толщиной 0,035мм, созданное на основе полиэфирной краски, предохраняет изделие от коррозии, выдерживает перепады температур, не выцветает. Металлочерепица имеет форму, близкую к классической черепице благодаря особой технике производства, сохраняя все достоинства металлической кровли. &lt;/p&gt;&lt;p&gt;Преимущества: - экологичность; - малый вес; - внешняя эстетика; - простота монтажа; - долговечность; &lt;/p&gt;&lt;p&gt;&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(825,1,'Металлочерепица 1.16x2.22м с полиэстеровым покрытием 0.4 мм цвет коричневый','&lt;p&gt;Коричневый шестиволновый лист металлочерепицы с полиэстеровым покрытием применяется при монтаже скатных кровель различной конфигурации. При необходимости он легко режется, что позволяет применять его при обустройстве крыш сложной конфигурации. Снаружи на металл нанесен слой полиэстера, который защищает лист от коррозии, а также делает его менее шумным. &lt;/p&gt;&lt;p&gt;Преимущества: &lt;/p&gt;&lt;p&gt;- имитация формы и цвета настоящей глиняной черепицы; &lt;/p&gt;&lt;p&gt;- российское производство;&lt;/p&gt;&lt;p&gt; - материал не выгорает на солнце.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(826,1,'Ендова внешняя с полиэстеровым покрытием 2 м цвет коричневый','&lt;p&gt;Внешняя ендова придает гармоничный вид крыше дома. Устанавливается на стыках скатов для предотвращения попадания листвы и наметания снега под покрытие. Монтируется в качестве декоративной заглушки на соединении плоскостей кровли. Крепится кровельными саморезами к обрешетке.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;стойкость к коррозии более 30 лет благодаря полиэстеровому покрытию;&lt;/li&gt;\r\n&lt;li&gt;простая установка – двухметровые планки легко закрепить на высоте;&lt;/li&gt;\r\n&lt;li&gt;малый вес – удобство монтажа и снижение нагрузки на стропила;&lt;/li&gt;\r\n&lt;li&gt;оптимальная толщина для крепления к изогнутым поверхностям.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Перед началом работ не забудьте купить внутреннюю ендову – «ливнёвку» для отвода воды.&lt;/p&gt;','','100','','',''),(827,1,'Металлочерепица 1.16x1.17м с полиэстеровым покрытием 0.4 мм цвет зеленый','&lt;p&gt;Лист металлочерепицы применяется для устройства кровли скатных крыш. Полиэстеровое покрытие защищает поверхности от повреждений, усиливает их тепло и гидроизоляционные свойства, делает материал эстетичным. Купить лист металлочерепицы в нашем магазине можно вместе со специальным крепежом, аксессуарами, элементами водостоков и прочими деталями конструкций крыш.&lt;/p&gt;&lt;p&gt; Преимущества: &lt;/p&gt;&lt;p&gt;- декоративный дизайн, имитация черепичной кладки; &lt;/p&gt;&lt;p&gt;- долговечность, прочность;&lt;/p&gt;&lt;p&gt; - легкость монтажа при любых погодных условиях; &lt;/p&gt;&lt;p&gt;- износостойкость, устойчивость к ультрафиолету, высоким и низким температурам.&lt;/p&gt;&lt;p&gt;\r\n&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(828,1,'Ендова внешняя с полиэстеровым покрытием 2 м цвет красный','&lt;p&gt;Ендова внешняя от российского производителя – один из основных элементов кровельной системы, представляющая собой угол, располагающийся в месте стыка двух скатов. Данное изделие предназначено для выполнения декоративной функции при формировании законченного внешнего вида кровли, а также для быстрого отвода с ее поверхности атмосферных осадков. Выполненный из оцинкованного стального листа с полиэстеровым покрытием, этот элемент кровли обладает высокой прочностью к воздействиям механического характера, а также к воздействию ультрафиолета. Ендова красного цвета подходит для такого же цвета металлочерепицы.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;эстетический вид;&lt;/li&gt;\r\n&lt;li&gt;высокая прочность и износостойкость;&lt;/li&gt;\r\n&lt;li&gt;устойчивость к воздействию ультрафиолета;&lt;/li&gt;\r\n&lt;li&gt;низкая цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(829,1,'Ендова нижняя оцинкованная 2 м','&lt;p&gt;Ендова нижняя оцинкованная — элемент кровли, предназначенный для отвода воды и герметизации крыши на стыках кровельного материала. Устанавливается на отрицательных углах. Ее монтаж производится перед укладкой кровли с помощью специальных саморезов. Для улучшения эксплуатационных характеристик рекомендуем дополнительно купить подкладки, которые обеспечат ендове долгий срок эксплуатации. Оцинкованная сталь устойчива к воздействию влаги, солнечных лучей, перепадов температур и заморозков.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;долговечность и износоустойчивость;&lt;/li&gt;\r\n&lt;li&gt;простой монтаж;&lt;/li&gt;\r\n&lt;li&gt;влагостойкость.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(830,1,'Планка снегозадержания с полиэстеровым покрытием 2 м цвет красный','&lt;p&gt;Планка снегозадержания с полиэстеровым покрытием предназначена для равномерного схода снега. Помогает дополнить систему безопасности дома. Купив ее, вы повысите уровень своей личной защищенности во время нахождения неподалеку от здания, а также обезопасите кровлю от повреждения льдом и снегом. Длина этой планки красного цвета составляет 2 м, а вес изделия равен 1,88 кг. Страна-производитель: Россия.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;позволяет снизить вероятность непредвиденного схода с крыши снега, льда;&lt;/li&gt;\r\n&lt;li&gt;облегчает ремонт крыши;&lt;/li&gt;\r\n&lt;li&gt;позволяет свести к минимуму риск нанесения ущерба транспорту и постройкам, которые находятся вблизи от дома;&lt;/li&gt;\r\n&lt;li&gt;имеет приемлемую цену.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(831,1,'Снегозадержатель трубчатый Эко 3 м цвет зелёный','&lt;p&gt;Снегозадержатель является обязательным конструктивным элементом кровли в регионах со снежной зимой. Он предназначен для предотвращения резкого схода снега и защиты кровли от повреждений, а кроме того помогает не упасть крыши при ее обслуживании. Применение снегозадержателей является оптимальным решением для обеспечения безопасности кровли, помогает устранить угрозу для здоровья людей, а также риск порчи водосточных систем и стоящих рядом автомобилей.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокая прочность;&lt;/li&gt;\r\n&lt;li&gt;универсальность, подходят для кровли с любым типом покрытия;&lt;/li&gt;\r\n&lt;li&gt;умеренная цена;&lt;/li&gt;\r\n&lt;li&gt;обладают привлекательным внешним видом, не нарушают архитектурный ансамбль;&lt;/li&gt;\r\n&lt;li&gt;служат кровельным ограждением;&lt;/li&gt;\r\n&lt;li&gt;могут устанавливаться как в процессе строительства, так и на готовую крышу.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(832,1,'Планка для внутренних углов с полиэстеровым покрытием 2 м цвет коричневый','&lt;p&gt;Планка для внутренних углов представляет собой один из комплектующих аксессуаров для металлической кровли. Изделие весом 2 кг надежно защищено от коррозии полиэстеровым покрытием. Планка предназначается для эффективной защиты места стыка материалов от попадания осадков. Изделие также выполняет декоративную функцию.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;образцовое качество;&lt;/li&gt;\r\n&lt;li&gt;долговечность;&lt;/li&gt;\r\n&lt;li&gt;привлекательная цена.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(833,1,'Конёк плоский с полиэстеровым покрытием 2 м цвет красный','&lt;p&gt;Конёк плоский с полиэстеровым покрытием 2 м финишный элемент кровельной конструкции. Используется для перекрытия щели между кровлей из профнастила или металлочерепицы на верхних стыках скатной крыши. Изготовлен из оцинкованного металла с защитно-декоративным покрытием из полиэстера темно-красного цвета. Обеспечивает защиту подкровельного пространства от атмосферной влаги, пыли и грязи без ущерба для его качественной вентиляции.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокое качество стальной основы и финишного покрытия;&lt;/li&gt;\r\n&lt;li&gt;простота монтажа;&lt;/li&gt;\r\n&lt;li&gt;срок службы ? не менее 50 лет с сохранением качественных и эстетических параметров.&lt;/li&gt;&lt;/ul&gt;','','100','','',''),(839,1,'Металлочерепица 1.16x0.47м с полиэстеровым покрытием 0.4 мм цвет зеленый','&lt;p&gt;Лист металлочерепицы одноволновый представляет собой кровельный покрывной материал с продольным гофрированием, имитирующим глиняную черепицу. Профилированный лист из оцинкованной стали с полимерным покрытием характеризуется прочностью, морозостойкостью, не боится перепадов температур и обильных осадков. Эти качества делают металлочерепицу с полимерным покрытием особенно востребованной в условиях непростого российского климата. Лист отличается малым весом и надежно защищает крышу от негативных воздействий внешней среды, при необходимости легко заменяется путем демонтажа отдельного поврежденного участка крыши. &lt;/p&gt;&lt;p&gt;Преимущества: &lt;/p&gt;&lt;p&gt;- долгий срок службы; &lt;/p&gt;&lt;p&gt;- прочность;&lt;/p&gt;&lt;p&gt; - износостойкость;&lt;/p&gt;&lt;p&gt; - легкий вес.&lt;/p&gt;&lt;p&gt;\r\n&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(834,1,'Металлочерепица 1.16x2.22м с полиэстеровым покрытием 0.4 мм цвет зеленый','&lt;p&gt;Металлочерепица предназначена для покрытия скатных крыш. Защитное покрытие универсальное полиэстеровое, цвет – зеленый. Черепица с легкостью и без потери свойств выдерживает температуры от -50 до 50 градусов Цельсия. Экологичный зеленый цвет будет гармонировать с окружающей средой в летний период и освежит внешний вид дома в межсезонье либо зимой. &lt;/p&gt;&lt;p&gt;Преимущества: &lt;/p&gt;&lt;p&gt;- приемлемая цена;&lt;/p&gt;&lt;p&gt; - легкость; &lt;/p&gt;&lt;p&gt;- прочность, долговечность; &lt;/p&gt;&lt;p&gt;- экологичность;&lt;/p&gt;&lt;p&gt; - простота укладки и ремонта;&lt;/p&gt;&lt;p&gt; - возможность монтажа при низких температурах.\r\n&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Согласно ГОСТ 19904   возможны отклонения толщины металлочерепицы  на +/- 0,02 мм&lt;/strong&gt;&lt;/p&gt;','','100','','',''),(835,1,'Планка примыкания верхняя с полиэстеровым покрытием 2 м цвет коричневый','&lt;p&gt;Планка примыкания верхняя — элемент металлической кровли с полиэстеровым покрытием. Изделие используется для герметизации стыка между кровельным листом и стеной или трубой. Планка закрепляется на саморезы.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;простой монтаж;&lt;/li&gt;\r\n&lt;li&gt;надежная герметизация щели;&lt;/li&gt;\r\n&lt;li&gt;долговечность;&lt;/li&gt;\r\n&lt;li&gt;демократичная цена.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Элемент коричневого цвета подходит к металлочерепице аналогичного оттенка.&lt;/p&gt;','','100','','',''),(836,1,'Планка для наружных углов с полиэстеровым покрытием 2 м цвет зелёный','&lt;p&gt;Планка для наружных углов с полиэстеровым покрытием — один из доборных кровельных материалов, позволяющий получить качественное покрытие крыши. Этот декоративный элемент предназначен для герметизации углов и предотвращения проникновения осадков через стыки кровли с примыкающими поверхностями.&lt;/p&gt;\r\n&lt;p&gt;Преимущества&lt;/p&gt;\r\n&lt;p&gt;· полиэстеровое покрытие защищает от коррозии и обеспечивает длительный срок службы;&lt;br&gt;\r\n· прикрывая места стыков, такая планка улучшает общий вид кровельного покрытия;&lt;br&gt;\r\n· предотвращает скопления влаги;&lt;br&gt;\r\n· планка крепится на кровельные саморезы с резиновыми прокладками.&lt;/p&gt;','','100','','',''),(837,1,'Конёк плоский с полиэстеровым покрытием 2 м цвет зелёный','&lt;p&gt;Конек плоский с полиэстеровым покрытием – элемент, дополняющий кровлю. Он объединяет два ската крыши и обеспечивает герметичность всей конструкции. Изготавливается из листа стали путем его сгибания. Полиэстеровое покрытие защищает металл от воздействия неблагоприятных внешних факторов окружающей среды.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;на протяжении долгого времени сохраняет эстетичный внешний вид;&lt;/li&gt;\r\n&lt;li&gt;не поддается коррозии;&lt;/li&gt;\r\n&lt;li&gt;легко монтируется на кровли;&lt;/li&gt;\r\n&lt;li&gt;срок службы составляет не менее 10 лет;&lt;/li&gt;\r\n&lt;li&gt;может использоваться для кровли из разного материала.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Плоский конек с полиэстеровым покрытием этого цветового решения станет удачной покупкой, если кровельный материал тоже зеленый.&lt;/p&gt;','','100','','',''),(838,1,'Планка для внутренних углов с полиэстеровым покрытием 2 м цвет красный','&lt;p&gt;Планка с полиэстеровым покрытием применяется для отделки внутренних углов кровли. Позволяет закрыть стыки, сделать их более эстетичными и аккуратными. Изготовлена из долговечного и прочного материала, который для большей надежности покрыт защитным полиэстеровым слоем. Красивый темно-красный цвет предполагает необходимость использования с кровельными элементами такого же оттенка.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;доступная цена при высоком качестве;&lt;/li&gt;\r\n&lt;li&gt;красивый эстетичный вид;&lt;/li&gt;\r\n&lt;li&gt;большая надежность и долговечность.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','',''),(840,1,'Планка примыкания верхняя с полиэстеровым покрытием 2 м цвет красный','&lt;p&gt;Планка примыкания верхняя красного цвета – это декоративный кровельный элемент. Она используется для крыши, которая покрыта профилированным настилом, металочерепицей и гибкой черепицей. Купить планку примыкания следует, если необходимо аккуратное оформление соединений металлочерепичных листов с вентиляционными и дымовыми трубами, стенками и парапетами дома. Верхняя планка примыкания покрыта полиэстером.&lt;/p&gt;\r\n&lt;p&gt;Преимущества:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;высокое качество;&lt;/li&gt;\r\n&lt;li&gt;функциональность;&lt;/li&gt;\r\n&lt;li&gt;стойкость к коррозии;&lt;/li&gt;\r\n&lt;li&gt;декоративность;&lt;/li&gt;\r\n&lt;li&gt;обеспечение герметичности.&lt;/li&gt;\r\n&lt;/ul&gt;','','100','','','');
/*!40000 ALTER TABLE `oc_product_description` ENABLE KEYS */;
UNLOCK TABLES;

